INSERT INTO `hospital` VALUES (1,'上海美未央医疗美容整形医院','4006177321','民营美容医院, 上市集团直投, 国内外专家汇聚','上海市徐汇区漕宝路111号','121.424442,31.167829','千年传承 续写美丽传奇\r\n千年前的盛世汉唐，未央宫的美人们以黛画眉，蘸丹沙点绛唇，引领古代美容潮流。千年后的美未央，传承传统汉唐美学理念，结合现代医学手段，汇聚中、韩、日、台湾等地整形美容大家，运用国际水平的专业技术与顶级医疗美容服务为高标准的求美者提供专业化、国际化、个性化的系列专属整形美容与健康综合解决方案，续写千年的美丽传奇。\r\n上市公司直接投资 明星达人首选医院\r\n上海美未央医疗美容医院坐落于上海市徐汇区漕宝路111号，是由上市公司参与投资的全新理念整形美容医院，明星及时尚人士首选医院。美未央下辖整形美容外科、美容皮肤科、美容口腔科三个核心临床科室，为广大求美者提供涵盖整形美容、激光美肤、皮肤养护、注射美容、牙美容和抗衰老、功能医学、境外医疗等全系列医美服务。\r\n高品质个性化服务 专注医疗技术效果\r\n医院汇聚中、韩、法、日、台湾等地整形美容大家，拥有实力强大的国际级医疗专家团队，国内外最新技术及仪器设备，致力于将中国传统美学与现代医学科技完美融合。应用“尖端技术设备+诊疗手法”为广大求美者提供“时尚+安全”的微整形服务，医院结合美丽与科技，不断创新的医疗美容体系和高品质个性化服务，引领前沿技术。在行业还在批量、流水线式整形时，提倡回归医疗本质，专注医疗技术和效果，为爱美女性提供全方位、个性化的定制医疗美容服务，收到社会各界的广泛赞誉与认可!\r\n','09:00——18:00','o_1a5dr9kht5is1hl72v81h2mal8525515082b8f338.jpg,o_1a5dr9kht5is1hl72v81h2mal8525515085a81bdb.jpg,o_1a5dr9kht5is1hl72v81h2mal8525515093a35155.jpg,o_1a5dr9kht5is1hl72v81h2mal852551508785aaa7.jpg,o_1a5btdcnp1phi1rnc1dpase6vv5ai红蓝光1.JPG,o_1a5btdcnp1phi1rnc1dpase6vv5aiCO2激光.JPG',1),(2,'上海真爱医疗美容医院','02162269000','民营二级医疗美容医院','上海市长宁区延安西路934号','121.431822,31.213147','出身名门，尊贵之享\r\n上海真爱医疗美容医院，前身是境内首家专科医院——上海妇孺医院，源自1935，是专业为女性服务的医院典范。2004年，上海真爱医疗美容医院成立，隶属于上海中医药大学附属曙光医院（三甲），不仅始终传承着1935年的经典，更对自身的服务品质不懈追求，始终站在中国女性需求的最前端。\r\n涅槃重生，突破升级\r\n2014年，上海真爱医疗美容医院华丽转身、专注整形。真爱整形科全线升级，引进世界级医疗设备和器材，多位顶级专家加盟真爱，开创了亚洲品质医美时代、引领高端医美行业的全新突破。\r\n贵宾礼遇，皇室尊享\r\n真爱整形有着曾经对待妇科患者的服务意识基础的存在，“用心服务，用爱塑美”的服务理念本质上区别于其他整形医院。视顾客为亲人，真情相待，是我们给您的全城关爱；一心一意，我们将倾尽所能，为您缔造美丽传奇。','9:00——17:00','o_1a5dogr6mm7c1vd5ue91lkk1j8p282-150302103049516.jpg,o_1a5dogr6mm7c1vd5ue91lkk1j8p282-15030210312aZ.jpg,o_1a5dogr6mm7c1vd5ue91lkk1j8p282-15030210315aZ.jpg,o_1a5dogr6mm7c1vd5ue91lkk1j8p282-1503021031202R.jpg,o_1a5dogr6mm7c1vd5ue91lkk1j8p28zl-04.jpg,o_1a5dogr6mm7c1vd5ue91lkk1j8p28sss-01.jpg',1),(3,'上海天大医疗美容医院','4000139399','业界标杆,VIP五星级管家服务','上海市长宁区中山西路339号','121.411639,31.216086','我院成立于2005年，是上海市唯一一家被评为上海市社会医疗机构皮肤美容优势专科，首家中韩合作的整形外科医院，也是中华见义勇为容貌救护站，第60届世界小姐大赛指定医学美容机构，妙桃隆胸5S特约整形机构，39健康网最受欢迎整形美容医院。下颌整形获得国家专利证书。','9:00——17:30','o_1a5brgtkpeset27s741ufk112j2f24-15052G605401c.JPG,o_1a5brgtkpeset27s741ufk112j2f24-15052G5430D96.JPG,o_1a5brgtkpeset27s741ufk112j2f24-15052G5523L29.JPG,o_1a5brgtkpeset27s741ufk112j2f24-15052G53011921.JPG,o_1a5brgtkpeset27s741ufk112j2f24-15052G51K5547.JPG,o_1a5brgtkpeset27s741ufk112j2f24-15052G5440KC.JPG',1),(4,'上海美尔雅医疗美容医院','021-69002000','中美韩连锁','上海市金沙江路2890弄52号','121.358709,31.24234','上海美尔雅医疗美容门诊部，是韩国木槿花集团在大陆经营的首家国际水准的医疗美容旗舰店，木槿花集团坚持以传播健康生活方式及美丽生活态度为核心理念，将木槿花的芬芳传遍世界的每一个角落，让每一位爱美的人、求美人的人都能享受到专业的安全的美容服务。上海美尔雅医疗美容门诊部位于上海普陀区，整体占地近2500余平米，装修现代，交通便利，环境幽静。美尔雅医疗美容门诊部下设整形美容中心、皮肤美容中心、无创美容中心、口腔美容中心、中医美容中心五大中心科室，开展双眼皮、隆鼻、隆胸、吸脂、年轻化、注射美容、疤痕治疗等各项整形美容项目。美尔雅医疗美容门诊部源自纯正韩国整形技术，沿用木槿花集团总部H9°标准化管理。美尔雅医疗美容专家团队共享木槿花总部数百位专家库，大部分专家库的专家都是就职于国际美业科研研究院，在相关领域都有着绝对的话语权。作为沪上国际医疗美容领导品牌，美尔雅【微整形】＆【整形失败修复】两大项目在华东地区处于绝对领先地位。','9:00-18:00','o_1a6827521o61mgsul6c0ul2m1449822495769.png',1),(5,'上海韩镜医疗美容医院','021-51160088','服务一对一,私密建档,高端体验','上海市伊利南路111号3-4楼','121.425255,31.224153','\"韩镜医疗1999年诞生于韩国首尔，经过15年的稳固发展，现已成为韩国优秀整形水准的代表。2011年，韩镜医疗为了更便捷地服务中国高端女性，朴原辰社长携手太裕璟女士建立了上海韩镜医疗美容医院(YKWONJIN)，韩镜医疗是集整形美容、微整形美、容皮肤美容、抗衰老、口腔美容等服务为一体的全方位纯韩整形美容医院。','09：00—18：00','o_1a6i463ru1lcs1f6d1bq7d71rn611450160059616.jpeg,o_1a6i463ru1lcs1f6d1bq7d71rn611450160059754.jpeg,o_1a6i463ru1lcs1f6d1bq7d71rn611450160059802.jpeg,o_1a6i463ru1lcs1f6d1bq7d71rn611450160059884.jpeg,o_1a6i463ru1lcs1f6d1bq7d71rn611450160059969.jpeg,o_1a6i463ru1lcs1f6d1bq7d71rn611450160060034.jpeg,o_1a6i463ru1lcs1f6d1bq7d71rn611450160060107.jpeg',1),(6,'上海百达丽医疗美容门诊部','021-67662888','高水准技术,一流设备,完善的安全体系','上海市徐汇区虹桥路616号','121.427158,31.193652','上海百达丽医疗美容（上海百达丽医疗美容门诊部有限公司）位于虹桥路616号，由原上海第九人民医院资深整形医生沈国雄创建,拥有三十多名原上海九院、仁济、瑞金、华山、同济等公立三甲医院资深医生。拥有美容外科、美容皮肤科、美容牙科等三大临床支柱科室，并在五官整形、眼鼻修复、体形重塑、自体脂肪移植、乳房整形、微整形注射、抗衰老、激光皮肤美容、牙齿美容及修复等方面形成特色项目，累计上万成功案例，其中多个项目形成专科特色。建院以来，上海百达丽始终坚持以\"技术+设备+服务\"为核心的发展理念，组建了一支技术精湛、素质过硬的专家队伍，秉承\"三甲\"医院高水准技术，引进国际\"金标准\"医疗设备，采用先进的医疗管理体系，将\"患者需求至上、团队合作医疗\"的核心价值文化贯彻到临床实践中，实现患者的梦想，实现员工的人生价值。上海百达丽努力打造国际标准的安全手术空间，拥有国际化标准手术室，德国原装进口麻醉监护系统，标准苏醒监护室等；温馨舒适的病房，24小时贴心服务，使爱美者在温馨与舒适的环境下实现美丽梦想。','09：00——17:30','o_1a6msqbi0156m1g7v5nif8kqm2b1450320106155.jpg,o_1a6msqbi0156m1g7v5nif8kqm2b1450320106399.jpg,o_1a6msqbi0156m1g7v5nif8kqm2b1450320106562.jpg,o_1a6msqbi0156m1g7v5nif8kqm2b1450320106824.jpg,o_1a6msqbi0156m1g7v5nif8kqm2b1450320106963.jpg,o_1a6msqbi0156m1g7v5nif8kqm2b1450320142122.jpg,o_1a6msqbi0156m1g7v5nif8kqm2b1450320151569.jpg',1);
