INSERT INTO `item` VALUES (1,2200.00,1800.00,5,1,'o_1a5e8s4bf17cgj7v1unaa18tho1操作图.jpg,o_1a5e8s4bf17cgj7v1unaa18tho1案例.jpg','埋线双眼皮打造灵动双眸 魅力无限','7,1,2,8,3,5',0,'1',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu0002.png\"/></p><p><br/></p><p><b>姓名：</b></p><p>袁磊<br/><br/></p><p><b>资质：</b></p><p>主治医师<br/><br/></p><p><b>简介：</b><br/>上海美未央美容外科首席注射微整专家，上海九院整形外科硕士，韩国首尔Metro Plastic医院访问学者，上海市科学技术委员会课题撰写人。毕业于上海交通大学医学院附属九院硕士，从事外科整形15年，精细眼鼻整形专家，多次受邀参加韩国、欧美等高峰学术交流会。袁磊主任先后在上海交通大学附属第九人民医院整形外科、上海交通大学附属第三人民医院整形外科、上海市宝山区中心医院整形外科、上海东方医院医疗美容科等公立三甲医院任职多年，2015年被美未央特聘为美未央医院整形外科主诊医生、首席注射微整形专家。临床十余年的实践与学习，让袁主任在眼部、鼻部整形、吸脂、微创注射及内窥镜辅助双平面假体隆胸方面有着得天独厚的优势，特别是引以为豪的注射微整形技术受到广大求美者一致好评。<br/></p>','<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e8s4bf17cgj7v1unaa18tho1%E6%93%8D%E4%BD%9C%E5%9B%BE.jpg\"/><!--EndFragment--><br/><br/>1、个性化设计 打造眼部协调美</p><p style=\"color: rgb(85, 85, 85);\">袁磊医生在术前会根据求美者的五官特征，按照人体的三庭五眼的黄金比例，综合眼与眉的距离，长度，厚度等来做综合性的设计，使双眼皮效果达到化，提升面部的整体协调美。<br/>2、创口微小 形态自然</p><p style=\"color: rgb(85, 85, 85);\">埋线双眼皮的手术方法是在眼皮的部位切开一个容得下缝合线出入的微小切口，然后在皮肤内部进行缝合，将皮肤与提上睑肌腱膜或睑板缝合，形成粘连，从而形成重睑的手术方式。适用于那些眼皮较薄、脂肪较少的求美者。<br/>3、损伤小 恢复快 易修复</p><p style=\"color: rgb(85, 85, 85);\">由于埋线双眼皮手术切口微小，对组织损伤较小，因此术后浮肿较轻，恢复快。若对双眼皮形状不满意，修复也相对容易。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">内双、眼皮一单一双、眼皮薄、无明显脂肪堆积者<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。<br/>2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。<br/>3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀<br/>4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q:埋线双眼皮会留疤痕么?<br/>埋线双眼皮创口微小，愈后痕迹可隐藏在形成双眼皮的褶皱里，肉眼几乎看不出来。<br/>Q:埋线双眼皮能永久保持吗?<br/>埋线可能会有一定的脱落几率，这与医生打结的松紧程度、个人的眼睛条件以及平时的保护等因素有关。一般可维持2年以上。<br/>Q:术后有哪些注意事项?<br/>术后要保持伤口清洁，防止感染，伤口愈合前不要沾水。一个月内忌烟酒，不要吃羊肉、辣椒一类辛辣刺激性食物。</p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu114.png\"/></p>',1,'subcaticon/1448862874.94',1,'2015-11-30 14:10:22','费用仅包含手术费、血常规、凝血四项麻醉','需提前一天预约'),(2,5600.00,4800.00,10,1,'o_1a5gli0fv1r7r1pi617dkelh3uv1122121.jpg,o_1a5e75lft2p5l0p1uue1p0j1fete1564d97052faf6.png,o_1a5e8v5f911aco481jor1g4l1vbd13案例图.jpg','伊婉玻尿酸打造饱满柔和年轻面部 做更美的自己','7,1,2,8,3,5,6',0,'2',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu0002.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">袁磊<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>上海美未央美容外科首席注射微整专家，上海九院整形外科硕士，韩国首尔Metro Plastic医院访问学者，上海市科学技术委员会课题撰写人。毕业于上海交通大学医学院附属九院硕士，从事外科整形15年，精细眼鼻整形专家，多次受邀参加韩国、欧美等高峰学术交流会。袁磊主任先后在上海交通大学附属第九人民医院整形外科、上海交通大学附属第三人民医院整形外科、上海市宝山区中心医院整形外科、上海东方医院医疗美容科等公立三甲医院任职多年，2015年被美未央特聘为美未央医院整形外科主诊医生、首席注射微整形专家。临床十余年的实践与学习，让袁主任在眼部、鼻部整形、吸脂、微创注射及内窥镜辅助双平面假体隆胸方面有着得天独厚的优势，特别是引以为豪的注射微整形技术受到广大求美者一致好评。</p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5gli0fv1r7r1pi617dkelh3uv1122121.jpg\"/><!--EndFragment--><br/><br/>1、伊婉玻尿酸，纯进口，安全!</p><p>经过国家CFDA认证的合法玻尿酸，与瑞蓝玻尿酸同为应用较广的进口玻尿酸，伊婉玻尿酸是人体可代谢吸收的合成物，并且有良好的弹性和粘性，注射到体内不易移动，对填充、塑形有较好的固定性，主要用于除皱、塑形、填充、全面部年轻化，符合人体工程学，在注射时更方便。注入人体后一般没有排异反应，对人体无害。所以可以放心使用哦!<br/>2、效果立显，不影响工作生活</p><p>使用伊婉玻尿酸注射完就可以确定效果，手感也很真实，注射之后稍事休息即可恢复日常的工作和学习，不会影响到正常的社会交往。<br/>3、十余年注射经验微整形经验专家亲自操作 技术精湛 给你精致美美五官</p><p>玻尿酸注射过程就像上帝在造人一样，专家结合独创扇面“三定”注射技术(定位、定层、定量)，把一支剂针分散来打。随后，医生必须要在打进去的玻尿酸还没有变硬之前，捏出合适的形状，操作简单、快速，能帮你在极短时间内塑形成功。<br/><br/></p><p><b>适合人群：</b></p><p>想通过注射改善面部情况等人群<br/><br/></p><p><b>治疗方法：</b></p><p>注射<br/><br/></p><p><b>治疗次数：</b></p><p>大部分一次成型<br/><br/></p><p><b>术前准备：</b></p><p>局部敷麻<br/><br/></p><p><b>手术时长：</b></p><p>30-40分钟<br/><br/></p><p><b>术后是否住院：</b></p><p>否</p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、强烈建议患者在治疗前至少3—4天内，不要服用消炎药(如阿司匹林等)，因为其有可能会加剧注射部位出血和肿胀。<br/>2、对透明质酸过敏者。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q：怎么判断我打的玻尿酸是合格产品呢？<br/>一般正规机构用的都是合格产品，另外，产品上贴的标签都有防伪标示，可以查询。<br/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q</span>：注射玻尿酸有什么优势?<br/>因为玻尿酸是人体自身皮肤组织之一，在人体内停留时间短，会在6-12个月左右被人体分解掉，不会有长期副作用，过敏反应少;注射法，局部仅有微胀微痛感，求美者容易接受。<br/>Q：注射玻尿酸术后注意什么?<br/>1、在注射后24小时内，为了让外形固定，要避免接触注射区域。<br/>2、如果有服用阿司匹林或其它类似药物，可能会增加瘀青及流血的。因此要避免服用。<br/>3、术后1天可以维持一般基础保养程序，不要额外在治疗部位按摩。这是玻尿酸注意事项中最重要的一项。<br/>4、打玻尿酸后不要在注射部位冰敷或热敷，还要做好防晒。<br/>Q：玻尿酸一年进行几次?<br/>选用的是可被人体吸收代谢的玻尿酸，随着时间的推移，效果会逐渐消失，一般情况下进行一次玻尿酸能够维持一年左右，而如果想要长久的维持效果，可根据医生提议按期注射。</p><p><br/></p><p><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu112.png\"/></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e75lft2p5l0p1uue1p0j1fete1564d97052faf6.png\"/><br/></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e8v5f911aco481jor1g4l1vbd13%E6%A1%88%E4%BE%8B%E5%9B%BE.jpg\"/><br/></p>',1,'subcaticon/1448867706.82',1,'2015-11-30 15:24:59','费用仅包含手术费、注射费','需提前一天预约'),(3,7800.00,6800.00,8,1,'o_1a5e90gng1hjf67ehqa1p57guc1k操作图2.jpg,o_1a5e90gng1hjf67ehqa1p57guc1k操作图.jpg,o_1a5e90gng1hjf67ehqa1p57guc1k案例.jpg','硅胶假体隆鼻 搞定立体挺拔美鼻 娇俏鼻型不留痕迹','7,1,2,8,3,5',0,'3',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu0002.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">袁磊<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>上海美未央美容外科首席注射微整专家，上海九院整形外科硕士，韩国首尔Metro Plastic医院访问学者，上海市科学技术委员会课题撰写人。毕业于上海交通大学医学院附属九院硕士，从事外科整形15年，精细眼鼻整形专家，多次受邀参加韩国、欧美等高峰学术交流会。袁磊主任先后在上海交通大学附属第九人民医院整形外科、上海交通大学附属第三人民医院整形外科、上海市宝山区中心医院整形外科、上海东方医院医疗美容科等公立三甲医院任职多年，2015年被美未央特聘为美未央医院整形外科主诊医生、首席注射微整形专家。临床十余年的实践与学习，让袁主任在眼部、鼻部整形、吸脂、微创注射及内窥镜辅助双平面假体隆胸方面有着得天独厚的优势，特别是引以为豪的注射微整形技术受到广大求美者一致好评。</p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e90gng1hjf67ehqa1p57guc1k%E6%93%8D%E4%BD%9C%E5%9B%BE2.jpg\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e90gng1hjf67ehqa1p57guc1k%E6%93%8D%E4%BD%9C%E5%9B%BE.jpg\"/><!--EndFragment--><br/><br/></p><p>1、鼻部综合美学设计</p><p>美未央专家做隆鼻手术不仅是单纯的垫高鼻梁和鼻子单部位的问题，传承东方美女独特的设计，按照美学标准进行多面高精度设，打造出与面部整体和谐的美鼻。</p><p>2、精细微创的美鼻手术</p><div>微创的手术方式，让美鼻更轻松，恢复期更短，鼻部形态更自然，最亲密的人都看不出痕迹。</div><div>3、隆鼻效果自然逼真</div><div>术后鼻子宛如天生，无痛无痕，固定持久，玲珑挺翘，从视觉上和触觉上都达到无可挑剔的美学新高度!<br/>4、痕迹隐藏 正面完全看不出来</div><div>医生会在你的鼻小柱做仅1cm切口，通过精准的剥离骨膜，将假体植入到佳层次，再进行精细缝合，因为切口在鼻下缘，痕迹隐藏，正面完全看不出痕迹来。　　<br/><br/></div><div><b>适合人群：</b></div><div>鼻梁低平，鼻尖低矮，鼻头肥大，想要隆鼻者<br/><br/></div><div><b>治疗方法：</b></div><div>手术<br/><br/></div><div><b>治疗次数：</b></div><div>一次<br/><br/></div><div><b>术前准备：</b><br/>1、隆鼻手术前确定身体健康，无传染性疾病或其他身体炎症<br/>2、做隆鼻手术女性要避开月经期。<br/><br/></div><div><b>手术时长：</b></div><div>60分钟<br/><br/></div><div><b>术后是否住院：</b></div><div>否<br/></div><p><br/></p><div style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></div><div style=\"color: rgb(85, 85, 85);\">1、不要吃刺激性食物;<br/>2、恢复期避免外力挤压鼻子;<br/>3、改掉挖鼻孔、挤黑头等不良生活习惯;<br/>4、定期到医院复查<br/><br/></div><div style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q： 硅胶假体会发生透光吗?<br/>鼻子部位的皮肤是有限的，如果本身鼻部皮肤比较薄，或者放入的假体过大过高，或者层次太浅，鼻头就会容易透光。这就需要医生手术中，合理判断求美者鼻部情况，将假体植入较深层次筋膜下，从而有效降低出现这种情况的可能性。<br/>Q：硅胶假体隆鼻后效果能够维持多长时间，多久需要更换?<br/>因人而异哦，有些可长久维持，但是建议你定期去医院复查，国内也有医生建议，最好十年左右更换硅胶假体。<br/>Q：硅胶假体隆鼻后，歪掉了怎么办?<br/>可以到正规医院进行假体取出的手术，但修复手术要比首次更复杂，所以建议到正规的医院，找经验丰富的医生就诊，他会根据你的自身情况，来设计具体的修复方案哦。</div><p><br/></p><div><b>效果展示：<br/></b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu数01.png\"/><br/></div><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e90gng1hjf67ehqa1p57guc1k%E6%A1%88%E4%BE%8B.jpg\"/><br/></p>',1,'subcaticon/1448870958.6',1,'2015-11-30 16:16:32','费用仅包含手术费、血常规、凝血四项麻醉','需提前一天预约'),(4,4400.00,3800.00,5,1,'o_1a5e97h91kif89a1klg1tpc1fab3v操作图.jpg,o_1a5e97h91kif89a1klg1tpc1fab3v案例.jpg','切开双眼皮手术 打造自然迷人大眼睛','7,1,2,8,3,5,6',0,'4',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu11.png\"/></p><p><br/></p><p><b>姓名：</b><br/>徐丽娟<br/><br/></p><p><b>资质：</b><br/>主诊医生<br/><b><br/></b></p><p><b>简介：</b><br/>徐丽娟主任从事整形外科临床工作十余年，曾在北京大学深圳医院整形外科工作多年，后在上海工作期间，有幸受过中国整复外科事业的创始人之一、中国工程院院士、上海交通大学医学院终身教授张涤生院士的亲自指导。她是中国医师协会美容与整形医师分会会员，整形外科资深医师，被称为最具亲和力的整形专家，成功参与多项重大、高难度整形术，在整形领域开辟了新的视野。这也使得徐主任在整形行业有着不同于其他医生的见解，徐主任将这些简介研究发表于《中国美容医学》《中华医学杂志》等刊物上，受到业界重视，最终被聘为中国医师协会美容与整形医师分会聘为特别会员。<br/></p>','<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e97h91kif89a1klg1tpc1fab3v%E6%93%8D%E4%BD%9C%E5%9B%BE.jpg\"/><!--EndFragment--><br/><br/></p><p style=\"color: rgb(85, 85, 85);\">1、精心设计，制定最佳美眼方案</p><p style=\"color: rgb(85, 85, 85);\">美未央医疗美容徐丽娟主任会结合求美者眼角的局部结构特点，依据求美者眼部特征以及内眦皮肤纹路定制最佳美眼方案，效果自然，宛若天生。<br/>2、术前16项眼部评估 手术精确到0.1mm</p><p style=\"color: rgb(85, 85, 85);\">术前医生会对你的眼部进行全方位评估，如眼睛形态、双眼间距、眉眼间距、眼睛宽高比、五官比例、眼睛宽度、皮肤紧致度、眼窝深浅、内眦情况等16项眼部评估，最终制定最适合你的比例。从而通过切开双眼皮能放大双眼，以其独到的切口轨迹和超精细的手术要求，手术精确到0.1mm，充分依照眼睑的动静态美感。 调整眼间距，使眼睛拉长显亮、睫毛上翘、眼睛形态与面部比例协调，让眼部焕发年轻光彩，闪亮电眼，一步到位。<br/><span>3、</span>全方位的美眼术 手法精细切口隐蔽效果更持久</p><p style=\"color: rgb(85, 85, 85);\">切开双眼皮沿着皮肤的天然纹理做切口，并做精细操作，手术全程使用的也都是全套的精细器械，同时采用Prolene专业缝针缝线，更加确保术后切口能够更好、更快愈合，痕迹隐藏，效果持久。真正做到精雕双眼皮、一次成形，眼睛更大更有灵气动感。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">用于任何类型、任何年龄的单眼皮，对上眼睑皮肤松弛和上睑臃肿者尤为适宜。<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b><br/></b></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b>注意事项：</b></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b><br/></b></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b>常见问题：</b></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮手术时痛不痛?会不会影响视力?</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">切开双眼皮手术仅仅在打麻药针的时候有少许痛，打完麻药后，做双眼皮手术时是不会感到明显疼痛。只要到正规整形医院找资深医师做双眼皮手术，一般不会影响视力。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮术后需要注意哪些事</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">术后要保持伤口清洁，防止感染，在切口愈合前洗脸时注意不要打湿伤口。一个月内忌烟酒，勿食辛辣刺激性食物等。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮手术后会不会发生感染?</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">切开双眼皮手术方法已经比较成熟了，只要是到正规医院做，消毒措施都是很充分的，发生感染的几率是很低的。术后再遵从医嘱进行护理，一般不会有太大问题。</span><!--EndFragment--><br/><br/><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu针4.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e97h91kif89a1klg1tpc1fab3v%E6%A1%88%E4%BE%8B.jpg\"/><br/></p>',1,'subcaticon/1448872918.35',1,'2015-11-30 16:53:03','费用仅包含手术费、血常规、凝血四项麻醉','需提前一天预约'),(5,5500.00,4800.00,11,1,'o_1a5e958h8eleb1vj9ngud12u134操作图.jpg,o_1a5e958h8eleb1vj9ngud12u134案例1.jpg','非手术瘦脸 肉毒素塑造上镜玲珑小脸','7,1,2,8,3,5,6',0,'5',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu0002.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">袁磊<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>上海美未央美容外科首席注射微整专家，上海九院整形外科硕士，韩国首尔Metro Plastic医院访问学者，上海市科学技术委员会课题撰写人。毕业于上海交通大学医学院附属九院硕士，从事外科整形15年，精细眼鼻整形专家，多次受邀参加韩国、欧美等高峰学术交流会。袁磊主任先后在上海交通大学附属第九人民医院整形外科、上海交通大学附属第三人民医院整形外科、上海市宝山区中心医院整形外科、上海东方医院医疗美容科等公立三甲医院任职多年，2015年被美未央特聘为美未央医院整形外科主诊医生、首席注射微整形专家。临床十余年的实践与学习，让袁主任在眼部、鼻部整形、吸脂、微创注射及内窥镜辅助双平面假体隆胸方面有着得天独厚的优势，特别是引以为豪的注射微整形技术受到广大求美者一致好评。</p>','<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e958h8eleb1vj9ngud12u134%E6%93%8D%E4%BD%9C%E5%9B%BE.jpg\"/><!--EndFragment--><br/><br/>1、多点注射见效快</p><p style=\"color: rgb(85, 85, 85);\">衡力注射瘦脸使用微量肉毒素进行面部多点皮下注射，可在短时间内达到理想效果。<br/>2、无需等待，随做随走</p><p style=\"color: rgb(85, 85, 85);\">衡力注射瘦脸是通过肉毒素对咬肌及其支配神经进行麻痹来达到瘦脸的目的，恢复期很短，只消几分钟即可直接回家或去办公室上班，让你的美丽在不</p><p style=\"color: rgb(85, 85, 85);\">3、知不觉中自然展现</p><p style=\"color: rgb(85, 85, 85);\">剂量和操作过程、谨慎，比手术价格便宜而更显经济。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">想通过注射改善面部情况等人群</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">注射<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b></p><p style=\"color: rgb(85, 85, 85);\">局部敷麻<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">约10分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、做前在一周内不能饮酒<br/>2、两周内服用过阿司匹林或其他解热镇痛药<br/>3、对肉毒毒素制品中任何成分过敏者或过敏体质<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q：肉毒素注射有什么副作用吗?<br/>答：有，多为暂时性的。术后常见注射部位肌肉麻痹、肿胀等，常发生在治疗后3-5天，一般2-4周逐渐消退。建议到正规整形医院找专业医生可最大限度的避免。<br/>Q : 肉毒素注射多久可以见效啊?<br/>答：一般1-2周可以见效，个人体质不同也会有所差异。<br/>Q：一次肉毒素注射通常能维持多久呢?<br/>答：通常情况下，一次注射可维持6-12个月左右，为持续维持，可反复注射。建议间隔时间在6个月左右为宜，具体情况请咨询正规医院专业的医生为准，以免引起永久性肌肉麻痹。</p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu%E4%B8%9401.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e958h8eleb1vj9ngud12u134%E6%A1%88%E4%BE%8B1.jpg\"/><br/></p>',1,'subcaticon/1448878789.69',1,'2015-11-30 19:16:30','费用仅包含注射100单位肉毒素','需提前一天预约'),(6,500.00,300.00,12,3,'o_1a5eap8vl1c501uf9ca1nrheaep6-14022615245B54.jpg,o_1a5eap8vl1c501uf9ca1nrheaep5-14030Q2230QH.jpg,o_1a5eap8vl1c501uf9ca1nrheaep5-140314103311F9.jpg','超声波洗牙','7,1,2,8,3',0,'6',1,'<h1></h1><h1 style=\"color: gray;\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/yisheng/yanjun.jpg\"/></h1><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b><br/>闫珺<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b><br/>副主任医师，上海天大美容牙科中心主任，国际牙科联盟(FDI)协会会员，国际牙医师院(ICD)专科医师会员，中华口腔医学会会员<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>从事口腔临床工作20余年，积累了丰富的临床经验，曾先后到四川大学、华西医科大学口腔医学院口腔内科和西安第四军医大学口腔医学院口腔修复科深造。擅长牙周疾病的综合治疗；牙体缺损的微创美学修复；牙列缺损和牙列缺失的美学修复以及牙列不齐的矫治、牙齿美白等美容牙科的治疗。&#65279;</p><p><span></span></p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5eap8vl1c501uf9ca1nrheaep6-14022615245B54.jpg\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5eap8vl1c501uf9ca1nrheaep5-14030Q2230QH.jpg\"/><!--EndFragment--><br/><br/>超声波洗牙是利用超声波洁牙机机头的高频震动，使牙结石受到震动而松脱。喷砂洁牙是利用高压下喷出的可溶性&#34;细砂&#34;(一种钠盐)，将牙齿表面的烟斑、茶垢、色素快速高效地去除，同时有抛光作用，使牙齿表面光洁亮丽、口内清爽。</p><p><br/></p><p><b>技术优势：</b><br/>安全：对牙齿无损伤，整个过程严格执行无菌操作，通过美国FDA认证。<br/>有效：对牙结石、黄牙、烟斑牙等洗后即可看见卓越的美白效果。<br/>快速：一次洗牙，清洁、保健、美齿只需30分钟。<br/>轻松：不需麻醉，在休闲等待中轻松度过。</p><p><br/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b>注意事项：</b></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">注意保洁，轻轻刷牙也是成人洗牙后的注意事项。洗牙后要注意牙齿的保洁工作，早晚刷牙，前一周牙齿会比较敏感，因此刷牙时不要太用力。刚洗牙后的牙齿，会因为牙齿间的污垢消失而感到不习惯，或是牙齿轻微松动的错觉。成人洗牙后的注意不要因此频繁地舔弄、吸吮牙齿、牙龈。更不要用手指、牙签拨弄牙齿，以防因此导致出血感染。</span><!--EndFragment--><br/><br/><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/shanghaitianda/chaoshengboxiya/xiaoguo.jpg\"/></p><p><br/></p><p><br/></p>',1,'subcaticon/1448890069.99',1,'2015-11-30 19:29:13','费用仅包含手术费','需提前1天左右预约'),(7,1200.00,1000.00,4,2,'o_1a5e3etb416g1sbp7tt1mgi1rn49c20150811145324794.jpg,o_1a5e3753kjadiaik09pc1ncn8f20150811145333777.jpg','白瓷娃娃改善肤质 ','7,1,2,8,3',0,'7',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu1-14091ZZ132Q3-2.jpg\"/></p><p><br/></p><p><b>姓名：</b><br/>孔令义<br/><br/></p><p><b>资质：</b><br/>副主任医师<br/><br/></p><p><b>简介：</b><br/>从事皮肤临床及激光美容工作二十余年，知名的医学美容专家，韩国Timepeel医院访问学者、客座教授;国内“金手指”美肤技术奖获得者;中国激光面部换肤术(深层嫩肤术)首席专家;国内最早将激光技术应用于皮肤美容领域的专家之一;首创新&#34;靶向美白&#34;治疗黄褐斑及色素疾病;曾获两项国家发明专利、一项自治区科技进步成果奖;中央电视台播音员、主持人私人皮肤美容顾问，曾任东南亚国家及国内多位当红明星金牌皮肤美容顾问。虽然是业界享誉盛名的&#34;光学美肤圣手&#34;，但是当你和他接触时，却丝毫感觉不到专家的架子，温文尔雅，谦逊温和，身怀绝技但又不露锋芒，能将不堪入目的皮肤起死回生，精湛的技艺、谦虚的态度深受广大求美者喜爱和追捧，大家都愿意把自己的美丽希望托付给他。擅长项目：汽化祛斑、痤疮治疗、彩光嫩肤、射频紧肤除皱、冰点无痛脱毛、皮肤美白；主攻面部深层嫩肤、黄褐斑、抗衰老、面部提升、皮肤光老化以及微整形注射美容。</p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e3etb416g1sbp7tt1mgi1rn49c20150811145324794.jpg\"/><!--EndFragment--><br/><br/><span>通过Q1064超短脉宽模式、ACC1064长脉宽模式、Q1064纯平点阵模式分解皮肤真皮层、真皮深层色素及点状斑，有效祛除皮肤色斑，调节肤色不均，嫩肤美白。&#8232;孔令义医生做白瓷娃娃特点：&#8232;1、无创，非侵入性技术，低疼痛感。&#8232;2、疗效显著，美白、嫩肤、抗衰、收细毛孔、延缓衰老，当次见效，疗程结束后保持时间长，效果明显。</span></p><p><br/></p><p><b>适合人群：</b></p><p>  皮肤粗糙、面色暗沉有斑有细纹<br/><br/></p><p><b>治疗次数：</b></p><p>1次，持续改善需3—6次<br/><b><br/></b></p><p><b>术前准备：</b><br/>近期避免阳光暴晒，不可使用光敏性药物和口服异维A酸。<br/><b><br/></b></p><p><b>手术时长：</b></p><p>30分钟左右<br/><b><br/></b></p><p><b>术后是否住院：</b></p><p>否<br/><b><br/></b></p><p><b>注意事项：</b></p><p><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">白瓷娃娃治疗后，即刻涂抹红霉素、金霉素或百多邦等消炎药膏，治疗部位不要沾水，术后一周内不要吃辛辣带有刺激性的食物，出门注意防晒。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><!--EndFragment--><br/><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu为3.png\"/><br/></p>',1,'subcaticon/1448883461.5',1,'2015-11-30 19:46:13','费用仅包含1次白瓷娃娃','需提前一天预约'),(8,2500.00,2000.00,13,3,'o_1a5eanfogjch1g11ru41pic1vkt85-14030Q21405557.jpg,o_1a5eanfogjch1g11ru41pic1vkt85-140314103A4W0.jpg','冷光牙齿美白','7,1,2,8,3,5,6',0,'8',1,'<h1><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/yisheng/yanjun.jpg\"/></h1><p><br/></p><p><b>姓名：</b><br/>闫珺<br/><br/></p><p><b>资质：</b><br/>副主任医师，上海天大美容牙科中心主任，国际牙科联盟(FDI)协会会员，国际牙医师院(ICD)专科医师会员，中华口腔医学会会员<br/><br/></p><p><b>简介：</b><br/>从事口腔临床工作20余年，积累了丰富的临床经验，曾先后到四川大学、华西医科大学口腔医学院口腔内科和西安第四军医大学口腔医学院口腔修复科深造。擅长牙周疾病的综合治疗；牙体缺损的微创美学修复；牙列缺损和牙列缺失的美学修复以及牙列不齐的矫治、牙齿美白等美容牙科的治疗。&#65279;<br/></p><p></p>','<p>这种技术是一项正流行于欧美的牙齿美白技术，它不仅可以去除牙齿表面的色素沉积，同时可进入牙齿深层达到脱色的效果。操作过程仅需三十分钟，无副作用，美白效果可维持两年以上。<br/><br/></p><p><b>技术优势：</b><br/>医院采用的低温冷光，不产生热效应，完全避免了操作过程中对牙神经的刺激，不会引起牙神经的不适，所以牙齿不会有酸胀感觉。医生会在牙齿全面涂抹昂贵、无害的美白材料之后，全口牙齿一次照射，所以大大缩短了美白时间，只需30分钟，就可以迅速美白全口牙齿，美白时间短，感觉轻松，美白效果明显。天大口腔所用的美白材料具有亲水性 ,在美白过程中又完全不接触牙龈，对牙齿结构不会造成任何损害。<br/>医院引进的美白牙齿过程仅需短短几分钟，无刺激、无副作用，冷光牙齿美白效果可维持2年以上。因此被公认是目前最有效及最安全的牙齿脱色技术。<br/><br/></p><p><b>注意事项：</b><br/>1、冷光美白牙齿后24小时内，牙齿很容易再染上有色物质，必须避免饮用茶、咖啡、可乐、红酒、莓果类饮料、有色牙膏、漱口水等及食用深色食物，同时要避免吸烟。<br/>2、建议患者使用美白牙膏，可减轻冷光美白后食物的再着色。<br/>3、平时饮食也应该尽量减少深色食物，注意口腔卫生，早中晚注意刷牙漱口，保持口腔清洁。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5eanfogjch1g11ru41pic1vkt85-140314103A4W0.jpg\"/><br/></p>',1,'subcaticon/1448888267.3',1,'2015-11-30 19:54:17','费用仅包含手术费','需提前1天左右预约'),(9,4500.00,3800.00,5,2,'o_1a62u43al15en10nu1pis13fu1v7h1p1449650273730.png,o_1a62u43al15en10nu1pis13fu1v7h1p1449650277513.png','韩式三点双眼皮 告别眯眯眼 双眼带电做女神','7,1,2,8,3,5',0,'9',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu1-140QP95P2423.jpg.png\"/></p><p><b><br/></b></p><p><b>姓名：</b><br/>腾彦<br/><br/></p><p><b>资质：</b><br/>主治医师<br/><b><br/></b></p><p><b>简介：</b><br/>腾彦医生是上海真爱医院整形专家，2002年毕业于武汉大学医学院临床医学专业，2003年就任于上海九院整形外科。从事医疗美容工作10余年，积累了丰富的临床经验，她是中华医学会整形外科学会会员、国际美容整形外科学会会员、台湾微整形美容医学会会员、国内首批获玻尿酸和BOTOX注射资格证医生，并先后出访美国、韩国、日本和台湾等国。擅长项目：自体脂肪丰胸、微整形、面部年轻化、面部精细整形等。<br/></p>','<p>微创2-3mm切口 放大双眼调整眼形<br/>韩式三点双眼皮是微创双眼皮的一种，是在眼皮上切开三个长度仅有2-3毫米的不连续的微小伤口，由这三个不连续的小伤口抽出眶隔下脂肪并把双眼皮固定，同时可以微调眼睛形状。除了一些皮肤非常松弛的人，一般人群都可以用这种双眼皮手术方法。<br/>5-7天消肿 1-2个月达到效果</p><p>手术时在设计好的双眼皮位置的内、中、外各切开一小口，缝合固定形成双眼皮，腾彦医生经验丰富，操作轻柔，术后5-7天逐渐消肿，1-2个月可见效果<br/><br/><b>适合人群：</b> </p><p> 单眼皮<br/><br/></p><p><b>治疗方法：</b></p><p>手术<br/><br/></p><p><b>治疗次数：</b></p><p>一次<br/><br/></p><p><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/><b>手术时长：</b></p><p>30-40分钟<br/><b><br/></b></p><p><b>术后是否住院：</b></p><p>否<br/><b><br/></b></p><p><b>注意事项：</b></p><p><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。</span><!--EndFragment--><br/><br/><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu饿02.png\"/><br/></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a62u43al15en10nu1pis13fu1v7h1p1449650277513.png\"/><br/><br/></p>',1,'subcaticon/1448884720.47',1,'2015-11-30 20:05:01','费用仅包含手术费、血常规、凝血四项麻醉','需提前一天预约'),(10,4500.00,3680.00,8,2,'o_1a5e6qbuepni1oat19ll191k1t1kd422.png,o_1a5e6qbuepni1oat19ll191k1t1kd4222.png','假体隆出惊艳鼻型 告别窝瓜脸塌塌鼻','7,1,2,8,3,5',0,'10',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu1-140QP95P2423.jpg.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b><br/>腾彦<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b><br/>主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>腾彦医生是上海真爱医院整形专家，2002年毕业于武汉大学医学院临床医学专业，2003年就任于上海九院整形外科。从事医疗美容工作10余年，积累了丰富的临床经验，她是中华医学会整形外科学会会员、国际美容整形外科学会会员、台湾微整形美容医学会会员、国内首批获玻尿酸和BOTOX注射资格证医生，并先后出访美国、韩国、日本和台湾等国。擅长项目：自体脂肪丰胸、微整形、面部年轻化、面部精细整形等。</p>','<p><span><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6qbuepni1oat19ll191k1t1kd422.png\"/><!--EndFragment--><br/><br/></span>1、与鼻腔相容性好 较少排异刺激</p><p>硅胶假体为高分子硅化物，其有良好的生物相容性。<br/>2、可塑性很强 利于雕刻出适合的鼻型</p><p>质地较硬，富有弹性，易于加工成型，可塑性极强。<br/>3、医生较为熟悉 技术风险较小</p><p>来源广泛，成本较低，应用历史更悠久，多数医生对硅胶材料更熟悉，钳夹后不易变形，对医生技术的要求也相对较低，如果再有高水平的医生可谓是事半功倍哦~<br/><br/></p><p>腾医生治疗特点：<br/>1、设计<br/>强调整体和谐，全面设计，精细操作。<br/>2、隐形逼真</p><p>鼻部整体雕塑中心有精品固体硅胶，仿生材料、自体软骨组织等多种隆鼻材料可以选择，手术的超微切口一般选择在鼻小柱或鼻孔内，待把材料植入后，再精细地缝合切口。术后无疤痕，形态自然逼真。<br/>3、自然持久<br/>鼻型与整体面相和谐搭配，效果持久保持。<br/>4、经验丰富<br/>腾彦专家具有20年以上整形经验，确保术后效果超出你的预期。<br/><br/><b>适合人群：</b> </p><p> 鼻梁低，是鞍鼻、塌鼻<br/><br/></p><p><b>治疗方法：</b></p><p>手术<br/><br/></p><p><b>治疗次数：</b></p><p>一次<br/><br/></p><p><b>术前准备：</b><br/>1、术前两周，要禁烟，禁酒。<br/>2、前两周内，请勿服用含有阿斯匹林的药物<br/>3、患有高血压和糖尿病的患者，应该在初诊时翔实向医生告知病情，以便应诊大夫确认手术方<br/>4、有出血倾向病史的患者要检查血小板和出、凝血时间。<br/><br/><b>手术时长：</b></p><p>60分钟<br/><br/></p><p><b>术后是否住院：</b></p><p>是<br/></p><p><br/><b>注意事项：</b><br/>1、单纯假体植入隆鼻术常规用棉胶粘贴固定鼻背5-7天；<br/>2、术后可视情况而定预防性静脉滴注抗生素2天或口服抗生素3-5天；<br/>3、术后1-2个月内禁止触碰鼻部和戴框架眼镜等，以免假体歪斜。<br/></p><p><br/></p><p><b>展示效果：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6qbuepni1oat19ll191k1t1kd4222.png\"/><br/></p>',1,'subcaticon/1448885239.77',1,'2015-11-30 20:12:39','费用仅包含手术费、血常规，感染五项，凝血五项，麻醉','需提前一天预约'),(11,7000.00,5500.00,8,3,'o_1a5c8ta0n84s6j6h6d19apt9b12案例.jpg','隆鼻国产硅胶','7,1,2,8,3,5,6',0,'11',1,'<h1></h1><h1 style=\"color: gray;\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmuV%201.png\"/></h1><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">任天平<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b><br/>副主任医师，上海天大整形外科学科带头人，中国面部精微整形专家，中国非手术面部年轻化技术倡导者，中国专业非手术注射美容专家，国内内窥镜隆胸先行者<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>从事整形美容临床工作二十余年，在业界享有很高声誉，曾多次与韩日美等整形大师同台手术。经十几年的潜心研究及临床经验，在微整形、面部精雕及隆胸术等整形手术方面都拥有很深的造诣，能将艺术和富有个性的审美观点完美地相结合，为每一位求美的女性朋友进行各种不同要求的整形手术，让她们充满自信和勇气。</p>','<p>植入体采用与人体组织相容性良好的材料、如硅橡胶、膨体聚四氟乙烯（PTFE）等，这些材料性质稳定、不会与其它物质发生反应；无毒性、致癌性 致畸性；质地柔软并易于雕刻塑形；最大的优点是在手术后、病人认为外型不理想时可以较容易完整地取出，而不会留下缺憾。<br/><br/><b>技术优势：</b><br/>假体隆鼻手术就是根据我们身体的特点，使用假体材料来帮助我们进行改善，这样就能够让我们的身体得到明显的改善和提升，给人们的形象带来明显的提升和改善效果。通过手术，我们的鼻子就能够得到得到明显的改善，利用这样的方式我们的容貌就能出现明显的改善效果。<br/>上海天大假体隆鼻，在考虑面部五官的整体协调美的基础上，更充分结合个人的气质特征，为您实现面部立体美奠定了坚实的基础。天大以综合鼻整形大师张景涛亲自为每位求美者量鼻定做个性化俏鼻，细腻精巧的微精操作，靓丽鼻型即刻展现!<br/><br/>上海天大假体隆鼻三大优势--缔造美鼻零负担<br/>A、技术优势：天大综合美鼻技术在亚洲医疗美容界首屈一指，遥遥领先;<br/>B、专项优势：上海天大医院术业有专攻，坚持“一对一”的接待模式;<br/>C、效果优势：每一位专家都是在鼻部整形领域独树一帜的专业技术人才。<br/><br/><b>注意事项：</b></p><p>1、术后不要吃辛辣、刺激的食物。<br/>2、必要时服用抗生素（非必须，遵医嘱）。<br/>3、最好于术后以下时间点来院复查：两天、一周、一个月、三个月以及半年、一年。。<br/>4、保持伤口清洁，一周内避免沾水。<br/>5、注意避免碰撞鼻部，一个月内不能戴框架眼镜。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5c8ta0n84s6j6h6d19apt9b12%E6%A1%88%E4%BE%8B.jpg\"/><br/></b></p>',1,'subcaticon/1448889438.77',1,'2015-11-30 20:14:15','费用仅包含手术费','需提前3天左右预约'),(12,2600.00,1980.00,5,2,'o_1a5e6henqp5a1rh11eicn4p1knucc01.jpg,o_1a5e6henqp5a1rh11eicn4p1knucc02.jpg','埋线双眼皮 不开刀不拆线 双眼保持电力充足','7,1,2,8,3',0,'12',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu1-140QP95P2423.jpg.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b><br/>腾彦<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b><br/>主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>腾彦医生是上海真爱医院整形专家，2002年毕业于武汉大学医学院临床医学专业，2003年就任于上海九院整形外科。从事医疗美容工作10余年，积累了丰富的临床经验，她是中华医学会整形外科学会会员、国际美容整形外科学会会员、台湾微整形美容医学会会员、国内首批获玻尿酸和BOTOX注射资格证医生，并先后出访美国、韩国、日本和台湾等国。擅长项目：自体脂肪丰胸、微整形、面部年轻化、面部精细整形等。</p>','<p><span><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6henqp5a1rh11eicn4p1knucc01.jpg\"/><!--EndFragment--><br/></span><br/></p><p>1、微调眼部轮廓 放大双眼</p><div>埋线双眼皮手术是指通过缝合的方式，直接把缝线（或高分子缝合线）埋藏于皮肤及睑板之间，使上睑皮肤同睑板发生粘连，形成重睑的一种手术。术前可以与医生反复沟通确定方案，依据求美者关于重睑的弧度及宽度等形态要求，即刻便可设计出术后效果形态。<br/>2、手术创伤小无需拆线</div><div>埋线双眼皮手术只有几个针孔大小的创口，手术过程操作简便、创伤小、消肿快、不需拆线，可以避免二次创伤<br/>3、3-5天消肿 1-2个月即可恢复</div><div>埋线双眼皮操作简便，只需将一条线埋入设计好的位置，术后一般一周后即可消肿，1-2个月即达到效果。如果恢复过程中效果不满意可在一周后拆除缝线，不用等到几个月之后。<br/><br/><b>适合人群：</b></div><div><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">睑裂大、眼睑薄、无臃肿、眼睑皮肤无松弛而张力正常、无内眦赘皮的年轻人</span><!--EndFragment--><br/><br/><b>治疗方法：</b></div><div>手术<br/><br/></div><div><b>治疗次数：</b></div><div>一次<br/><br/></div><div><b>术前准备：</b><br/>1、术前两周，要禁烟，禁酒。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。</div><div>3、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</div><div>4、双眼皮手术与近视眼手术之间要相隔至少两个月。</div><div>5、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>6、患有高血压和糖尿病的患者，应该在初诊时翔实向医生告知病情，以便应诊大夫确认手术方案双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>7、做双眼皮手术女性要避开月经期。<br/>8、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/>9、有出血倾向病史的患者要检查血小板和出、凝血时间。<br/><b><br/>手术时长：</b></div><div>30分钟<br/><br/></div><div><b>术后是否住院：</b></div><div>否<br/><br/><b>注意事项：</b><br/>1、刚做完手术，最好用小纱布盖住手术部位，并用冰块进行冷敷，低温会使感觉减弱，减低从麻醉中醒来后可能出现的一点疼痛。需要用塑料袋或塑料泡膜包好冰块轻轻地放在眼睛上面，同时要防止冰块溶化后漏出并进入手术部位而导致细菌感染。</div><div>&#8232;2、避免用不干净的手接触手术部位，否则很有可能导致手术部位细菌感染。&#8232;</div><div>3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;</div><div>4、要注意术后的姿势。例如，低头或趴着看书，会加重肿胀，所以最好仰着头，坐在舒服的椅子上休息;睡觉时也要垫高枕头，这也有助于消肿。</div><div>&#8232;5、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。<br/><br/></div><p><b>效果展示：</b></p><p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6henqp5a1rh11eicn4p1knucc02.jpg\"/><br/><br/></b></p>',1,'subcaticon/1448885748.13',1,'2015-11-30 20:21:47','费用仅包含血手术费、常规、感染五项、凝血五项、麻醉','需提前一天预约'),(13,9000.00,7900.00,8,3,'o_1a5c8rlfbpd81var8bvp25gqbm鼻部.jpg','隆鼻进口硅胶','7,1,2,8,3,5,6',0,'13',1,'<h1 style=\"color: gray;\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmuV%201.png\"/></h1><p><br/></p><p><b>姓名：</b><br/>任天平<br/><br/></p><p><b>资质：</b><br/>副主任医师，上海天大整形外科学科带头人，中国面部精微整形专家，中国非手术面部年轻化技术倡导者，中国专业非手术注射美容专家，国内内窥镜隆胸先行者<br/><br/></p><p><b>简介：</b><br/>从事整形美容临床工作二十余年，在业界享有很高声誉，曾多次与韩日美等整形大师同台手术。经十几年的潜心研究及临床经验，在微整形、面部精雕及隆胸术等整形手术方面都拥有很深的造诣，能将艺术和富有个性的审美观点完美地相结合，为每一位求美的女性朋友进行各种不同要求的整形手术，让她们充满自信和勇气。<br/></p>','<p style=\"color: rgb(85, 85, 85);\"></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5c8rlfbpd81var8bvp25gqbm%E9%BC%BB%E9%83%A8.jpg\"/><!--EndFragment--><br/>植入体采用与人体组织相容性良好的材料、如硅橡胶、膨体聚四氟乙烯（PTFE）等，这些材料性质稳定、不会与其它物质发生反应；无毒性、致癌性 致畸性；质地柔软并易于雕刻塑形；最大的优点是在手术后、病人认为外型不理想时可以较容易完整地取出，而不会留下缺憾。</p><p><br/></p><p><b>技术优势：</b></p><p>1、假体隆鼻手术就是根据我们身体的特点，使用假体材料来帮助我们进行改善，这样就能够让我们的身体得到明显的改善和提升，给人们的形象带来明显的提升和改善效果。通过手术，我们的鼻子就能够得到得到明显的改善，利用这样的方式我们的容貌就能出现明显的改善效果。</p><p>2、上海天大假体隆鼻，在考虑面部五官的整体协调美的基础上，更充分结合个人的气质特征，为您实现面部立体美奠定了坚实的基础。天大以综合鼻整形大师张景涛亲自为每位求美者量鼻定做个性化俏鼻，细腻精巧的微精操作，靓丽鼻型即刻展现!</p><p><br/></p><p>上海天大假体隆鼻三大优势--缔造美鼻零负担</p><p>A、技术优势：天大综合美鼻技术在亚洲医疗美容界首屈一指，遥遥领先;</p><p>B、专项优势：上海天大医院术业有专攻，坚持“一对一”的接待模式;</p><p>C、效果优势：每一位专家都是在鼻部整形领域独树一帜的专业技术人才。</p><p><br/></p><p><b>注意事项：</b></p><p>1、术后不要吃辛辣、刺激的食物。</p><p>2、必要时服用抗生素（非必须，遵医嘱）。</p><p>3、最好于术后以下时间点来院复查：两天、一周、一个月、三个月以及半年、一年。。</p><p>4、保持伤口清洁，一周内避免沾水。</p><p>5、注意避免碰撞鼻部，一个月内不能戴框架眼镜。</p><p style=\"color: rgb(85, 85, 85);\"></p>',1,'subcaticon/1448888037.91',1,'2015-11-30 20:23:57','费用仅包含手术费','需提前3天左右预约'),(14,3500.00,2800.00,10,3,'o_1a5c5t4je13oq27s1qt61rhpue01q8-14030Q04522Y8.jpg,o_1a5c5t4je13oq27s1qt61rhpue01q8-14030Q04550J8.jpg,o_1a5c5t4je13oq27s1qt61rhpue01q8-14030Q04614V8.jpg','润百颜玻尿酸 丰面颊 丰下巴 丰苹果肌','7,1,2,8,3,5,6',0,'14',1,'<h1><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/shanghaitianda/yisheng/minghui.jpg\"/></h1><p><br/></p><p><b>姓名：</b><br/>明慧<br/><br/></p><p><b>资质：</b><br/>上海天大美容皮肤科学科带头人<br/>明星专属私人形象管理顾问<br/>中国微整形美容专家<br/>中华医学会医学美学分会会员<br/>中国医师协会美容医师分会会员<br/>上海激光医学学会会员<br/><br/></p><p><b>简介：</b><br/>在激光美容术、激光嫩肤除皱、激光祛色素斑等激光美容，对微创、无创抗衰老、非手术注射美容等有较深造诣。<br/></p>','<p>丰面颊又称面颊部填充术，面部消瘦给人感觉高度营养不良或长期患有慢性消耗性疾病，由于消瘦显得颧骨高，与同龄人比较，面型呈老化感。丰面颊通过颞部、面部填充使脸型得到改善，而且年轻化。<br/>注射丰下巴是通过注射的方式将丰下巴的材料注入爱美者的下巴处，达到改变脸型的效果，通过针剂注入脸部，可以见效，无复原期，注射后不影响日常工作和生活。见效快，效果好，安全性高，创伤小，是您丰下巴的最佳选择。</p><p>很多漂亮女人，就算五官长得很细致、皮肤也不错，但只要脸上少了“苹果肌”，就会呈现过度削瘦的面相，即使化妆时再努力上腮红，也画不出苹果肌的甜美效果，让人有难以亲近的感觉。尤其是颧骨位置若较少脂肪，整体给人感觉有棱有角、不易亲近。因此采用注射大分子玻尿酸的方式来丰苹果肌的方式成为很多爱美女士的选择。</p><p><br/><b>技术优势：</b><br/>丰满的皮肤有讨喜或亲和力佳的好处，如何丰面颊、下巴、苹果肌而更有效安全呢，相对于假体，注射而不不开刀会是很多人的理想选择。注射到人体内的生物材料制剂，非常安全，不会对人体产生任何副作用。<br/>注射丰面颊、下巴、苹果肌采用的注射材料为玻尿酸、胶原蛋白、爱贝芙等注射填充材料，非生物源性，与人体相容性极好，不会产生副作用，注射后由专业医生为求美者呈现饱满皮肤。<br/><br/>1、三重认证 倍感安心<br/>上海天大医疗美容医院，我们只使用通过了美国FDA、欧盟CE、中国SFDA三大世界先进资深机构认证的安全产品，确保最高品质的注射效果。<br/>2、个性定制 专属设计<br/>首创“整体化形象设计”概念，即根据爱美者年龄、身高、体重、形象气质与职业特点，为您度身定制专属注射丰面颊、下巴、苹果肌方案，风格精细轻柔，成型效果持久稳固、手感逼真;真正悄悄变美，隐形自然。<br/>3、无创美颜 终极利器<br/>精细到0.1mm微创入路，快速、无痕、无痛，无不适感和肿胀，不需要恢复期，随做随走，不影响工作和生活，尽享精致蜕变的奇迹感受!<br/>4、国际专家 引领标准<br/>拥有国际一流专家团队，平均20年整形临床经验，定期与世界资深专技型整形顾问开展学术交流座谈，同台竞技;风格以“微创、精细”为特色， 强调长期、持久的自然美。<br/><br/><b>注意事项：</b><br/>1、注射后6小时内，请尽量避免接触注射区域。可轻柔使用水及肥皂清洁，同时轻微的卸妆是可被允许的。<br/>2、注射后，不要曝晒治疗区域于极热状态，如日光浴或日晒或处于极冷处。<br/>3、注射后，可请患者做湿敷(或冰面膜)以减轻不适感。<br/></p>',1,'subcaticon/1448889491.8',1,'2015-11-30 20:46:00','费用仅包含手术费','需提前1天左右预约'),(15,5000.00,4000.00,10,3,'o_1a5c71do61mev3ba1ursgb6go42s8-14022F95HC15.jpg,o_1a5c71do61mev3ba1ursgb6go42s8-140314143401921.jpg,o_1a5c71do61mev3ba1ursgb6go42s8-140314143424540.jpg','瑞兰玻尿酸 丰面颊 丰下巴 丰苹果肌','7,1,2,8,3,5,6',0,'15',1,'<h1 style=\"color: gray;\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/shanghaitianda/yisheng/minghui.jpg\"/></h1><p><br/></p><p><b>姓名:</b><br/>明慧<br/><br/></p><p><b>资质:</b><br/>上海天大美容皮肤科学科带头人<br/>明星专属私人形象管理顾问<br/>中国微整形美容专家<br/>中华医学会医学美学分会会员<br/>中国医师协会美容医师分会会员<br/>上海激光医学学会会员<br/><br/></p><p><b>简介</b><br/>在激光美容术、激光嫩肤除皱、激光祛色素斑等激光美容，对微创、无创抗衰老、非手术注射美容等有较深造诣。<br/></p>','<p>丰面颊又称面颊部填充术，面部消瘦给人感觉高度营养不良或长期患有慢性消耗性疾病，由于消瘦显得颧骨高，与同龄人比较，面型呈老化感。丰面颊通过颞部、面部填充使脸型得到改善，而且年轻化。<br/>注射丰下巴是通过注射的方式将丰下巴的材料注入爱美者的下巴处，达到改变脸型的效果，通过针剂注入脸部，可以见效，无复原期，注射后不影响日常工作和生活。见效快，效果好，安全性高，创伤小，是您丰下巴的最佳选择。<br/>很多漂亮女人，就算五官长得很细致、皮肤也不错，但只要脸上少了“苹果肌”，就会呈现过度削瘦的面相，即使化妆时再努力上腮红，也画不出苹果肌的甜美效果，让人有难以亲近的感觉。尤其是颧骨位置若较少脂肪，整体给人感觉有棱有角、不易亲近。因此采用注射大分子玻尿酸的方式来丰苹果肌的方式成为很多爱美女士的选择。<br/><br/><b>技术优势：</b><br/>丰满的皮肤有讨喜或亲和力佳的好处，如何丰面颊、下巴、苹果肌而更有效安全呢，相对于假体，注射而不不开刀会是很多人的理想选择。注射到人体内的生物材料制剂，非常安全，不会对人体产生任何副作用。<br/>注射丰面颊、下巴、苹果肌采用的注射材料为玻尿酸、胶原蛋白、爱贝芙等注射填充材料，非生物源性，与人体相容性极好，不会产生副作用，注射后由专业医生为求美者呈现饱满皮肤。<br/><br/>1、三重认证 倍感安心<br/>上海天大医疗美容医院，我们只使用通过了美国FDA、欧盟CE、中国SFDA三大世界先进资深机构认证的安全产品，确保最高品质的注射效果。<br/>2、个性定制 专属设计<br/>首创“整体化形象设计”概念，即根据爱美者年龄、身高、体重、形象气质与职业特点，为您度身定制专属注射丰面颊、下巴、苹果肌方案，风格精细轻柔，成型效果持久稳固、手感逼真;真正悄悄变美，隐形自然。<br/>3、无创美颜 终极利器<br/>精细到0.1mm微创入路，快速、无痕、无痛，无不适感和肿胀，不需要恢复期，随做随走，不影响工作和生活，尽享精致蜕变的奇迹感受!<br/>4、国际专家 引领标准<br/>拥有国际一流专家团队，平均20年整形临床经验，定期与世界资深专技型整形顾问开展学术交流座谈，同台竞技;风格以“微创、精细”为特色， 强调长期、持久的自然美。<br/><br/><b>注意事项：</b><br/>1、注射后6小时内，请尽量避免接触注射区域。可轻柔使用水及肥皂清洁，同时轻微的卸妆是可被允许的。<br/>2、注射后，不要曝晒治疗区域于极热状态，如日光浴或日晒或处于极冷处。<br/>3、注射后，可请患者做湿敷(或冰面膜)以减轻不适感。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5c71do61mev3ba1ursgb6go42s8-14022F95HC15.jpg\"/><br/></b></p><p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5c71do61mev3ba1ursgb6go42s8-140314143401921.jpg\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5c71do61mev3ba1ursgb6go42s8-140314143424540.jpg\"/><br/></b></p><p></p><p></p><p></p><p></p>',1,'subcaticon/1448888128.31',1,'2015-11-30 20:53:55','费用仅包含手术费','需提前1天左右预约'),(16,1400.00,1000.00,9,2,'o_1a5e6frolt3hpalbntuknufbr01.jpg,o_1a5e6frolt3hpalbntuknufbr02.jpg','月光真空脱腋毛 ','7,1,2,8,3',0,'16',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu1-14091ZZ132Q3-2.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b><br/>孔令义<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b><br/>副主任医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>从事皮肤临床及激光美容工作二十余年，知名的医学美容专家，韩国Timepeel医院访问学者、客座教授;国内“金手指”美肤技术奖获得者;中国激光面部换肤术(深层嫩肤术)首席专家;国内最早将激光技术应用于皮肤美容领域的专家之一;首创新&#34;靶向美白&#34;治疗黄褐斑及色素疾病;曾获两项国家发明专利、一项自治区科技进步成果奖;中央电视台播音员、主持人私人皮肤美容顾问，曾任东南亚国家及国内多位当红明星金牌皮肤美容顾问。虽然是业界享誉盛名的&#34;光学美肤圣手&#34;，但是当你和他接触时，却丝毫感觉不到专家的架子，温文尔雅，谦逊温和，身怀绝技但又不露锋芒，能将不堪入目的皮肤起死回生，精湛的技艺、谦虚的态度深受广大求美者喜爱和追捧，大家都愿意把自己的美丽希望托付给他。擅长项目：汽化祛斑、痤疮治疗、彩光嫩肤、射频紧肤除皱、冰点无痛脱毛、皮肤美白；主攻面部深层嫩肤、黄褐斑、抗衰老、面部提升、皮肤光老化以及微整形注射美容。</p>','<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6frolt3hpalbntuknufbr01.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\">月光真空脱毛仪通过美国FDA和中国CFDA的严格审批，它大的特点是采用了真空技术，用负压将皮肤轻轻吸进治疗头，这一技术带来了以下3方面的改进：</p><p style=\"color: rgb(85, 85, 85);\">&#8232;1、皮肤痛感更小&#8232;皮肤被吸引，从而拉伸变薄，降低了皮肤黑色素的密度，相对减少了激光能量对表皮黑色素的刺激，皮肤疼痛感更小。&#8232;</p><p style=\"color: rgb(85, 85, 85);\">2、脱毛效果更好&#8232;真空压力暂时压迫皮肤组织和周围血管，减少氧合血红蛋白和色基对激光能量的竞争性吸收，使更多能量被毛囊里面的黑色素吸收，脱毛效果更彻底。&#8232;</p><p style=\"color: rgb(85, 85, 85);\">3、脱毛效率更高&#8232;真空脱毛仪的治疗光斑扩大至22*35MM，光斑覆盖的皮肤面积较大，大大提高了脱毛效率。缩短了治疗时间。例如脱腋毛，15-30min即可完成。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群： </b></p><p style=\"color: rgb(85, 85, 85);\"> 有腋毛困扰的人群<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">激光<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">3-6次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：<br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6frolt3hpalbntuknufbr02.jpg\"/><br/></b></p>',1,'subcaticon/1448888749.61',1,'2015-11-30 21:13:24','费用仅包含手术费','需提前1天左右预约'),(17,9500.00,7776.00,10,2,'o_1a5e6avtj1ujj6onb51l49a7tak01.jpg,o_1a5e6avtj1ujj6onb51l49a7tak02.jpg,o_1a5e6avtj1ujj6onb51l49a7tak03.jpg','瑞蓝玻尿酸垫下巴 打造尖翘下巴 让脸型更加美丽','7,1,2,8,3,5,6',0,'17',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu请7.png\"/></p><p><br/></p><p><b>姓名：</b></p><p>王屏</p><p><br/></p><div><b>资质：</b><br/>主任医师<br/><br/></div><div><b>简介：</b><br/>毕业于四川泸州医学院，曾在“三甲”医院从事整形临床外科工作20余年，专修于国际著名的北京大学附属第三医院和北京黄寺美容专科医院，2003年成为我国首届医学美容美学设计研究生。<br/>王主任有着丰富的整形美容临床经验和操作技能，对于“美容平面”“黄金分割”等人体美学理论有很深的造诣，完美的将美学设计的理论融入到日常的整形美容实践中，术前的个性化设计，力求将视觉艺术与现代医术结合达到更深层次的审美境界。多次应邀参加韩国美国等国际学术交流，在业界权威期刊上发表学术论文十余篇。</div>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6avtj1ujj6onb51l49a7tak01.jpg\"/><!--EndFragment--><br/><br/></p><p>1、王屏医生从事整形临床外科工作20余年，有着丰富的医美经验，术前会针对你的情况，进行个性化设计，丰满下巴，让脸型更加漂亮。</p><p>2、瑞蓝玻尿酸是由瑞士Q-Med公司生产，已经取得美国FDA认证和中国CFDA认证，质量值得信赖。</p><p>3、瑞蓝玻尿酸是一种水晶般透明的凝胶，它的主要成分是透明质酸，同人体内部的天然透明质酸几乎完全一致，使用前无需经过皮肤测试。<br/>4、在人体内广泛分布着玻尿酸它具有强大的锁水功能，是一种天然保湿因子。而医用注射的玻尿酸是人体玻尿酸相似物，它在代谢的过程中，会结合水取代逐渐减少的容积，使下巴的皮肤变得水水嫩嫩的。<br/><br/><b>适合人群：</b></p><p>下巴短小、后缩  <br/><br/></p><p><b>治疗方法：</b></p><p>注射<br/><br/></p><p><b>治疗次数：</b></p><p>两次<br/><br/></p><p><b>手术时长：</b></p><p>10分钟<br/><br/></p><p><b>术后是否住院：</b></p><p>否</p><p><br/></p><p><b>注意事项：</b></p><p><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">注射部位可能红肿，一般3天左右恢复，少数出现青紫现象，1周可恢复。注射后即刻能上班，1天后洗脸，3-5天能化妆</span><!--EndFragment--><br/><br/><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6avtj1ujj6onb51l49a7tak02.jpg\"/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6avtj1ujj6onb51l49a7tak03.jpg\"/></p>',1,'subcaticon/1448936297.29',1,'2015-12-01 10:50:20','费用仅包含手术费','需提前1天预约'),(18,980.00,680.00,3,2,'o_1a5e6d6ni14491gkv12431buk1s8jba01jpg,o_1a5e6d6ni14491gkv12431buk1s8jba02.jpg','综合祛痘 彻底告别痘痘 还原平滑美肌','7,1,2,8,3',0,'18',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu1-14091ZZ132Q3-2.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b><br/>孔令义<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b><br/>副主任医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>从事皮肤临床及激光美容工作二十余年，知名的医学美容专家，韩国Timepeel医院访问学者、客座教授;国内“金手指”美肤技术奖获得者;中国激光面部换肤术(深层嫩肤术)首席专家;国内最早将激光技术应用于皮肤美容领域的专家之一;首创新&#34;靶向美白&#34;治疗黄褐斑及色素疾病;曾获两项国家发明专利、一项自治区科技进步成果奖;中央电视台播音员、主持人私人皮肤美容顾问，曾任东南亚国家及国内多位当红明星金牌皮肤美容顾问。虽然是业界享誉盛名的&#34;光学美肤圣手&#34;，但是当你和他接触时，却丝毫感觉不到专家的架子，温文尔雅，谦逊温和，身怀绝技但又不露锋芒，能将不堪入目的皮肤起死回生，精湛的技艺、谦虚的态度深受广大求美者喜爱和追捧，大家都愿意把自己的美丽希望托付给他。擅长项目：汽化祛斑、痤疮治疗、彩光嫩肤、射频紧肤除皱、冰点无痛脱毛、皮肤美白；主攻面部深层嫩肤、黄褐斑、抗衰老、面部提升、皮肤光老化以及微整形注射美容。</p>','<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6d6ni14491gkv12431buk1s8jba01jpg\"/><!--EndFragment--><br/>1、专业医生 量身定制治疗方案 </p><p style=\"color: rgb(85, 85, 85);\">为你解决痘痘困扰&#8232;孔令义医生拥有丰富的光电治疗经验，治疗前，他会根据每个求美者的体质特征、痘痘状况及求美需求，量身定制治疗方案，为你解决痘痘困扰。&#8232;</p><p style=\"color: rgb(85, 85, 85);\">2、综合治疗 内调外治 抗菌消炎 根源遏制 </p><p style=\"color: rgb(85, 85, 85);\">全效祛痘&#8232;孔令义医生在治疗痘痘时，先采用综合离子雾化理疗、冷喷、超声波药物导入等对产生青春痘的部位进行杀菌消炎，加速局部微循环，杀死导致青春痘的多种细菌；然后采用点阵光学、纳米波等技术进行全面治疗，达到杀菌、排毒、除疤的治疗效果，后通过真爱调配的药膏调理，修复皮肤胶原蛋白，改善皮肤瑕疵，达到全面祛痘、除印、美白的功效。</p><p style=\"color: rgb(85, 85, 85);\">3、更新肤质 分层调配 </p><p style=\"color: rgb(85, 85, 85);\">不仅祛痘更能美肤&#8232;上海真爱美容医院在治疗痘痘时，根据每个求美者的痘痘情况，采用不同的治疗方案，祛痘同时刺激胶角质层更新，祛痘、嫩肤、美白、平坑四效合一，更新肤质，不仅祛痘更能美肤。<br/><br/><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">轻度、中度痘痘<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>在治疗当天，需要仔细清洁面部，不能有化妆品残留，以防引发感染，保持一个轻松的心情。<br/><br/><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30分钟<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>治疗后的12-24小时内，尽量不沾水，不使用洗面奶，以免伤害新生肌肤。治疗后一个月内注意保湿和防晒，建议选择敷面膜的形式进行补水保湿，外出时注意防晒。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5e6d6ni14491gkv12431buk1s8jba02.jpg\"/><br/><br/></b></p>',1,'subcaticon/1448941876.19',1,'2015-12-01 11:56:42','费用仅包含手术费','需提前一天预约'),(19,6800.00,5000.00,4,1,'o_1a5glkled1gp5dof1u111ue0mpgd233.jpg,o_1a5ef2ir0a6h1kegm871ap91mgr8操作图.jpg,o_1a5ef2ir0a6h1kegm871ap91mgr8仪器.JPG,o_1a5ef2ir0a6h1kegm871ap91mgr8案例.jpg','进口水光注射深层补水 一次注射等于1千次面膜','7,1,2,8,3,5,6',0,'19',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu水光珍.png\"/></p><p><br/><b>姓名：</b><br/>石文瑞<br/><br/></p><p><b>资质：</b><br/>主治医生<br/><br/></p><p><b>简介：</b><br/>石文瑞熟练操作每一台激光仪器，对技术有着娴熟的把握操控，尤其是除皱方面有着很深的造诣，她认为，皮肤的每一层次都有着不同的结构质地，而采用的仪器和使用的方法都不相同，在做美肤整形之前，要对皮肤有着很深的了解，深度的剖析才可以更好的把握美肤仪器的操控。水光针注射、U美极抗衰治疗，激光脱毛、激光除色素痣、王者风范嫩肤、像束激光疤痕修复、痤疮治疗、激光祛斑、祛纹身、敏感性皮肤治疗及全身各部位射频除皱紧肤治疗，微整形抗衰老治疗及注射填充塑形等。<br/></p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5glkled1gp5dof1u111ue0mpgd233.jpg\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5ef2ir0a6h1kegm871ap91mgr8%E6%93%8D%E4%BD%9C%E5%9B%BE.jpg\"/><!--EndFragment--><br/><br/></p><p>1、通过国际与CFDA认证，可放心使用</p><p>水光注射的材料——玻尿酸，是国际公认的较安全的注射材料，玻尿酸又名透明质酸，本身是一种构成人体的天然物质，所以对人体极少有副作用和排斥反应。注射后稳定、自然，又可被吸收，早已获得获食品药品检验局批准进入中国。它是世界非手术美容技术研究中心的推荐产品。<br/>2、水光注射的操作方法，非手术方式，无需恢复期</p><p>水光注射采用的是非手术方式，通过注射的方式为肌肤补充水分，无需开刀就能改善皱纹，保湿肌肤，改善暗沉粗糙的皮肤。整个治疗过程较为简单快速，注射后无浮肿，即可恢复日常生活，是时下非常流行的美容护肤疗法。<br/><span>3、</span>水光注射的适应范围广，让你与明星同在</p><p>水光注射能够有效改善肤质，让肌肤重回年轻态，适合各种肤质类型，就连敏感类型的肤质也可以做水光注射。在韩国娱乐圈内，已经被艺人们当做&#34;日常护肤之宝&#34;，在台湾、香港的演艺圈内也成为众所周知的秘密。<br/><br/></p><p><b>适合人群：</b></p><p>皮肤干燥，面部有细小皱纹，皮肤暗沉、无光泽<br/><br/></p><p><b>治疗方法：</b></p><p>注射<br/><br/></p><p><b>治疗次数：</b></p><p>一次<br/><br/></p><p><b>术前准备：</b></p><p>避开月经期。<br/><br/></p><p><b>手术时长：</b></p><p>20分钟左右<br/><br/></p><p><b>术后是否住院：</b></p><p>否<br/></p><p><br/><b>注意事项：</b><br/>1、注射后一周内禁酒禁烟。<br/>2、注射后一周内尽量避开强烈的紫外线。<br/>3、 注射后5天内尽量避免桑拿或剧烈的运动 。<br/>4、 注射后注意不要用力磨擦治疗部位。<br/><br/></p><p><b>常见问题：</b><br/>Q：水光针注射时疼吗?<br/>可能会有些痛，不过痛感是可以忍受的，而且如果注射面积较大，医生会为你采取表面麻醉，痛感可明显减轻，如果你特别怕痛，可以要求医生为你做表面麻醉，不过术后麻药劲儿过后会有些红肿，一般注射后3天左右疼痛可逐渐缓解。<br/>Q：水光针注射需多次治疗吗?隔多久做一次?<br/>水光针治疗每次有每次的效果，想要持续保持水嫩效果，一般间隔1-2个月做一次，做完一个疗程三次以后效果可以维持1年左右的时间。<br/>Q：注射后能洗脸吗?<br/>在注射后24-48小时内，最好不要让注射部位与水接触，以免引发感染哦。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5ef2ir0a6h1kegm871ap91mgr8%E6%A1%88%E4%BE%8B.jpg\"/><br/></p>',1,'subcaticon/1448963426.9',1,'2015-12-01 18:00:07','费用仅包含1次水光针注射','需提前一天预约'),(20,8000.00,6800.00,10,1,'o_1a5el5vs9e8gff31vta1bjvgam1f操作图.jpg,o_1a5el5vs9e8gff31vta1bjvgam1f案例.jpg','瑞蓝玻尿酸注射美容 打造精致立体饱满面容','7,1,2,8,3,5,6',0,'20',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/xiangmu0002.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">袁磊<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/>上海美未央美容外科首席注射微整专家，上海九院整形外科硕士，韩国首尔Metro Plastic医院访问学者，上海市科学技术委员会课题撰写人。毕业于上海交通大学医学院附属九院硕士，从事外科整形15年，精细眼鼻整形专家，多次受邀参加韩国、欧美等高峰学术交流会。袁磊主任先后在上海交通大学附属第九人民医院整形外科、上海交通大学附属第三人民医院整形外科、上海市宝山区中心医院整形外科、上海东方医院医疗美容科等公立三甲医院任职多年，2015年被美未央特聘为美未央医院整形外科主诊医生、首席注射微整形专家。临床十余年的实践与学习，让袁主任在眼部、鼻部整形、吸脂、微创注射及内窥镜辅助双平面假体隆胸方面有着得天独厚的优势，特别是引以为豪的注射微整形技术受到广大求美者一致好评。</p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5el5vs9e8gff31vta1bjvgam1f%E6%93%8D%E4%BD%9C%E5%9B%BE.jpg\"/><!--EndFragment--><br/><br/></p><p>1、通过FDA、CFDA认证，质量有保证 千万人正在使用<br/>瑞蓝玻尿酸是荣获FDA及CFDA双重认证的注射用玻尿酸产品。目前瑞蓝在全球范围内已有超过千万人次使用，打造自然面孔，质量有保障。<br/>2、瑞蓝玻尿酸的效果比较自然</p><p>它采用独有的NASHA®专利技术，使其透明质酸成分接近于人体天然透明质酸，结构稳定，注射后组织相容性好因此塑形效果较好。由于瑞蓝玻尿酸的功效并非永久性的，避免了因为面部随时间推移从而产生的外貌永久性改变的遗憾。<br/><span>3、</span>非动物性来源的瑞蓝玻尿酸</p><p>瑞蓝为非动物性来源透明质酸，因此引发过敏反应或动物病菌的几率都很低。自体可吸收代谢玻尿酸。<br/><span>4、</span>精准把握注射层次和剂量 快速实现饱满立体</p><p>医生在操作玻尿酸丰唇时，非常熟悉皮肤解剖结构，精准把握注射剂量和层次，快速实现饱满立体效果。<br/><br/></p><p><b>适合人群：</b></p><p>想通过注射改善面部情况等人群<br/><br/></p><p><b>治疗方法：</b></p><p>注射<br/><b><br/></b></p><p><b>治疗次数：</b></p><p>大部分一次成型<br/><b><br/></b></p><p><b>术前准备：</b></p><p>局部敷麻<br/><b><br/></b></p><p><b>手术时长：</b></p><p>30-40分钟<br/><br/></p><p><b>术后是否住院：</b></p><p>否<br/></p><p><br/><b>注意事项：</b><br/>1、强烈建议患者在治疗前至少3—4天内，不要服用消炎药(如阿司匹林等)，因为其有可能会加剧注射部位出血和肿胀。<br/>2、对透明质酸过敏者。<br/><br/></p><p><b>常见问题：</b><br/>Q：怎么判断我打的玻尿酸是合格产品呢？<br/>一般正规机构用的都是合格产品，另外，产品上贴的标签都有防伪标示，可以查询。<br/><!--StartFragment--><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：</span>注射玻尿酸有什么优势?<br/>因为玻尿酸是人体自身皮肤组织之一，在人体内停留时间短，会在6-12个月左右被人体分解掉，不会有长期副作用，过敏反应少;注射法，局部仅有微胀微痛感，求美者容易接受。<br/>Q：注射玻尿酸术后注意什么?<br/>1、在注射后24小时内，为了让外形固定，要避免接触注射区域。<br/>2、如果有服用阿司匹林或其它类似药物，可能会增加瘀青及流血的。因此要避免服用。<br/>3、术后1天可以维持一般基础保养程序，不要额外在治疗部位按摩。这是玻尿酸注意事项中最重要的一项。<br/>4、打玻尿酸后不要在注射部位冰敷或热敷，还要做好防晒。<br/>Q：玻尿酸一年进行几次?<br/>选用的是可被人体吸收代谢的玻尿酸，随着时间的推移，效果会逐渐消失，一般情况下进行一次玻尿酸能够维持一年左右，而如果想要长久的维持效果，可根据医生提议按期注射。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a5el5vs9e8gff31vta1bjvgam1f%E6%A1%88%E4%BE%8B.jpg\"/><br/></p>',1,'subcaticon/1448969744.72',1,'2015-12-01 19:39:25','费用仅包含手术费、注射费','需提前一天预约'),(21,6900.00,5800.00,5,1,'o_1a6034hjs1fod59r1f2nt7rsj9m1449556096032.jpg,o_1a605j6flnpgpu2fqkfn28r81449557496542.png','韩式双眼皮塑造靓丽眼眸 成就韩式气质女神','7,1,2,8,3,5,6',0,'21',1,'<p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6034hjs1fod59r1f2nt7rsj9m1449555614571.png\"/><br/></b></p><p><b><br/></b></p><p><b>姓名：</b></p><p><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">袁磊</span><!--EndFragment--><br/><b><br/></b></p><p><b>资质：</b></p><p>主治医师</p><p><b><br/></b></p><p><b>简介：</b></p><p><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">上海美未央美容外科首席注射微整专家，上海九院整形外科硕士，韩国首尔Metro Plastic医院访问学者，上海市科学技术委员会课题撰写人。毕业于上海交通大学医学院附属九院硕士，从事外科整形15年，精细眼鼻整形专家，多次受邀参加韩国、欧美等高峰学术交流会。袁磊主任先后在上海交通大学附属第九人民医院整形外科、上海交通大学附属第三人民医院整形外科、上海市宝山区中心医院整形外科、上海东方医院医疗美容科等公立三甲医院任职多年，2015年被美未央特聘为美未央医院整形外科主诊医生、首席注射微整形专家。临床十余年的实践与学习，让袁主任在眼部、鼻部整形、吸脂、微创注射及内窥镜辅助双平面假体隆胸方面有着得天独厚的优势，特别是引以为豪的注射微整形技术受到广大求美者一致好评。</span><br/></p>','<p></p><p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6034hjs1fod59r1f2nt7rsj9m1449555614040.png\"/><br/></b></p><p><b><br/></b></p><p><title></title><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKerning></w:PunctuationKerning><w:View>Normal</w:View><w:Compatibility><w:DontGrowAutofit></w:DontGrowAutofit><w:BalanceSingleByteDoubleByteWidth></w:BalanceSingleByteDoubleByteWidth><w:DoNotExpandShiftReturn></w:DoNotExpandShiftReturn><w:UseFELayout></w:UseFELayout></w:Compatibility><w:Zoom>0</w:Zoom></w:WordDocument></xml><![endif]--><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\"false\"  DefUnhideWhenUsed=\"tru