sdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Dark List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Shading Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Grid Accent 6\" ></w:LsdException><br /></w:LatentStyles></xml><![endif]--><!--StartFragment--></p><p class=\"p\">1、个性化设计，打造适合你的双眼皮</p><p class=\"p\">术前袁磊医生会根据你的眼部情况，根据你的要求，结合气质、脸型等，进行个性化设计，打造适合你的双眼皮形态。</p><p class=\"p\">2、韩式微创三点式双眼皮，痕迹隐藏</p><p class=\"p\">韩式微创双眼皮为三点式，袁医生会在你的眼皮上确定3个1-3mm的小切口，去除多余的脂肪和组织，之后进行缝合，术后疤痕比较小，还可以很好的隐藏在双眼皮的褶皱里。</p><p class=\"p\">3、切口小，术后恢复快，对工作和生活影响小</p><p class=\"p\">每个切口仅1-3mm，创伤小，术后恢复较快，两周左右就能基本消肿，对工作和生活影响比较小。</p><p class=\"p\"><br/></p><p><b>适合人群：</b></p><p></p><p>单眼皮</p><p><br/></p><p></p><p><b>治疗方法：</b></p><p></p><p>手术</p><p><br/></p><p></p><p><b>治疗次数：</b></p><p>一次</p><p><br/></p><p><b>术前准备：</b></p><p></p><p>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</p><p>2、双眼皮手术与近视眼手术之间要相隔至少两个月。</p><p>3、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症。</p><p>4、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<b></b></p><p><br/></p><p></p><p><b>手术时长：</b></p><p></p><p>30-40分钟</p><p><br/></p><p></p><p><b>术后是否住院：</b></p><p>否</p><p><br/></p><p><b>注意事项：</b></p><p></p><p><span style=\"color: rgb(51,51,51);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><span style=\"color: rgb(51,51,51);\"></span></p><p><span style=\"color: rgb(51,51,51);\">2、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。</span><span style=\"color: rgb(51,51,51);\"><br/></span><span style=\"color: rgb(51,51,51);\">3、术后尽量垫高头部减轻肿胀。</span><span style=\"color: rgb(51,51,51);\"></span></p><p></p><p><b><br/></b></p><p><b>常见问题：</b></p><p><title></title><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridE