ium Shading 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium List 1 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium List 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 1 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 3 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Dark List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Shading Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Grid Accent 6\" ></w:LsdException><br /></w:LatentStyles></xml><![endif]--><!--StartFragment--></p><p class=\"p\">Q：韩式双眼皮术后会不会留明显疤痕?</p><p class=\"p\">术后不会留下明显的疤痕，医生的缝合很精细，切口位置会很好的隐藏起来，且随着时间变化，切口痕迹会越来越淡。</p><p class=\"p\">Q：双眼皮手术会影响视力吗?</p><p class=\"p\">双眼皮手术不会影响视力，因为手术部位是在眼睑上,有经验的医生手术时一般不会伤到眼球。所以亲们一定要到正规医院找有资质的医生进行手术，才能最大限度降低风险!</p><p class=\"p\">Q：做完双眼皮日常生活中要注意哪些?</p><p class=\"p\">韩式双眼皮手术对日常生活的影响是比较小的，术后要保持伤口清洁，防止感染，伤口愈合前不要沾水。一周之内不要化妆，一个月内忌烟酒，不要吃羊肉、辣椒一类 辛辣刺激性食物。悄悄告诉你，术后要多做睁眼的练习，记住一定要在不抬眉的状态下，向斜上方15°-30°看，这样会使之后的效果更佳，更自然。</p><p><br/></p><p></p><p><b>效果展示：</b></p><p><b><br/><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6034hjs1fod59r1f2nt7rsj9m1449555614458.png\"/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6034hjs1fod59r1f2nt7rsj9m1449555615192.png\"/><br/></b></p><p></p>',1,'subcaticon/1449628244.05',1,'2015-12-08 14:38:34','费用仅包含手术费、血常规、凝血四项麻醉','需要提前一天预约'),(22,6600.00,5800.00,5,1,'o_1a605cg721ueij9bbpl1n001mr9bo1449557223421.jpg,o_1a605cg721ueij9bbpl1n001mr9bo1449558399811.jpg','上海九院硕士独创袁氏双眼皮 比韩式更美观大方自然','7,1,2,8,3,5,6',0,'22',1,'<p style=\"color: rgb(85, 85, 85);\"><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6034hjs1fod59r1f2nt7rsj9m1449555614571.png\"/><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">袁磊</span><br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">上海美未央美容外科首席注射微整专家，上海九院整形外科硕士，韩国首尔Metro Plastic医院访问学者，上海市科学技术委员会课题撰写人。毕业于上海交通大学医学院附属九院硕士，从事外科整形15年，精细眼鼻整形专家，多次受邀参加韩国、欧美等高峰学术交流会。袁磊主任先后在上海交通大学附属第九人民医院整形外科、上海交通大学附属第三人民医院整形外科、上海市宝山区中心医院整形外科、上海东方医院医疗美容科等公立三甲医院任职多年，2015年被美未央特聘为美未央医院整形外科主诊医生、首席注射微整形专家。临床十余年的实践与学习，让袁主任在眼部、鼻部整形、吸脂、微创注射及内窥镜辅助双平面假体隆胸方面有着得天独厚的优势，特别是引以为豪的注射微整形技术受到广大求美者一致好评。</span></p>','<div><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a605cg721ueij9bbpl1n001mr9bo1449557222808.jpg\"/></div><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a605cg721ueij9bbpl1n001mr9bo1449557221795.jpg\"/><!--EndFragment--><br/><b><br/></b></p><p><title></title><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKern