me=\"Medium List 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 1 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 3 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Dark List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Shading Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Grid Accent 6\" ></w:LsdException><br /></w:LatentStyles></xml><![endif]--><!--StartFragment--></p><p class=\"p\">1、袁氏改良重睑术是在最大程度上达到翘睫效果，弧度更美观。</p><p class=\"p\">2、传统韩式三点比较浅，袁氏改良重睑术可以做出更深邃的效果。</p><p class=\"p\">3、袁氏改良重睑术更接近自然，具有生理性的双眼皮解构。</p><p class=\"p\">4、袁氏改良重睑术改变传统技术的局限，甚至可以做欧式平行双眼皮，满足更多的需求。</p><p class=\"p\">5、传统韩式三点脱落率较高，袁氏改良重睑术至少可以降低一倍以上的脱落率。</p><!--EndFragment--><p><br/></p><p></p><p><b>适合人群：</b></p><p>单眼皮</p><p><br/></p><p><b>治疗方法：</b></p><p>手术</p><p><b><br/></b></p><p><b>治疗次数：</b></p><p>一次</p><p><b><br/></b></p><p><b>术前准备：</b></p><p></p><p>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</p><p>2、双眼皮手术与近视眼手术之间要相隔至少两个月。</p><p>3、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症。<b></b></p><p><br/></p><p></p><p><b>手术时长：</b></p><p></p><p>30-40分钟</p><p><br/></p><p></p><p><b>术后是否住院：</b></p><p></p><p>否<b></b></p><p><b><b><br/></b></b></p><p><b><b>注意事项：</b></b></p><p></p><p><span style=\"color: rgb(51, 51, 51);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><span style=\"color: rgb(51,51,51);\"></span></p><p><span style=\"color: rgb(51, 51, 51);\">2、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。</span><span style=\"color: rgb(51, 51, 51);\"><br/></span><span style=\"color: rgb(51, 51, 51);\">3、术后尽量垫高头部减轻肿胀。</span><b><span style=\"color: rgb(51,51,51);\"></span></b></p><p><span style=\"color: rgb(51, 51, 51);\"><br/></span></p><p></p><p></p><p><b>常见问题：</b></p><p><title></title><!--[if gte mso 9]><xml><w:WordDocument><w:BrowserLevel>MicrosoftInternetExplorer4</w:BrowserLevel><w:DisplayHorizontalDrawingGridEvery>0</w:DisplayHorizontalDrawingGridEvery><w:DisplayVerticalDrawingGridEvery>2</w:DisplayVerticalDrawingGridEvery><w:DocumentKind>DocumentNotSpecified</w:DocumentKind><w:DrawingGridVerticalSpacing>7.8 磅</w:DrawingGridVerticalSpacing><w:PunctuationKerning></w:PunctuationKerning><w:View>Normal</w:View><w:Compatibility><w:DontGrowAutofit></w:DontGrowAutofit><w:BalanceSingleByteDoubleByteWidth></w:BalanceSingleByteDoubleByteWidth><w:DoNotExpandShiftReturn></w:DoNotExpandShiftReturn><w:UseFELayout></w:UseFELayout></w:Compatibility><w:Zoom>0</w:Zoom></w:WordDocument></xml><![endif]--><!--[if gte mso 9]><xml><w:LatentStyles DefLockedState=\"false\"  DefUnhideWhenUsed=\"true\"  DefSemiHidden=\"true\"  DefQFormat=\"false\"  DefPriority=\"99\"  LatentStyleCount=\"260\" ><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Normal\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 1\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 2\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 3\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 4\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 5\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"heading 6\" ></w:LsdException><br /><w:LsdException Loc