ame=\"Light List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Light Grid Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Shading 1 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Shading 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium List 1 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium List 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 1 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 2 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Medium Grid 3 Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Dark List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Shading Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful List Accent 6\" ></w:LsdException><br /><w:LsdException Locked=\"false\"  Priority=\"99\"  SemiHidden=\"false\"  Name=\"Colorful Grid Accent 6\" ></w:LsdException><br /></w:LatentStyles></xml><![endif]--><!--StartFragment--></p><p class=\"p\">Q：袁氏双眼皮手术会留下疤痕吗?</p><p class=\"p\">袁氏双眼皮手术切口是隐藏的，不会留下明显的痕迹。而且选择正规机构和找经验丰富的医生缝合操作比较精细，术后痕迹隐藏更好。</p><p class=\"p\">Q：袁氏双眼皮手术后会不会发生感染?</p><p class=\"p\">袁氏双眼皮手术方法已经比较成熟了，只要是到正规医院做，消毒措施都是很充分的，发生感染的几率是很低的。术后再遵从医嘱进行护理，一般不会有太大问题。</p><p class=\"p\">Q：术后有哪些注意事项?</p><p class=\"p\">术后要保持伤口清洁，防止感染，伤口愈合前不要沾水。一个月内忌烟酒，不要吃羊肉、辣椒一类辛辣刺激性食物。出现问题要及时联系医生哦!<b></b></p><!--EndFragment--><p><br/></p><p></p><p><b>效果展示：</b></p><p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a605cg721ueij9bbpl1n001mr9bo1449557221588.jpg\"/><br/><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a605cg721ueij9bbpl1n001mr9bo1449558297898.png\"/><br/><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a605cg721ueij9bbpl1n001mr9bo1449558314033.png\"/><br/><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a605cg721ueij9bbpl1n001mr9bo1449558308702.png\"/><br/></b></p><p></p><p></p><p></p><p></p>',1,'subcaticon/1449628257.82',1,'2015-12-08 15:06:30','费用仅包含手术费、血常规、凝血四项麻醉','需要提前一天预约'),(23,4400.00,3800.00,5,2,'o_1a6084ai813r01snp1qms16ue11p011449560134991.jpg,o_1a6084ai813r01snp1qms16ue11p011449560736420.png','全切让你告别单眼皮 塑造精致明眸亮眼','7,1,2,8,3,5,6',0,'23',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6084ai813r01snp1qms16ue11p011449560273668.png\"/><!--EndFragment--></p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p></p><p><span style=\"color: rgb(51, 51, 51);\">腾彦</span><span></span></p><p><b style=\"color: rgb(85, 85, 85);\"><br/></b></p><p></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"></span></p><p><span style=\"color: rgb(51,51,51);\">腾彦医生是上海真爱医院整形专家，2002年毕业于武汉大学医学院临床医学专业，2003年就任于上海九院整形外科。从事医疗美容工作10余年，积累了丰富的临床经验，她是中华医学会整形外科学会会员、国际美容整形外科学会会员、台湾微整形美容医学会会员、国内首批获玻尿酸和BOTOX注射资格证医生，并先后出访美国、韩国、日本和台湾等国。擅长项目：自体脂肪丰胸、微整形、面部年轻化、面部精细整形等。</span></p><p></p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6084ai813r01snp1qms16ue11p011449560273076.png\"/></p><!--EndFragment--><p><br/></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\"><br/></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">1、全切双眼皮手术就是将上眼皮做一个切口，然后根据你眼部情况，祛除多余的脂肪和皮肤，后缝合切口，还你优美双眼皮线条。</span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">2、术前，腾彦医生会根据你眼睛情况，精心设计，手绘术后效果图，力求为你打造精致电眼。</span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">3、腾彦医生在操作全切双眼皮手术时，她根据术前设计，在每侧上眼皮做一个切口，然后根据你眼部情况，有效祛除多余皮肤和脂肪等综合处理，后将皮肤与上睑提肌进行缝合，塑造自然优美双眼皮。</span><span style=\"color: rgb(51,51,51);\"></span></p><p><span style=\"color: rgb(51,51,51);\">4、腾彦医生从事医疗美容多年，积累了丰富的临床经验，她熟悉全切双眼皮手术操作，术后恢复期较快，一般术后5-6天拆线，15天基本消肿，减少对日常用眼的影响。</span></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">单眼皮</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b></p><p style=\"color: rgb(85, 85, 85);\"></p><p>1、术前两周，要禁烟，禁酒。</p><p></p><p>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。</p><p>3、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</p><p></p><p></p><p style=\"color: rgb(85, 85, 85);\"><b></b></p><p>4、双眼皮手术与近视眼手术之间要相隔至少两个月。</p><p>5、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物。</p><p></p><p>6、患有高血压和糖尿病的患者，应该在初诊时翔实向医生告知病情，以便应诊大夫确认手术方案双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症。</p><p></p><p></p><p></p><p>7、做双眼皮手术女性要避开月经期。</p><p></p><p>8、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。</p><p></p><p>9、有出血倾向病史的患者要检查血小板和出、凝血时间。</p><p></p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-60分钟</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<b></b></p><p style=\"color: rgb(85, 85, 85);\"><b><b><br/></b></b></p><p style=\"color: rgb(85, 85, 85);\"><b><b>注意事项：</b></b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(51, 51, 51);\"></span></p><p><span style=\"color: rgb(51,51,51);\">1、刚做完手术，最好用小纱布盖住手术部位，并用冰块进行冷敷，低温会使感觉减弱，减低从麻醉中醒来后可能出现的一点疼痛。需要用塑料袋或塑料泡膜包好冰块轻轻地放在眼睛上面，同时要防止冰块溶化后漏出并进入手术部位而导致细菌感染。</span><span style=\"color: rgb(51,51,51);\"><br/></span></p><p></p><p><span style=\"color: rgb(51,51,51);\">2、避免用不干净的手接触手术部位，否则很有可能导致手术部位细菌感染。</span><span style=\"color: rgb(51,51,51);\"><br/></span><span style=\"color: rgb(51,51,51);\">3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。</span><span style=\"color: rgb(51,51,51);\"><br/></span></p><p></p><p><span style=\"color: rgb(51,51,51);\">4、要注意术后的姿势。例如，低头或趴着看书，会加重肿胀，所以最好仰着头，坐在舒服的椅子上休息;睡觉时也要垫高枕头，这也有助于消肿。</span><span style=\"color: rgb(51,51,51);\"><br/></span><span style=\"color: rgb(51,51,51);\">5、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。</span></p><p></p><p></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(51, 51, 51);\"></span><b><span style=\"color: rgb(51, 51, 51);\"></span></b></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6084ai813r01snp1qms16ue11p011449560273453.png\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6084ai813r01snp1qms16ue11p011449560130196.jpg\"/><br/></b></p>',1,'subcaticon/1449559998.23',1,'2015-12-08 15:45:36','血常规，感染五项，凝血五项，麻醉','需提前一天预约'),(24,2600.00,2080.00,10,2,'o_1a60kgbatp8skn21iqqmf7pk11449573009934.png,o_1a60kgbatp8skn21iqqmf7pk11449573014974.png','韩国进口伊婉玻尿酸 隆鼻丰唇垫下巴给你精致侧颜','7,1,2,8,3,5,6',0,'24',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a609129p1vgn1hkf1tu66121rm61b1449561016429.png\"/><!--EndFragment--></p><p><b><br/></b></p><p><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"></span></p><p><span style=\"color: rgb(51,51,51);\">王屏</span></p><p><b><br/></b></p><p></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\"></p><p>主任医师</p><p></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"></span></p><p style=\"text-align: left;\"></p><p style=\"text-align: left;\"></p><p>毕业于四川泸州医学院，曾在“三甲”医院从事整形临床外科工作20余年，专修于国际著名的北京大学附属第三医院和北京黄寺美容专科医院，2003年成为我国首届医学美容美学设计研究生。王主任有着丰富的整形美容临床经验和操作技能，对于“美容平面”“黄金分割”等人体美学理论有很深的造诣，完美的将美学设计的理论融入到日常的整形美容实践中，术前的个性化设计，力求将视觉艺术与现代医术结合达到更深层次的审美境界。多次应邀参加韩国美国等国际学术交流，在业界权威期刊上发表学术论文十余篇。</p><p style=\"text-align: left;\"></p><p></p><p style=\"text-align: left;\"></p><p></p><p></p><p></p><p></p><p></p><p></p>','<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a609129p1vgn1hkf1tu66121rm61b1449560993367.png\"/><!--EndFragment--></p><p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a609129p1vgn1hkf1tu66121rm61b1449560993477.png\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a609129p1vgn1hkf1tu66121rm61b1449560993569.png\"/><!--EndFragment--><br/><br/></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">真爱微整形专家王屏主任介绍说，玻尿酸作为填充材料的效果是非常好的。用它来填补凹陷低洼处容易塑形，安全性较高，一般没有过敏的反应，治疗时间短，手术安全，注射美容，愈后一般不会留下疤痕，术后维持的时间较长约<font face=\"微软雅黑\">6-12</font><font face=\"宋体\">个月。</font></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\"><font face=\"宋体\"><br/></font></span></p><p class=\"p\"><span class=\"15\" style=\"color: rgb(51,51,51);\"><b>分层注射，效果持久</b></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">王医生采用<font face=\"微软雅黑\">“</font><font face=\"宋体\">分层定位注射</font><font face=\"微软雅黑\">”</font><font face=\"宋体\">，精确到特定皮肤层，一样的剂量，能打出不一样的效果与持久度。</font></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span class=\"15\" style=\"color: rgb(51,51,51);\"><b><br/></b></span></p><p class=\"p\"><span class=\"15\" style=\"color: rgb(51,51,51);\"><b>伊婉玻尿酸的特点</b></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">1.<font face=\"宋体\">伊婉玻尿酸已通过</font><font face=\"微软雅黑\">CFDA</font><font face=\"宋体\">认证，是国家批准使用的玻尿酸注射品牌之一；</font></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">2.<font face=\"宋体\">伊婉玻尿酸制造采用</font><font face=\"微软雅黑\">BDDE</font><font face=\"宋体\">交联工艺，是高分子量玻尿酸，为塑形提供了更好保障，更持久效果；</font></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">3.<font face=\"宋体\">伊婉玻尿酸为微生物发酵，非动物来源，避免了动物性病毒感染及禽类抗原性过敏；</font></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">4.<font face=\"宋体\">伊婉是高浓度的游离透明质酸，环绕在凝胶颗粒的周围，提供更高的粘弹性和稳定性，塑形效果更加自然；</font></span><span style=\"color: rgb(51,51,51);\"></span></p><p class=\"p\"><span style=\"color: rgb(51,51,51);\">5.<font face=\"宋体\">伊婉玻尿酸分子小，更接近人体结构，填充塑形同时保湿效果更好。</font></span></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">注射</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">10分钟</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<b></b></p><p style=\"color: rgb(85, 85, 85);\"><b><b><br/></b></b></p><p style=\"color: rgb(85, 85, 85);\"><b><b>注意事项：</b></b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(51, 51, 51);\"></span></p><p><span style=\"color: rgb(102,102,102);\">注射部位可能红肿，一般3天左右恢复，少数出现青紫现象，1周可恢复。注射后即刻能上班，1天后洗脸，3-5天能化妆。</span><span></span></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：<br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a609129p1vgn1hkf1tu66121rm61b1449560993203.png\"/><br/></b></p><p style=\"color: rgb(85, 85, 85);\"></p>',1,'subcaticon/1449560926.5',1,'2015-12-08 15:58:47','费用仅包含手术费','需提前一天预约'),(25,7000.00,5000.00,5,4,'o_1a682parsgcr4111hr1kuafk2121449823153299.jpg,o_1a682parsgcr4111hr1kuafk2121449823153459.jpg,o_1a682parsgcr4111hr1kuafk2121449823153508.png,o_1a682parsgcr4111hr1kuafk2121449823361350.png','韩式双眼皮（切开）','7,1,2,8,3,5,6',0,'25',1,'<p><title></title></p><p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a682parsgcr4111hr1kuafk2121449823361626.png\"/></b></p><p class=\"p\"><b><br/></b></p><p class=\"p\"><b>姓名：</b></p><p>刘荣升</p><p><br/></p><p class=\"p\"><b>资质：</b></p><p class=\"p\"></p><p><span style=\"color: rgb(80,78,75);\">院长</span></p><p></p><p></p><p class=\"p\"><b> </b></p><p class=\"p\"><b>简介：</b></p><p class=\"p\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">五官面部整形博导<br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲整形美容研究院五官整形分院专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">国际美容外科学会特邀专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲鼻部综合整形科技领航者</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">擅长项目：韩式水晶眼、面部精雕手术、韩式芭比隆鼻、娇韵丰胸、眼脸提升。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">荣誉成就：<span class=\"Apple-converted-space\"> </span></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">国际医疗整形美容协会正式会员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲整形美容研究院五官整形分院专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">韩国木槿花医疗专家库外科博导</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">泛亚太平洋美容外科医学会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">中国医师协会美容与整形医师分会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">东方美容外科医学学会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚太地区美容外科学会会员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">中国首席微整形注射权威专家</span></span></p>','<p class=\"p\" style=\"text-align: left;\">韩式双眼皮是“韩式”整形整容项目上利用独到、创新的手术术式和手术理念打造的一个整容手术。“韩式”强调持久的自然美，就双眼皮（重睑术）而言，“韩式双眼皮手术”也有其创新独 到之处。传统双眼皮手术通常采用埋线法或缝线结扎法，术后有淡淡的疤痕。而“韩式双眼皮手术”只在上睑两端各开一个小孔式切口。抽取脂肪、拉紧皮肤后，能形成自然双眼皮，术后不留痕迹。</p><div>1、韩式双眼皮切口小<br/>主要采用外眦小切口双眼皮成形术，手术时在上睑设计的双眼皮位置的内、中、外各切开一小口，缝合固定形成双眼皮，通过眼皮下缘无痕切口，避免疤痕烦恼;资深医师亲手操作，手术精准、细致、轻柔;采用特色无损伤精细皮下缝合，无需忍受术后拆线痛苦。<br/>2、韩式双眼皮的手术时间短<br/>手术时间只有20-30分钟。<br/>3、韩式双眼皮的手术方法精细讲究<br/>韩式压线双眼皮的主要是手术前的精心设计，患者是进行双眼皮手术前医生会根据患者的眼部情况设计出适合个人的双眼皮。切开眼睑皮肤，去掉部分脂肪和多余皮肤，仅将真皮层与睑板进行三点缝合便可以形成完美的重睑线，皮肤用特殊的美容线进行精细缝合。<br/><p style=\"color: rgb(85, 85, 85);\"></p><!--EndFragment--><br/><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">单眼皮</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">20-30分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><!--EndFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a682parsgcr4111hr1kuafk2121449823153299.jpg\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a682parsgcr4111hr1kuafk2121449823153459.jpg\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a682parsgcr4111hr1kuafk2121449823153508.png\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a682parsgcr4111hr1kuafk2121449823361350.png\"/><br/></div>',1,'subcaticon/1449823083.84',1,'2015-12-11 16:51:08','费用仅含手术费','需要提前一天预约'),(26,8200.00,6800.00,8,4,'o_1a683ua0tmuh1o482h0ls6git2h1449824274325.png,o_1a683ua0tmuh1o482h0ls6git2h1449824274393.png,o_1a683ua0tmuh1o482h0ls6git2h1449824274448.png','韩式隆鼻（假体）','7,1,2,8,3,5,6',0,'26',1,'<p style=\"text-align: left;\"><span><b></b></span></p><p style=\"text-align: left;\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a683ua0tmuh1o482h0ls6git2h1449824330617.png\"/><!--EndFragment--></p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\"></p><p><span>洪政秀</span></p><p><br/></p><p></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\"></p><p><span>院长</span></p><p><br/></p><p></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\"></p><p style=\"text-align: left;\"><span>Artline整形外科 院长</span></p><p style=\"text-align: left;\"><span>整形外科专门医</span><span><br/></span><span>前原辰整形外科院长</span><span><br/></span><span>前押鸠厅GYB整形外科院长</span><span><br/></span><span>前中央大学医院整形外科临床教授</span><span><br/></span><span>大韩整形外科学会正会员</span><span><br/></span><span>大韩美容整形外科学会正会员</span><span><br/></span><span>大韩整形外科开院医协医会正会员</span><span><br/></span><span>大韩头盖面部整形外科学会正会员</span><span><br/></span><span>大韩手部外科学会正会员</span><span><br/></span><span>国际整形外科学会正会员</span><span><br/></span><span>大韩肥胖体型学会正会员</span><span><br/></span><span>乳房整形手术并发症0.1%最低记录</span><span><br/></span><span>中央大学医院教授在职中</span><span><br/></span><span>最大手术件记录</span><span><br/></span><span>MENTOR SUPER USER COURSE</span><span><br/></span><span>ALLERGAN CADEVER</span><span><br/></span><span>BREAST OPERATION</span><span><br/></span><span>COURSE</span><span><br/></span><span>2004年,2005年,2006年,2008年,2009年</span><span><br/></span><span>大韩整形外科学会 论文发表</span><span></span></p><p></p>','<p style=\"color: rgb(85, 85, 85);text-align: left;\"></p><p>1、隽秀挺翘，不歪不斜宛若天成</p><p style=\"text-align: left;\"></p><p style=\"text-align: left;\">根据求美者脸型比例、气质等综合因素，个性定制，术后鼻子挺拔俏丽，鼻唇沟、鼻头、鼻背、鼻根部一条线，中正挺拔；</p><p style=\"text-align: left;\">2、量身设计，力求整体和谐</p><p style=\"text-align: left;\"></p><p style=\"text-align: left;\">依据东方完美鼻型标准及“黄金矩形审美”，综合术前设计，符合三庭五眼的审美标准，跟五官、气质、身高协调，力求整体和谐，术后的鼻子自然完美；</p><p style=\"text-align: left;\">3、弧度自然，可随意揉、捏、推、挤</p><p style=\"text-align: left;\"></p><p style=\"text-align: left;\"></p><p style=\"text-align: left;\">手术由中韩鼻整形领域领军人物采用韩国原装进口技术设备，亲自施术，技法精细，手法娴熟，鼻头、鼻翼、鼻小柱、鼻背弧度流畅，过渡自然，捏、推、揉无异样；</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a683ua0tmuh1o482h0ls6git2h1449824274081.png\"/><br/></b><span style=\"text-align: justify;\">矮鼻（塌鼻）：</span><span style=\"text-align: justify;\">五官不立体，没气质没气场，无法展示鼻子优美曲线</span></p><p style=\"text-align: justify;\"></p><p style=\"text-align: justify;\">蒜头鼻：如蒜头形状，不秀气缺乏女性柔美<span style=\"color: rgb(255, 255, 255);\"></span></p><p style=\"text-align: justify;\">朝天鼻：鼻孔大，鼻孔，鼻子显短，给人呆笨感觉</p><p style=\"text-align: justify;\">驼峰鼻：男性特征明显，过于阳刚，给人阴险狡诈感觉</p><p style=\"text-align: justify;\">鹰钩鼻：鼻尖向下内成钩状，给人阴险的印象</p><p style=\"color: rgb(85, 85, 85);text-align: justify;\">歪鼻：极不美观，给人尖酸刻薄的感觉</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a683ua0tmuh1o482h0ls6git2h1449824274325.png\"/><br/><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a683ua0tmuh1o482h0ls6git2h1449824274393.png\"/><!--EndFragment--><br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a683ua0tmuh1o482h0ls6git2h1449824274448.png\"/><br/></b></p>',1,'subcaticon/1449824107.91',1,'2015-12-11 17:42:28','费用仅含手术费','需提前一天预约'),(27,5500.00,3300.00,5,3,'o_1a6fqmflg94k1afk3qmidmt3b171450082874613.jpg','埋线双眼皮','7,1,2,8,3,5,6',0,'27',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6fqmflg94k1afk3qmidmt3b171450082876945.jpg\"/></p><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\"></p><p>尹度龙</p><p><br/></p><p><b>资质：</b></p><p></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p>韩国眼部整形专家</p><p></p><p>韩国五官综合塑型教父</p><p></p><p>精湛技法：韩国无痕媚眼、经典开眼角、韩国开放式鼻修复、经典眼整形修复。</p><p></p>','<p style=\"color: rgb(85, 85, 85);\">埋线法双眼皮通过使用仅头发丝四分之一细的韩国进口缝合线，粘连眼睑形成皱褶而变成双眼皮。埋线双眼皮无需开刀、术后浮肿少、短期内即可形成自然的双眼皮。一周内即愈合恢复。</p><p>埋线法的优点:不用切开即可达到自然效果，手术时间短，大约15分～20分左右，与切开法相比肿胀及疼痛较少，具有成形自然、恢复快的优点。</p><p style=\"color: rgb(85, 85, 85);\"></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">内双、眼皮一单一双、眼皮薄、无明显脂肪堆积者<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">15-20分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。<br/>2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。<br/>3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀<br/>4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q:埋线双眼皮会留疤痕么?<br/>埋线双眼皮创口微小，愈后痕迹可隐藏在形成双眼皮的褶皱里，肉眼几乎看不出来。<br/>Q:埋线双眼皮能永久保持吗?<br/>埋线可能会有一定的脱落几率，这与医生打结的松紧程度、个人的眼睛条件以及平时的保护等因素有关。一般可维持2年以上。<br/>Q:术后有哪些注意事项?<br/>术后要保持伤口清洁，防止感染，伤口愈合前不要沾水。一个月内忌烟酒，不要吃羊肉、辣椒一类辛辣刺激性食物。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：<br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6fqmflg94k1afk3qmidmt3b171450082874613.jpg\"/></b><br/></p>',1,'subcaticon/1450082811.29',1,'2015-12-14 16:53:39','费用仅含手术费','需提前一天预约'),(28,6700.00,5500.00,5,3,'o_1a6frfu84t2d118c14p72aslg411450083681945.jpg','切开双眼皮','7,1,2,8,3,5,6',0,'28',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6fqmflg94k1afk3qmidmt3b171450082876945.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">尹度龙</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">韩国眼部整形专家</p><p style=\"color: rgb(85, 85, 85);\">韩国五官综合塑型教父</p><p style=\"color: rgb(85, 85, 85);\">精湛技法：韩国无痕媚眼、经典开眼角、韩国开放式鼻修复、经典眼整形修复。</p>','<p class=\"p\">切法开双眼皮是适合所有类型眼部特征的人群，通过采用连续的弧形切口，分层次定量祛除眼部除松弛的皮肤、眼轮匝肌及肥厚的脂肪，术后几乎不留痕迹，闭眼时自然漂亮。</p><p class=\"p\"></p><p>切开法双眼皮的优点：适合各类型眼部特征的人群、无年龄性别限制；不仅能形成自然无痕的双眼皮，还具有收紧眼周皮肤的特点，还可改善眼部轻微鱼尾纹、眼睑下垂等。</p><p></p><p><b><br/></b></p><p><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">用于任何类型、任何年龄的单眼皮，对上眼睑皮肤松弛和上睑臃肿者尤为适宜。<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b><br/></b></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b>注意事项：</b></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b><br/></b></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b>常见问题：</b></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮手术时痛不痛?会不会影响视力?</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">切开双眼皮手术仅仅在打麻药针的时候有少许痛，打完麻药后，做双眼皮手术时是不会感到明显疼痛。只要到正规整形医院找资深医师做双眼皮手术，一般不会影响视力。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮术后需要注意哪些事</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">术后要保持伤口清洁，防止感染，在切口愈合前洗脸时注意不要打湿伤口。一个月内忌烟酒，勿食辛辣刺激性食物等。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮手术后会不会发生感染?</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">切开双眼皮手术方法已经比较成熟了，只要是到正规医院做，消毒措施都是很充分的，发生感染的几率是很低的。术后再遵从医嘱进行护理，一般不会有太大问题。</span><br/><br/><b>效果展示：<br/><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6frfu84t2d118c14p72aslg411450083681945.jpg\"/><br/></b></p>',1,'subcaticon/1450083611.53',1,'2015-12-14 17:03:48','费用仅含手术费','需提前一天预约'),(29,7200.00,5000.00,5,3,'o_1a6frt9nq1iad6bl9d799gqr9i1450084127963.jpg','韩国微创双眼皮','7,1,2,8,3,5,6',0,'29',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6fqmflg94k1afk3qmidmt3b171450082876945.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">尹度龙</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">韩国眼部整形专家</p><p style=\"color: rgb(85, 85, 85);\">韩国五官综合塑型教父</p><p style=\"color: rgb(85, 85, 85);\">精湛技法：韩国无痕媚眼、经典开眼角、韩国开放式鼻修复、经典眼整形修复。</p>','<p><title></title></p><p>微创法双眼皮通过在眼睑上切开1mm左右的小切口，祛除部分脂肪，然后再进行埋线的重睑方法。术后不留痕迹，闭眼时更为自然漂亮。术后恢复快，通常情况下3-7天可完全恢复自然。</p><p class=\"p\"></p><p class=\"p\"></p><p>微创双眼皮的优点：相对于埋线法双眼皮，微创双眼皮可以同步祛除部分脂肪；使眼睑变薄、睑缘充分外露，可形成自然的卷翘睫毛，双眼皮更添妩媚迷人。</p><p><br/><!--StartFragment--></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b> </p><p style=\"color: rgb(85, 85, 85);\"> 单眼皮<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。</span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><br/></span></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6frt9nq1iad6bl9d799gqr9i1450084127963.jpg\"/><br/></p>',1,'subcaticon/1450084057.53',1,'2015-12-14 17:21:49','费用仅含手术费','需提前一天预约'),(30,8000.00,5800.00,5,3,'o_1a6fspk0m1b341rho8fa5k41jgcu1450085275888.jpg','袁氏专有双眼皮','7,1,2,8,3,5,6',0,'30',1,'<p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6fqmflg94k1afk3qmidmt3b171450082876945.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">尹度龙</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">韩国眼部整形专家</p><p style=\"color: rgb(85, 85, 85);\">韩国五官综合塑型教父</p><p style=\"color: rgb(85, 85, 85);\">精湛技法：韩国无痕媚眼、经典开眼角、韩国开放式鼻修复、经典眼整形修复。</p>','<p class=\"p\" style=\"color: rgb(85, 85, 85);\">1、袁氏改良重睑术是在最大程度上达到翘睫效果，弧度更美观。</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">2、传统韩式三点比较浅，袁氏改良重睑术可以做出更深邃的效果。</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">3、袁氏改良重睑术更接近自然，具有生理性的双眼皮解构。</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">4、袁氏改良重睑术改变传统技术的局限，甚至可以做欧式平行双眼皮，满足更多的需求。</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">5、传统韩式三点脱落率较高，袁氏改良重睑术至少可以降低一倍以上的脱落率。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">单眼皮</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b></p><p style=\"color: rgb(85, 85, 85);\">1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</p><p style=\"color: rgb(85, 85, 85);\">2、双眼皮手术与近视眼手术之间要相隔至少两个月。</p><p style=\"color: rgb(85, 85, 85);\">3、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症。<b></b></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<b></b></p><p style=\"color: rgb(85, 85, 85);\"><b><b><br/></b></b></p><p style=\"color: rgb(85, 85, 85);\"><b><b>注意事项：</b></b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(51, 51, 51);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><span style=\"color: rgb(51, 51, 51);\"></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(51, 51, 51);\">2、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。</span><span style=\"color: rgb(51, 51, 51);\"><br/></span><span style=\"color: rgb(51, 51, 51);\">3、术后尽量垫高头部减轻肿胀。</span><b><span style=\"color: rgb(51, 51, 51);\"></span></b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(51, 51, 51);\"><br/></span></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">Q：袁氏双眼皮手术会留下疤痕吗?</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">袁氏双眼皮手术切口是隐藏的，不会留下明显的痕迹。而且选择正规机构和找经验丰富的医生缝合操作比较精细，术后痕迹隐藏更好。</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">Q：袁氏双眼皮手术后会不会发生感染?</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">袁氏双眼皮手术方法已经比较成熟了，只要是到正规医院做，消毒措施都是很充分的，发生感染的几率是很低的。术后再遵从医嘱进行护理，一般不会有太大问题。</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">Q：术后有哪些注意事项?</p><p class=\"p\" style=\"color: rgb(85, 85, 85);\">术后要保持伤口清洁，防止感染，伤口愈合前不要沾水。一个月内忌烟酒，不要吃羊肉、辣椒一类辛辣刺激性食物。出现问题要及时联系医生哦!<b></b></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6fspk0m1b341rho8fa5k41jgcu1450085275888.jpg\"/><br/></p>',1,'subcaticon/1450084972.9',1,'2015-12-14 17:29:13','费用仅含手术费','需提前一天预约'),(31,3500.00,2800.00,5,5,'o_1a6ic383l1pl1kgo7lpqb1t5d11450168192603.jpg,o_1a6ic383l1pl1kgo7lpqb1t5d11450168195496.jpg','埋线双眼皮 迷人媚眼极致天成','7,1,2,8,3,5,6',0,'31',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ic383l1pl1kgo7lpqb1t5d11450168197506.jpg\"/><!--EndFragment--><br/></p><p><b><br/></b></p><p><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘平<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">整形外科主治医生</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会会员</p><p style=\"color: rgb(85, 85, 85);\">复旦大学临床学学士</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会美容与整形分会会员</p>','<p><!--StartFragment--><span style=\"color: rgb(133, 133, 133);text-align: left;float: none;background-color: rgb(255, 255, 255);\"></span>埋线法是指将缝合线埋入眼皮内做出双眼皮线条的手术方法，不许切开皮肤只是很小的针眼，因此埋线法无疤痕、 付中秋、恢复快，效果自然，但埋线法是用线来固定双眼皮，随着时间推移，双眼皮慢慢变浅或者脱落的现象较多。韩镜整形外科采用多种埋线法来根据客人喜好的双眼皮形状，宽度，身体条件等来选择适合本人的埋线手术方法， 降低双眼皮脱落的几率，提高顾客的满意度。<span style=\"color: rgb(133, 133, 133);text-align: left;float: none;background-color: rgb(255, 255, 255);\"></span><!--EndFragment--><br/></p><p><br/></p><p><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">内双、眼皮一单一双、眼皮薄、无明显脂肪堆积者<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。<br/>2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。<br/>3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀<br/>4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q:埋线双眼皮会留疤痕么?<br/>埋线双眼皮创口微小，愈后痕迹可隐藏在形成双眼皮的褶皱里，肉眼几乎看不出来。<br/>Q:埋线双眼皮能永久保持吗?<br/>埋线可能会有一定的脱落几率，这与医生打结的松紧程度、个人的眼睛条件以及平时的保护等因素有关。一般可维持2年以上。<br/>Q:术后有哪些注意事项?<br/>术后要保持伤口清洁，防止感染，伤口愈合前不要沾水。一个月内忌烟酒，不要吃羊肉、辣椒一类辛辣刺激性食物。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ic383l1pl1kgo7lpqb1t5d11450168195496.jpg\"/></p>',1,'subcaticon/1450168125.48',1,'2015-12-15 16:40:51','费用包含手术费，局部麻醉','需提前3天预约'),(32,5800.00,3300.00,5,5,'o_1a6icudb6fgp1599nlj1ivibjnf1450169196592.png,o_1a6icudb6fgp1599nlj1ivibjnf1450169468351.png','全切双眼皮 韩镜打造极致美眸','7,1,2,8,3,5,6',0,'32',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ic383l1pl1kgo7lpqb1t5d11450168197506.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘平<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">整形外科主治医生</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会会员</p><p style=\"color: rgb(85, 85, 85);\">复旦大学临床学学士</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会美容与整形分会会员</p>','<p>上眼睑矫正手术是指上眼睑肌肉伸张力的减弱，而导致眼睛在正常睁开时，瞳孔被眼皮挡住或者双眼让人感到疲惫 的眼睛进行眼部矫正，增强上眼睑肌肉的伸张能力的矫正手术。如果上眼睑肌肉伸张力减弱，上眼皮会遮挡住双眼， 给人疲惫的印象。如果向睁大眼睛的话，会不自觉的提高眼眉，长期如此会导致额头皱纹的产生。如上所述情况， 根据身体情况而定会建议采用切开式或非切开式的方法来矫正，获得令自己满意的双眼。<br/></p><p><b><br/></b></p><p><b>适合人群：</b></p><p></p><p style=\"color: rgb(85, 85, 85);\">用于任何类型、任何年龄的单眼皮，对上眼睑皮肤松弛和上睑臃肿者尤为适宜。<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。<br/>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。<br/>3、双眼皮手术与近视眼手术之间要相隔至少两个月。<br/>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物<br/>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症<br/>6、做双眼皮手术女性要避开月经期。<br/>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b><br/></b></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b>注意事项：</b></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">1、术后按医嘱进行冰敷，冰敷可以有效减轻肿胀和疼痛。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">2、避免用不干净的手或毛巾等接触手术部位，否则可能导致手术部位细菌感染。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">3、按医嘱服用消炎药，发炎后治愈的手术痕迹尤其明显，同时炎症也可能影响双眼皮的形状，所以要注意预防发炎。&#8232;术后尽量垫高头部减轻肿胀</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">4、术后冷敷只需2-3天左右，之后要热敷。热敷可以帮助血液循环，有助于消肿。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b><br/></b></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><b>常见问题：</b></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮手术时痛不痛?会不会影响视力?</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">切开双眼皮手术仅仅在打麻药针的时候有少许痛，打完麻药后，做双眼皮手术时是不会感到明显疼痛。只要到正规整形医院找资深医师做双眼皮手术，一般不会影响视力。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮术后需要注意哪些事</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">术后要保持伤口清洁，防止感染，在切口愈合前洗脸时注意不要打湿伤口。一个月内忌烟酒，勿食辛辣刺激性食物等。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q：切开双眼皮手术后会不会发生感染?</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">切开双眼皮手术方法已经比较成熟了，只要是到正规医院做，消毒措施都是很充分的，发生感染的几率是很低的。术后再遵从医嘱进行护理，一般不会有太大问题。</span><br/><br/><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6icudb6fgp1599nlj1ivibjnf1450169196355.png\"/></b></p><p></p>',1,'subcaticon/1450169008.81',1,'2015-12-15 16:50:51','费用包含手术费，局部麻醉','需提前3天预约'),(33,15999.00,9999.00,21,5,'o_1a6ide770qg6jqkaq31vksoas1a1450169696430.png,o_1a6ide770qg6jqkaq31vksoas1a1450169696740.png','综合隆鼻 打造完美韩式翘鼻','7,1,2,8,3,5,6',0,'33',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ic383l1pl1kgo7lpqb1t5d11450168197506.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘平<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">整形外科主治医生</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会会员</p><p style=\"color: rgb(85, 85, 85);\">复旦大学临床学学士</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会美容与整形分会会员</p>','<p>假体的种类韩镜整形外科鼻整形是不会固定用哪种材料，通常根据个人的情况差异，如鼻骨的宽度、大小、皮肤的厚度等来选择适合顾客的假体，经过充分的咨询沟通后确定最适合的材料，确保最终的手术成功。</p><p>硅胶优点目前整形领域使用最多的人工植入材料在人体内也不会变形、异物反应、排斥反应，发炎的可能性也极低几十年临床数据可确保安全性适用于中间程度/厚的皮肤/男性鼻形状很漂亮，很精致高贵的感觉假体支撑力好，轮廓分明的形状容易雕刻适合顾客的形状缺点有包膜形成故皮肤薄的人容易看出来肌肤较薄者，假体痕迹较明显</p><p>Silitex/goresili优点结合了硅胶和膨体两者的假体在人体内也不会变形，无异物反应，发炎可能性小几十年的临床试验可以确保安全性适用于厚度适中/厚的皮肤/男性鼻形状很漂亮，很精致高贵的感觉假体支撑力好，轮廓分明的形状容易雕刻适合顾客的形状缺点有包膜形成故皮肤薄的人容易看出来肌肤较薄者，假体痕迹较明显</p><p>膨体/射极峰（Surgiform）优点适用于皮肤薄的情况假体上有很多微孔，可与组织长到一起，不会形成包膜有更自然地感觉缺点膨体已经中断生产，类似的产品射极峰怒前在使用中随着时间过以后，有一点收缩的现象，高度和长度有一点变小的趋势因其柔软的特性，有变形的可能性诱发炎症的可能性略高修复时不容易取出随着时间的推移，有可能收缩后假体轮廓会有凹陷效果使用历史较短，还需长时间的临床数据分析<br/></p><p><br/></p><p><b>适合人群：</b></p><div style=\"color: rgb(85, 85, 85);\">鼻梁低平，鼻尖低矮，鼻头肥大，想要隆鼻者<br/><br/></div><div style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></div><div style=\"color: rgb(85, 85, 85);\">手术<br/><br/></div><div style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></div><div style=\"color: rgb(85, 85, 85);\">一次<br/><br/></div><div style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>1、隆鼻手术前确定身体健康，无传染性疾病或其他身体炎症<br/>2、做隆鼻手术女性要避开月经期。<br/><br/></div><div style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></div><div style=\"color: rgb(85, 85, 85);\">60分钟<br/><br/></div><div style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></div><div style=\"color: rgb(85, 85, 85);\">否<br/></div><p style=\"color: rgb(85, 85, 85);\"><br/></p><div style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></div><div style=\"color: rgb(85, 85, 85);\">1、不要吃刺激性食物;<br/>2、恢复期避免外力挤压鼻子;<br/>3、改掉挖鼻孔、挤黑头等不良生活习惯;<br/>4、定期到医院复查<br/><br/></div><div style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q： 硅胶假体会发生透光吗?<br/>鼻子部位的皮肤是有限的，如果本身鼻部皮肤比较薄，或者放入的假体过大过高，或者层次太浅，鼻头就会容易透光。这就需要医生手术中，合理判断求美者鼻部情况，将假体植入较深层次筋膜下，从而有效降低出现这种情况的可能性。<br/>Q：硅胶假体隆鼻后效果能够维持多长时间，多久需要更换?<br/>因人而异哦，有些可长久维持，但是建议你定期去医院复查，国内也有医生建议，最好十年左右更换硅胶假体。<br/>Q：硅胶假体隆鼻后，歪掉了怎么办?<br/>可以到正规医院进行假体取出的手术，但修复手术要比首次更复杂，所以建议到正规的医院，找经验丰富的医生就诊，他会根据你的自身情况，来设计具体的修复方案哦。</div><p><b><br/></b></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ide770qg6jqkaq31vksoas1a1450169696740.png\"/></b></p>',1,'subcaticon/1450169543.97',1,'2015-12-15 16:59:20','包含全部费用','需提前一个星期预约'),(34,800.00,300.00,4,5,'o_1a6idsoh11jge1kod1f5j11r81kkq1r1450170091143.jpg,o_1a6idsoh11jge1kod1f5j11r81kkq1r1450170093773.jpg','白瓷娃娃 让你的皮肤吹弹可破','7,1,2',0,'34',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6idsoh11jge1kod1f5j11r81kkq1r1450170098504.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">宗建华<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">扬州大学医院皮肤科本科</p><p style=\"color: rgb(85, 85, 85);\">九院激光最新进展研修班进修</p><p style=\"color: rgb(85, 85, 85);\">十年皮肤病治疗和激光美容临床经验</p><p style=\"color: rgb(85, 85, 85);\">在国家重点期刊上发表论文数篇</p>','<p>1、“白瓷娃娃””活颜靓肤技术，利用高功率超强Nd：YAG激光器；同时配备非剥脱点阵激光，而且采用了专利的“三维点阵”技术，以及双波长高功率固体激光技术，清洁表皮上的角质层堆积物和有色物质沉淀物，祛除面部色斑，让肌肤感觉前所未有的洁净清爽；</p><p>2、同时深入真皮层对肌肤进行治疗，让激光和养分能直入皮肤深层，增加皮肤弹性，缩小毛孔，祛除皱纹。</p><p>3、ACC模式1064激光在嫩肤时不用涂抹碳粉，实现了革命性的“无碳”激光嫩肤模式，嫩肤效果更好，同时避免碳粉残留在皮肤内，造成毛孔堵塞等副作用。<br/></p><p><br/></p><p><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">皮肤粗糙、面色暗沉有斑有细纹<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">1次，持续改善需3—6次<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b><br/>近期避免阳光暴晒，不可使用光敏性药物和口服异维A酸。<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30分钟左右<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">白瓷娃娃治疗后，即刻涂抹红霉素、金霉素或百多邦等消炎药膏，治疗部位不要沾水，术后一周内不要吃辛辣带有刺激性的食物，出门注意防晒。</span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\"><br/></span></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6idsoh11jge1kod1f5j11r81kkq1r1450170093773.jpg\"/></b></p>',1,'subcaticon/1450170024.04',1,'2015-12-15 17:13:04','费用仅含手术费','需提前一天预约'),(35,1800.00,800.00,1,5,'o_1a6ielqrr17b7e6o1a0t1047ki12h1450171012955.png,o_1a6ielqrr17b7e6o1a0t1047ki12h1450171014889.png','激光祛斑 彻底告别斑女郎','7,1,2',0,'35',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6idsoh11jge1kod1f5j11r81kkq1r1450170098504.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">宗建华<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">扬州大学医院皮肤科本科</p><p style=\"color: rgb(85, 85, 85);\">九院激光最新进展研修班进修</p><p style=\"color: rgb(85, 85, 85);\">十年皮肤病治疗和激光美容临床经验</p><p style=\"color: rgb(85, 85, 85);\">在国家重点期刊上发表论文数篇</p>','<p>激光治疗原理是治疗仪器所发射的激光，能极为顺利的穿透病损的皮肤，进入病损部位，并对病损部位的色素进行治疗。雀斑色素在强大的激光照射下会发生变化，而后自行消散，从而得到治愈。激光并不是强行地将色素解除掉，而是透过皮肤治疗，但治疗后不小心照顾的话会留有疤痕，而且由于具有选择性，即它只作用于色素颗粒而对正常的皮肤没有损伤。</p><p><br/></p><p><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">雀斑、老年斑、痤疮等人群<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ielqrr17b7e6o1a0t1047ki12h1450171014889.png\"/><!--EndFragment--><br/></b></p>',1,'subcaticon/1450170865.71',1,'2015-12-15 17:38:17','费用为一次治疗费用','需提前一天预约'),(36,15000.00,12000.00,14,5,'o_1a6igmc1k1ndn1hgtirl1866152311450173170843.jpg,o_1a6igmc1k1ndn1hgtirl1866152311450173171146.jpg','全脸自制脂肪填充 不动刀轻轻松松转移脂肪','7,1,2,8,3,5,6',0,'36',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ic383l1pl1kgo7lpqb1t5d11450168197506.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘平<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">整形外科主治医生</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会会员</p><p style=\"color: rgb(85, 85, 85);\">复旦大学临床学学士</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会美容与整形分会会员</p>','<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6kfcc8ogv81bdkd3jsd2bg981450238699151.png\"/><!--EndFragment--><br/></p><p> 自体脂肪丰全脸是通过提取人体自身某些部位吸取多余的脂肪细胞，然后经过吸出的脂肪细胞经净化处理后，选择完整的颗粒脂肪细胞通过注射的方式再移植到需要进行脂肪填充的部位，可让全脸达到饱满的效果。华美超细微自体脂肪移植术采用3L3M(即低压抽吸、低速离心、多点、多隧道、多层次、少量注射移植的方法)。<br/></p><p><br/></p><p><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">面部脂肪少、面部凹陷、不对称等<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b></p><p style=\"color: rgb(85, 85, 85);\"> 1、术前进行体检，确保自身身体健康、精神正常，并能正确看待手术效果，且无严重器官疾病、无出凝血疾病、无糖尿病及免疫性疾病及神经运动功能障碍；</p><p style=\"color: rgb(85, 85, 85);\"> 2、施行手术部位无局部感染病灶； </p><p style=\"color: rgb(85, 85, 85);\"> 3、术前半月禁服无抗凝血药物及阿斯匹林； </p><p style=\"color: rgb(85, 85, 85);\"> 4、女性患者尽可能避免月经期，术前洗澡，保持清洁。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></p><p style=\"color: rgb(85, 85, 85);\">1、术后尽可能减少活动，以利于恢复及消肿，但无须卧床休息；</p><p style=\"color: rgb(85, 85, 85);\">2、术后半个月内尽可能使用弹力绷带，抬高患肢，避免血肿，帮助收紧皮肤； </p><p style=\"color: rgb(85, 85, 85);\">3、遵照医嘱口服消炎药3～5天。<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示</b><b>：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6igmc1k1ndn1hgtirl1866152311450173171146.jpg\"/></b></p>',1,'subcaticon/1450173027.25',1,'2015-12-15 17:59:01','包含全部费用','需要提前一个星期预约'),(37,58888.00,38888.00,15,5,'o_1a6ksh3gul8oi8u1v5q1jjm11l811450253025413.jpg','假体隆胸 韩镜帮您勾勒完美曲线','7,1,2,8,3,5,6',0,'37',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ksh3gul8oi8u1v5q1jjm11l811450253361281.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘平<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">整形外科主治医生</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会会员</p><p style=\"color: rgb(85, 85, 85);\">复旦大学临床学学士</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会美容与整形分会会员</p>','<p>1、韩镜整形外科拥有国内外最具实力的医疗团队的，已多年的临床经验和研究结果为基础，为大家塑造最完美的胸部，为客人提供最适合患者的假体和手术方案。<br/></p><p>2、韩镜整形外科通过整形外科专家和麻醉痛症医学科专家共同会诊的体系，从手术开始到将结束的整个过程，提供稳定并没有后遗症的麻醉，让患者在最安全的环境下进行手术。<!--EndFragment--></p><p>3、手术前商谈的开始到手术后恢复结束采用1对1的负责制管理，根据每位客人的情况定制适合患者的恢复方案，帮助客人直到完全恢复为止。</p><p><br/></p><p>切开和植入假体方法：乳房扩大手术的切开部位一般是在腋下内侧，乳晕，乳房下方和肚脐等四个部位中选一。正如每个人的长相不同，胸部下方的长度，下垂程度和原因，胸廓摸样的差异，想要的饱满度和假体种类，再修复等，根据每个人的身体条件和要求，手术方法也是不同的。虽然在某个特定的部位进行手术不能判断其好坏，但是偶尔会有因为不正确的手术方法导致的再修复手术，所以正确听取经验丰富的院长的建议是很重要的。<br/></p><p>腋下切开法</p><p>沿着腋下褶皱切开放入假体的方法，不会伤到乳腺组织，手术后可以母乳喂养，不会留下疤痕。</p><p>内视镜腋下切开法</p><p>利用最先进的内视镜设备，确定假体放入的准确的位置和范围，减少主要血管和神经的损伤，出血少，很快恢复到日常生活中去。<br/></p><p>乳晕切开法</p><p>沿着乳晕下方的边界切开的方法，疤痕不明显，但是乳头感觉会受到轻微的影响。腋下容易暴露的模特和明星等比较喜欢的手术方法。<br/></p><p>胸部下方切开法</p><p>胸部下方褶皱处切开放入假体，主要针对需要再修复手术和需要矫正的比较多的患者。但是躺下的时候，会看到一些伤疤，所以此方法比较适用于胸部下方褶皱明显，或者胸部非常大的人。<br/></p><p>肚脐内切开法</p><p>在肚脐内切开放入假体，看不到疤痕，通过内视镜，减少出血。手术后胳膊可以比较自由的活动，但是假体只能使用食盐水袋。<br/></p><p><b><br/></b></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ksh3gul8oi8u1v5q1jjm11l811450253030348.jpg\"/><!--EndFragment--><br/></b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ksh3gul8oi8u1v5q1jjm11l811450253032466.jpg\"/></b></p>',1,'subcaticon/1450252465.77',1,'2015-12-16 16:16:38','此优惠价格包括曼托假体、麻醉费、设计费、体检费、住院费等一切费用','需提前一个星期预约'),(38,3600.00,3000.00,16,5,'o_1a6ktrj4h1dpf1n4qnnv1i22u7c161450254173393.jpg','抽脂减肥 不吃药不开刀马上体验瘦的感觉','7,1,2,8,3,5,6',0,'38',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ic383l1pl1kgo7lpqb1t5d11450168197506.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘平<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);\">整形外科主治医生</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会会员</p><p style=\"color: rgb(85, 85, 85);\">复旦大学临床学学士</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会美容与整形分会会员</p>','<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ktrj4h1dpf1n4qnnv1i22u7c161450254184791.jpg\"/><!--EndFragment--><br/></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ktrj4h1dpf1n4qnnv1i22u7c161450254185261.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>注意事项：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ktrj4h1dpf1n4qnnv1i22u7c161450254185434.jpg\"/><!--EndFragment--><br/></b></p><p><b><br/></b></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ktrj4h1dpf1n4qnnv1i22u7c161450254182342.jpg\"/><!--EndFragment--><br/></b></p>',1,'subcaticon/1450253930.61',1,'2015-12-16 16:24:43','费用仅包含一个部位','需要提前一个星期预约'),(39,2200.00,1468.00,11,4,'o_1a6l1ks1k13pj1fbh1ej11jubh7d1c1450257911962.jpg,o_1a6l259tt1rmskctg9dpea2lq391450258392346.jpg','非手术瘦脸 肉毒素塑造上镜小脸','7,1,2,8,3,5,6',0,'39',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l1ks1k13pj1fbh1ej11jubh7d1c1450257911913.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><font color=\"#000000\"><b>姓名：</b></font></p><p><font color=\"#000000\">赵康完</font></p><p><font color=\"#000000\"><br/></font></p><p><font color=\"#000000\"><b>资质：</b></font></p><p><font color=\"#000000\">主治医师</font></p><p><font color=\"#000000\"><br/></font></p><p><font color=\"#000000\"><b>简介：</b></font></p><p><font color=\"#000000\">美尔雅首席面部微雕专家</font></p><p><font color=\"#000000\">瓷美肌TM项目研发团队</font></p><p><font color=\"#000000\">国际健康体雕引领者</font></p><p><font color=\"#000000\">韩国微整知名注射专家<br/></font></p>','<p>1、多点注射见效快</p><p style=\"color: rgb(85, 85, 85);\">衡力注射瘦脸使用微量肉毒素进行面部多点皮下注射，可在短时间内达到理想效果。<br/>2、无需等待，随做随走</p><p style=\"color: rgb(85, 85, 85);\">通过肉毒素对咬肌及其支配神经进行麻痹来达到瘦脸的目的，恢复期很短，只消几分钟即可直接回家或去办公室上班，让你的美丽在不</p><p style=\"color: rgb(85, 85, 85);\">3、知不觉中自然展现</p><p style=\"color: rgb(85, 85, 85);\">剂量和操作过程、谨慎，比手术价格便宜而更显经济。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">想通过注射改善面部情况等人群</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">注射<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b></p><p style=\"color: rgb(85, 85, 85);\">局部敷麻<br/><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">约10分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、做前在一周内不能饮酒<br/>2、两周内服用过阿司匹林或其他解热镇痛药<br/>3、对肉毒毒素制品中任何成分过敏者或过敏体质<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q：肉毒素注射有什么副作用吗?<br/>答：有，多为暂时性的。术后常见注射部位肌肉麻痹、肿胀等，常发生在治疗后3-5天，一般2-4周逐渐消退。建议到正规整形医院找专业医生可最大限度的避免。<br/>Q : 肉毒素注射多久可以见效啊?<br/>答：一般1-2周可以见效，个人体质不同也会有所差异。<br/>Q：一次肉毒素注射通常能维持多久呢?<br/>答：通常情况下，一次注射可维持6-12个月左右，为持续维持，可反复注射。建议间隔时间在6个月左右为宜，具体情况请咨询正规医院专业的医生为准，以免引起永久性肌肉麻痹。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l259tt1rmskctg9dpea2lq391450258392346.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450257848.09',1,'2015-12-16 17:25:33','费用仅包含注射100单位肉毒素','需提前一天预约'),(40,1800.00,1080.00,10,4,'o_1a6l1pdku3dn6m0i69bg1dlv221450258288922.jpg,o_1a6l1pdku3dn6m0i69bg1dlv221450258298468.jpg','海薇玻尿酸注射','7,1,2,8',0,'40',1,'<p><!--StartFragment--><!--StartFragment--></p><p style=\"color: rgb(85, 85, 85);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l1ks1k13pj1fbh1ej11jubh7d1c1450257911913.jpg\"/><br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\"><b>姓名：</b></font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\">赵康完</font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\"><b>资质：</b></font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\">主治医师</font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\"><b>简介：</b></font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\">美尔雅首席面部微雕专家</font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\">瓷美肌TM项目研发团队</font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\">国际健康体雕引领者</font></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#000000\">韩国微整知名注射专家</font></p><p></p>','<p>不开刀，塑形+抗衰老+补水，水嫩“果冻”肌噢！</p><p>玻尿酸的主要成份是透明质酸，属于人体真皮组织成分之一。玻尿酸的组织相容性非常好，其成分能刺激肌肤胶原增生及锁紧肌肤中的水分，其锁水量惊人，可令肌肤充满弹性、光泽和水润，肌肤如“果冻”般水嫩饱满，皱纹和面部凹陷都消失不见了哦！ </p><p>填充效果明显 ，针剂注射，方便快捷哦！</p><p>玻尿酸注入到需要部位的皮下组织后，即刻拥有填充效果，一般在1周后效果完善。针剂注射愈合快，随做随走，无需特定休息，不会影响工作和生活哦！</p><p>无毒无排斥，可吸收，完美俊俏脸庞哦！</p><p>玻尿酸是一种无排斥、无过敏发炎的皮肤填充产品，与人体相容性极好，可被人体吸收副作用低。玻尿酸注射能满足你面部所有需求，让你补水，锁水，塑形，整个脸型和肌肤都呈现完美动人的状态，注射后效果稳定、自然，可维持半年左右哦！ </p><p>量身定制，舒适度高，质量可靠</p><p>海薇玻尿酸由于使用的是单相交联技术，同时产品中没有加入利多卡因，因而注射过程中的推挤力更小，注射起来痛感小，舒适度高。海薇玻尿酸于 2013年9月获国家CFDA认证，正式批准上市，质量可靠哦！</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">想通过注射改善面部情况等人群<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">注射<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">大部分一次成型<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术前准备：</b></p><p style=\"color: rgb(85, 85, 85);\">局部敷麻<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>手术时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30-40分钟<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>术后是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、强烈建议患者在治疗前至少3—4天内，不要服用消炎药(如阿司匹林等)，因为其有可能会加剧注射部位出血和肿胀。<br/>2、对透明质酸过敏者。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b><br/>Q：怎么判断我打的玻尿酸是合格产品呢？<br/>一般正规机构用的都是合格产品，另外，产品上贴的标签都有防伪标示，可以查询。<br/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">Q</span>：注射玻尿酸有什么优势?<br/>因为玻尿酸是人体自身皮肤组织之一，在人体内停留时间短，会在6-12个月左右被人体分解掉，不会有长期副作用，过敏反应少;注射法，局部仅有微胀微痛感，求美者容易接受。<br/>Q：注射玻尿酸术后注意什么?<br/>1、在注射后24小时内，为了让外形固定，要避免接触注射区域。<br/>2、如果有服用阿司匹林或其它类似药物，可能会增加瘀青及流血的。因此要避免服用。<br/>3、术后1天可以维持一般基础保养程序，不要额外在治疗部位按摩。这是玻尿酸注意事项中最重要的一项。<br/>4、打玻尿酸后不要在注射部位冰敷或热敷，还要做好防晒。<br/>Q：玻尿酸一年进行几次?<br/>选用的是可被人体吸收代谢的玻尿酸，随着时间的推移，效果会逐渐消失，一般情况下进行一次玻尿酸能够维持一年左右，而如果想要长久的维持效果，可根据医生提议按期注射。</p><p><br/></p><p><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l1pdku3dn6m0i69bg1dlv221450258298468.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450258177.88',1,'2015-12-16 17:31:58','费用仅包含注射1ml玻尿酸','需提前一天预约'),(41,2500.00,1680.00,10,4,'o_1a6l2ah18j8s1n1p14h1kph14tg3q1450258810493.jpg,o_1a6l2ah18j8s1n1p14h1kph14tg3q1450258815056.jpg,o_1a6l2ah18j8s1n1p14h1kph14tg3q1450258815193.jpg,o_1a6l2ah18j8s1n1p14h1kph14tg3q1450258815308.jpg','水光针注射 抗衰神器水光针','7,1,2,8,3',0,'41',1,'<p><!--StartFragment--><!--StartFragment--></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l1ks1k13pj1fbh1ej11jubh7d1c1450257911913.jpg\"/><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>姓名：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">赵康完</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>资质：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">主治医师</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>简介：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">美尔雅首席面部微雕专家</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">瓷美肌TM项目研发团队</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">国际健康体雕引领者</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">韩国微整知名注射专家</font></p><p></p>','<p>上海美尔雅医疗美容面部水光注射项目特点：水光注射是通过水光枪将小分子玻尿酸注射到到真皮层，迅速给肌肤补充水分，并聚合约合玻尿酸体积200—300倍的水分，同时加速皮下细胞的水循环，增强细胞透明度及水润度。从而达到丰盈补水，锁水，润泽饱满，改善细纹的功效，使皮肤呈现水润柔嫩与光泽透亮。</p><p style=\"color: rgb(85, 85, 85);\">1、韩国进口水光设备 已通过CFDA审批 品牌有保障  上海美尔雅水光注射采用的是韩国进口得玛莎水光设备，该设备已通过中国食品药品监督管理局（CFDA）的审批，品牌有保障。</p><p style=\"color: rgb(85, 85, 85);\">2、 负压技术 精准注射 不放过眼角等褶皱部位 全面补水得玛莎水光枪配备了吸力泵，在注射针头进入前利用负压将皮肤稍微提起，再将注射针头插入到准确的深度，可以减少注射产品的损耗并可完成施术困难的眼角与脖子等褶皱较多部位的治疗，面部补水更全面。<br/></p><p style=\"color: rgb(85, 85, 85);\">3、 伊婉玻尿酸 锁水保湿 深层补水更通透上海美尔雅水光注射采用伊婉玻尿酸，其具有超强的渗透性和补水能力，是水光注射的极佳材料。不仅可以快速渗透肌肤，还可牢牢锁住外界环境的水分，帮助皮肤吸收利用保养品，锁水保湿，深层补水让肌肤更通透。</p><p style=\"color: rgb(85, 85, 85);\">4、韩国医生 精准控制 效果均匀全面上海美尔雅水光注射由经验丰富的赵完康院长亲自操作，治疗前，他会根据求美者的肌肤状态制定专属方案，治疗时，以点带面，分点分层，小剂量精准注入，完美把控求美者皮肤状况及注射层次，使效果更加深入、均匀、全面、自然。<br/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">注射</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">首次</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗时长：</b></p><p style=\"color: rgb(85, 85, 85);\">30分钟</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">否</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></p><p style=\"color: rgb(85, 85, 85);\">注射前不要化妆，面部清洁<br/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b></p><p style=\"color: rgb(85, 85, 85);\">Q：水光注射玻尿酸和面膜，哪个更有优势？ </p><p style=\"color: rgb(85, 85, 85);\">1次水光注射相当于1000次日常面膜护理，可以让皮肤“一次性喝饱水”，快速呈现水润通透的光泽度。 </p><p style=\"color: rgb(85, 85, 85);\">Q：水光注射的适用范围？ </p><p style=\"color: rgb(85, 85, 85);\"> 有效改善脸部、颈部、手部的皱纹；收缩毛孔，增加弹力，紧致皮肤；有效改善鱼尾纹、法令纹等敏感部位，使皮肤水润柔嫩、有光泽。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗效果：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l2ah18j8s1n1p14h1kph14tg3q1450258815193.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450258667.82',1,'2015-12-16 17:39:59','费用为一次注射费用','需提前一天预约'),(42,24600.00,19800.00,15,4,'o_1a6l2jvno151t1paac821mfg16884l1450259034258.jpg','隆胸韩式国产假体','7,1,2,8,3,5,6',0,'42',1,'<p><!--StartFragment--><!--StartFragment--></p><p style=\"color: rgb(85, 85, 85);text-align: left;\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a683ua0tmuh1o482h0ls6git2h1449824330617.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\"><span>洪政秀</span></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\"><span>院长</span></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b><br/></p><p style=\"color: rgb(85, 85, 85);text-align: left;\"><span>Artline整形外科 院长</span></p><p style=\"color: rgb(85, 85, 85);text-align: left;\"><span>整形外科专门医</span><span><br/></span><span>前原辰整形外科院长</span><span><br/></span><span>前押鸠厅GYB整形外科院长</span><span><br/></span><span>前中央大学医院整形外科临床教授</span><span><br/></span><span>大韩整形外科学会正会员</span><span><br/></span><span>大韩美容整形外科学会正会员</span><span><br/></span><span>大韩整形外科开院医协医会正会员</span><span><br/></span><span>大韩头盖面部整形外科学会正会员</span><span><br/></span><span>大韩手部外科学会正会员</span><span><br/></span><span>国际整形外科学会正会员</span><span><br/></span><span>大韩肥胖体型学会正会员</span><span><br/></span><span>乳房整形手术并发症0.1%最低记录</span><span><br/></span><span>中央大学医院教授在职中</span><span><br/></span><span>最大手术件记录</span><span><br/></span><span>MENTOR SUPER USER COURSE</span><span><br/></span><span>ALLERGAN CADEVER</span><span><br/></span><span>BREAST OPERATION</span><span><br/></span><span>COURSE</span><span><br/></span><span>2004年,2005年,2006年,2008年,2009年</span><span><br/></span><span>大韩整形外科学会 论文发表</span></p><p></p>','<p>1、口径小、恢复快： 引进韩式精细无痕技术，结合博士团队对年临床经验，一改传统手术切口部位，调整切入方式，精确伤口至2厘米，可大幅缩短后期恢复时间。</p><p style=\"color: rgb(85, 85, 85);\"></p><div>2、韵律感、高逼真：采用国际先进的内窥镜技术，使用双向立体固位技术，将假体至于乳腺和胸大肌双平面下，确保假体律动空间,让胸部自然 纤颤、真实逼真。<br/>3、曲线美、柔触感：采用妙桃、娜高等多种原装进口高端假体，以精密 仪器数字化定位植入。所呈现的胸部乳沟自然，曲线娇挺、棉弹般的柔软。</div><p><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">1、乳房发育不良</p><p style=\"color: rgb(85, 85, 85);\">2、轻度乳房下垂或松弛</p><p style=\"color: rgb(85, 85, 85);\">3、乳房的大小或位置不对称</p><p style=\"color: rgb(85, 85, 85);\">4、身体偏消瘦，BMI指数偏低的<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗时长：</b></p><p style=\"color: rgb(85, 85, 85);\">60-90分钟</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">是</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></p><p style=\"color: rgb(85, 85, 85);\">1、手术前禁烟吸烟</p><p style=\"color: rgb(85, 85, 85);\">2、停止服用阿司匹林</p><p style=\"color: rgb(85, 85, 85);\">3、限制服用维他命E手</p><p style=\"color: rgb(85, 85, 85);\">4、术前6-8小时开始<font color=\"#4d4a4a\">禁食（包含水）</font><br/></p><p style=\"color: rgb(85, 85, 85);\"><font color=\"#4d4a4a\">5、避开月经期</font></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b></p><p style=\"color: rgb(85, 85, 85);\">Q：丰胸会很疼吗？</p><p style=\"color: rgb(85, 85, 85);\">丰胸一般是不会很疼的，因为手术过程中医生会进行麻醉。手术结束后，会有一定的疼痛。但这些疼痛求美者一般还可以忍受，毕竟爱美是需要付出。 </p><p style=\"color: rgb(85, 85, 85);\">Q：丰胸是长期的吗？ </p><p style=\"color: rgb(85, 85, 85);\">丰胸是长期的，在正常的情况下假体的使用时间至少是十年，有的可能会伴随自己到一辈子。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l2jvno151t1paac821mfg16884l1450259034258.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450258966.94',1,'2015-12-16 17:44:22','费用包含手术费、材料费','需提前一天预约'),(43,2400.00,1199.00,14,4,'o_1a6l2rr1k18cdbdk1ua18avknl5b1450259288863.jpg,o_1a6l2rr1k18cdbdk1ua18avknl5b1450259292500.jpg','自体脂肪填充 抚平面部凹陷细纹 拥有年轻美颜','7,1,2,8,3',0,'43',1,'<p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a682parsgcr4111hr1kuafk2121449823361626.png\"/></b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘荣升</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(80, 78, 75);\">院长</span></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b> </b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b>简介：</b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">五官面部整形博导<br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲整形美容研究院五官整形分院专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">国际美容外科学会特邀专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲鼻部综合整形科技领航者</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">擅长项目：韩式水晶眼、面部精雕手术、韩式芭比隆鼻、娇韵丰胸、眼脸提升。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">荣誉成就：<span class=\"Apple-converted-space\"> </span></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">国际医疗整形美容协会正式会员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲整形美容研究院五官整形分院专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">韩国木槿花医疗专家库外科博导</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">泛亚太平洋美容外科医学会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">中国医师协会美容与整形医师分会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">东方美容外科医学学会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚太地区美容外科学会会员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">中国首席微整形注射权威专家</span></span></p>','<p>自体脂肪丰全脸是通过提取人体自身某些部位吸取多余的脂肪细胞，然后经过吸出的脂肪细胞经净化处理后，选择完整的颗粒脂肪细胞通过注射的方式再移植到需要进行脂肪填充的部位，可让全脸达到饱满的效果。华美超细微自体脂肪移植术采用3L3M(即低压抽吸、低速离心、多点、多隧道、多层次、少量注射移植的方<font color=\"#000000\">法)。</font></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>适合人群：</b></p><p style=\"color: rgb(85, 85, 85);\">主要针对于自身脂肪有多余可以提取用来注射的<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗方法：</b></p><p style=\"color: rgb(85, 85, 85);\">手术</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗次数：</b></p><p style=\"color: rgb(85, 85, 85);\">一次</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>治疗时长：</b></p><p style=\"color: rgb(85, 85, 85);\">60-90分钟</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>是否住院：</b></p><p style=\"color: rgb(85, 85, 85);\">是</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b></p><p style=\"color: rgb(85, 85, 85);\">1、术前半个月禁服阿司匹林</p><p style=\"color: rgb(85, 85, 85);\">2、避开月经期<br/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b></p><p style=\"color: rgb(85, 85, 85);\">Q：面部脂肪填充后怎么护理恢复快？ </p><p style=\"color: rgb(85, 85, 85);\">保持静止，不要做夸张表情；不要按摩、刮痧；保持卫生，预防感染；3-4天内，针眼没有闭上前不要洗头；吸烟让血管收缩，血供减少，尽量不要吸烟。 </p><p style=\"color: rgb(85, 85, 85);\">Q：术后减肥会影响脂肪填充效果吗？ </p><p style=\"color: rgb(85, 85, 85);\">运动健身可以，节食不可以。节食会导致营养供给不足；也不可以熬夜，不良生活习惯对脂肪的生长都不好。<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l2rr1k18cdbdk1ua18avknl5b1450259292500.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450259174.98',1,'2015-12-16 17:47:46','仅包含一个部位','需提前一天预约'),(44,1600.00,880.00,4,4,'o_1a6nmsre91qqnl361bo113t6jbp241450347489734.jpg','电动微针美塑疗法 ','7,1,2',0,'44',1,'<p><!--StartFragment--><!--StartFragment--></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l1ks1k13pj1fbh1ej11jubh7d1c1450257911913.jpg\"/><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>姓名：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">赵康完</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>资质：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">主治医师</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>简介：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">美尔雅首席面部微雕专家</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">瓷美肌TM项目研发团队</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">国际健康体雕引领者</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">韩国微整知名注射专家</font></p><p></p>','<p><span>电动微针美塑疗法</span><span>(Automicroneedle Therapy System)</span><span>又称微针中胚层美容疗法，是将护肤活性成分或营养成分直接导入到皮下组织而发挥美容功效的护理方法。微针滚轮是利用滚轮上的小针穿透角质层，造成许多超微细管而帮助成分的导入。微针滚轮安全性高，使用方便，在专业美容机构中应用很广泛。</span><span></span></p><p><br/></p><p><span>电动微针特点</span><span></span></p><p></p><p><span>1.利用伤口的自然愈合能力，不会令皮肤变硬或引致皮肤细胞收缩</span><span></span></p><p></p><p><span>2.微针可以做出大量微细管道，令活性成分有效渗入皮肤（只需使用五分钟，便可造出超过</span><span>10</span><span>000个微孔）</span><span></span></p><p></p><p><span>3.副作用极低（产品推出市场多年以来，从没有关于副作用的个案）</span></p><p></p><p><span>4.微针按摩器功效显著，安全可靠，操作简易而且安全价钱合理</span><span></span></p><p></p><p><span>5.使用微针治疗后护理简易，可进行一般户外活动，包括晒太阳（注：必须涂上防晒用品）</span><span></span></p><p><span><br/></span></p><p><b>适合人群：</b></p><p>毛孔粗大、痘印等患者</p><p><br/></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nmsre91qqnl361bo113t6jbp241450347489734.jpg\"/><!--EndFragment--><br/></b></p><p></p><p></p><p></p>',1,'subcaticon/1450259706.32',1,'2015-12-16 17:55:26','费用仅包含一次费用','需提前一天预约'),(45,8888.00,7999.00,4,4,'o_1a6l3gc4k4k616kaa341nbr7j46k1450260010181.jpg,o_1a6l3gc4k4k616kaa341nbr7j46k1450260015741.jpg','美白针去黄靓肤 全身亮白不怕晒','7,1,2,8,3,5,6',0,'45',1,'<p><!--StartFragment--><!--StartFragment--></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l1ks1k13pj1fbh1ej11jubh7d1c1450257911913.jpg\"/><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>姓名：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">赵康完</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>资质：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">主治医师</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>简介：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">美尔雅首席面部微雕专家</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">瓷美肌TM项目研发团队</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">国际健康体雕引领者</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">韩国微整知名注射专家</font></p><p></p>','<p><span style=\"color: rgb(79, 73, 73);\">美白针里的成分大都是抗氧化成分，其中包括谷胱甘肽、传明酸和维他命C等。谷胱甘肽有助于身体排毒，也可帮助细胞抗氧化。传明酸则是可以用来控制黑色素的酵素作用，减少黑色素形成。美白针注射时是以点滴的形式将液体注入人体，通常在美白针注射3天后就可以渐渐看到美白效果。</span></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">分解色素  修复细胞  抗氧化  全身美白</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">美白针可快速分解人体肌肤的色素，修复受损细胞，抑制细胞氧化及黑色素形成，促使美白因子的细胞更新，由内而外达到美白效果。美白针注射液是功能修复型全身美白产品，适合所有16~60岁的爱美人士，让你从里到外的真正美白。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">淡斑祛痘  促进新陈代谢  肌肤美白细腻</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">美白针可使肌肤保持白净、精细，还能对暗疮、斑点、痘印等具有淡化的作用，同时，美白针还能促进肌肤的新陈代谢，有效抑制细胞衰老，令肌肤充满光泽，由内而外的白里透红，从而达到一个全身美白的效果，面对阳光，不再担心会被晒黑！</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\"><br/></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\"><b>适合人群：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">肤色不均</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">晒后肌肤修改</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">肌肤的抗衰老与美</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">皮肤灰暗、苍老、变黑等皮肤老化</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">面部有色斑、皮肤色素沉着</font></p><p style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(79, 73, 73);\">经常熬夜、作息不规律导致皮肤不佳</span></p><p style=\"background-color: rgb(255, 255, 255);\"><br/></p><p style=\"background-color: rgb(255, 255, 255);\"><b>治疗方法：</b></p><p style=\"background-color: rgb(255, 255, 255);\"><!--StartFragment--><span style=\"color: rgb(102, 102, 102);float: none;background-color: rgb(255, 255, 255);\">手背静脉滴注</span><!--EndFragment--><br/></p><p style=\"background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(102, 102, 102);float: none;background-color: rgb(255, 255, 255);\"><b><br/></b></span></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#666666\"><b>治疗次数：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\">一次</p><p style=\"background-color: rgb(255, 255, 255);\"><br/></p><p style=\"background-color: rgb(255, 255, 255);\"><b>治疗时长：</b></p><p style=\"background-color: rgb(255, 255, 255);\">20-30分钟</p><p style=\"background-color: rgb(255, 255, 255);\"><br/></p><p style=\"background-color: rgb(255, 255, 255);\"><b>是否住院：</b></p><p style=\"background-color: rgb(255, 255, 255);\">否</p><p style=\"background-color: rgb(255, 255, 255);\"><br/></p><p style=\"background-color: rgb(255, 255, 255);\"><b>常见问题：</b></p><p>StartFragment</p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">Q：美白针是全身变白还是局部的？</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">美白针注射是由内而外的使全身肌肤莹透亮白，通常注射3次后即可见到全身肌肤明显变白，1周后全身肌肤彻底润白，一疗程后效果保持时间更长久。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">Q：皮肤一晒就黑，这样打美白针有用吗？再一晒会不会又复黑？</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">美白针适合皮肤全身性暗沉或先天性暗沉，紫外线造成的肤色黝黑以及因亚健康状态导致的肤色萎黄者。量身定做的个性化配方，使美白营养恰到好处地有效遏制黑色素形成。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">Q：美白针通常要几天才能看到效果？</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">美白针里的成分大都是抗氧化成分，注射时是以点滴的形式将液体注入人体，通常在注射3-7天后就可以渐渐看到美白效果。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">Q：打完美白针后要注意什么呢？</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#4f4949\">美白针注射后，应避免阳光直射，外出戴太阳帽、打太阳伞，外用防晒产品，选用安全性高且防晒效果佳的产品，如：UVB防晒指数(SPF)&gt;30；UVA防晒系数(PFA)&gt;++，可有效的保持皮肤美白的效果哦！<span class=\"Apple-converted-space\"> </span></font></p><p style=\"background-color: rgb(255, 255, 255);\"><b><br/></b></p><p style=\"background-color: rgb(255, 255, 255);\"><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6l3gc4k4k616kaa341nbr7j46k1450260015741.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450259886.18',1,'2015-12-16 17:59:58','费用包含8次注射费用','需提前一天预约'),(46,2800.00,1500.00,13,4,'o_1a6nm2udr1s35pse15971n9vt0p11450346523063.jpg','冷光牙齿美白 让你一展美丽笑颜','7,1,2,8,3',0,'46',1,'<p><b><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a682parsgcr4111hr1kuafk2121449823361626.png\"/></b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">刘荣升</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(80, 78, 75);\">院长</span></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b> </b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><b>简介：</b></p><p class=\"p\" style=\"color: rgb(85, 85, 85);\"><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">五官面部整形博导<br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲整形美容研究院五官整形分院专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">国际美容外科学会特邀专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲鼻部综合整形科技领航者</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">擅长项目：韩式水晶眼、面部精雕手术、韩式芭比隆鼻、娇韵丰胸、眼脸提升。</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">荣誉成就：<span class=\"Apple-converted-space\"> </span></span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">国际医疗整形美容协会正式会员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚洲整形美容研究院五官整形分院专家</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">韩国木槿花医疗专家库外科博导</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">泛亚太平洋美容外科医学会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">中国医师协会美容与整形医师分会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">东方美容外科医学学会委员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">亚太地区美容外科学会会员</span><br style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"/><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">中国首席微整形注射权威专家</span></span></p>','<p>这种技术是一项正流行于欧美的牙齿美白技术，它不仅可以去除牙齿表面的色素沉积，同时可进入牙齿深层达到脱色的效果。操作过程仅需三十分钟，无副作用，美白效果可维持两年以上。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>技术优势：</b><br/>医院采用的低温冷光，不产生热效应，完全避免了操作过程中对牙神经的刺激，不会引起牙神经的不适，所以牙齿不会有酸胀感觉。医生会在牙齿全面涂抹昂贵、无害的美白材料之后，全口牙齿一次照射，所以大大缩短了美白时间，只需30分钟，就可以迅速美白全口牙齿，美白时间短，感觉轻松，美白效果明显。天大口腔所用的美白材料具有亲水性 ,在美白过程中又完全不接触牙龈，对牙齿结构不会造成任何损害。<br/>医院引进的美白牙齿过程仅需短短几分钟，无刺激、无副作用，冷光牙齿美白效果可维持2年以上。因此被公认是目前最有效及最安全的牙齿脱色技术。<br/><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>注意事项：</b><br/>1、冷光美白牙齿后24小时内，牙齿很容易再染上有色物质，必须避免饮用茶、咖啡、可乐、红酒、莓果类饮料、有色牙膏、漱口水等及食用深色食物，同时要避免吸烟。<br/>2、建议患者使用美白牙膏，可减轻冷光美白后食物的再着色。<br/>3、平时饮食也应该尽量减少深色食物，注意口腔卫生，早中晚注意刷牙漱口，保持口腔清洁。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nm2udr1s35pse15971n9vt0p11450346523063.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450316971.91',1,'2015-12-17 09:56:47','费用包含一次美白牙齿费用','需提前一天预约'),(47,95000.00,70000.00,17,4,'o_1a6nmhbnd117vl5o8gluik1lv6171450347042421.png','韩式健康纤体管理','7,1,2,8,3,5,6',0,'47',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nmegsj1did1hsh1nn23jhluvr1450346765778.png\"/><!--EndFragment--><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><br/></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>姓名：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">蔡钟显</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>资质：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\">主治医师</font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><br/></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"><b>简介：</b></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"></font></p><p>JC美秀健康纤体管理系统研发团队团员之一</p><div>韩国微整形基地形体雕塑领衔者</div><div>中韩中医瘦身基地专家团领军代表</div><div>中韩知名针灸医学专家</div><div>神经阻滞术专家</div><div>亚洲疼痛科专家</div><div>大韩肥满学会平生会员</div><div>大韩肥满体型学会会员</div><div>韩国肥胖症治疗学会 会员</div><div>韩国肥胖症健康学会 会员<p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#000000\"></font></p></div>','<p>JC美秀健康纤体管理系统是韩国木槿花医疗集团研发的一种全新的健康管理绿色瘦身方法，结合中韩医美技术，全方位分析求美者身体，针对求美者身体各种机能数据，制定个性化治疗方式，采用中药、针灸、美秀针等多种方式排除体内毒素，加强身体新陈代谢，提高基础代谢量。多种前沿瘦身技术的综合运用与完美结合来达到美塑身形，改善亚健康的目的。无需手术就能轻松减去多余脂肪，让您拥有健康的曲线美，自然疗法不反弹。一个疗程减重15%-35%。<br/></p><p>JC美秀健康纤体管理的瘦身作用：</p><p>通过促进人体血液循环调节内分泌，从而使人的体型变得更加自然美丽的整形疗法。刺激筋膜及软组织 → 筋膜弹性增加，周围组织气血循环增加，促进皮肤代谢及脂肪代谢 → 溶解脂肪，尺寸变小，促进胶原蛋白生成和再生，增加弹性<br/></p><p>JC美秀纤体健康管理的主要功效：</p><p>• 塑身持久分解脂肪，促进皮肤代谢及脂肪代谢，在减除脂肪目标量的同时，将毒素一同通过排尿排便的方式快速排泄出体外从而塑造轻盈苗条的身材，达到塑身效果持久的目的。</p><p>• 紧致提升改善活血功能和筋膜来诱导自体组织再生，增加弹性和气血循环，同时促进胶原蛋白的合成，使松弛的肌肉变得紧致有弹性。</p><p>• 自然有型在分解脂肪，促进皮肤代谢及脂肪代谢，皮肤变得有弹性的同时，治疗部位也会随之变得尺寸变小，自然有型，治疗后，保持有规律的饮食起居就能享受健康苗条的身材，效果持久不反弹。</p><p>• 健康有效无需节食，可改善高血压、脂肪肝、高血脂、贫血、月经不调、便秘、胃肠功能紊乱、疲劳、失眠、浮肿、心肺功能低下、皮肤问题等身体亚健康症状，修复身体健康机能。<br/></p><p><br/></p><p>JC美秀纤体健康管理为您解决：</p><p>1.改善及矫正血液循环，新陈代谢，脂肪代谢</p><p>2.瘦身 + 保持体型</p><p>a.背部  b.胳膊  c.腹部  d.腰部  e.臀部  f.大腿  g.小腿</p><p>3.抗老化</p><p>a.增加皮肤弹力  b.提升下垂肌肤  c.恢复青春减龄</p><p>4.身体净化及解除毒素</p><p>a.调整身体不均衡  b.排除体内毒素  c.改善以下疾病的症状脂肪肝, 高脂血症, 贫血, 月经不调, 便秘，肠胃功能紊乱, 疲劳, 失眠, 浮肿,心肺功能低下，及改善皮肤问题<br/></p><p><br/></p><p>JC美秀纤体健康管理的瘦身项目<br/></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nmhbnd117vl5o8gluik1lv6171450347042201.png\"/><!--EndFragment--><br/></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nmhbnd117vl5o8gluik1lv6171450347055370.png\"/><!--EndFragment--><br/></p><p><b><br/></b></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nmhbnd117vl5o8gluik1lv6171450347042421.png\"/><!--EndFragment--><br/></b></p>',1,'subcaticon/1450318478.41',1,'2015-12-17 10:15:20','具体可达到效果需咨询医院','需提前一天预约'),(48,2540.00,1980.00,18,4,'o_1a6nl8ttcb367e7gdp1mteka6ch1450345565647.jpg','韩式半永久眉毛','7,1,2,8,3',0,'48',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nhq68q1j47f0025318aa33a1450341930128.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">李知垠（韩国）<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师</p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#676363\">美尔雅整形首席纹绣技术培训老师</font></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#676363\">世界纹绣艺术研究院殿堂级纹绣师</font></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#676363\">韩国“素颜圣手”</font></span></p><p style=\"color: rgb(85, 85, 85);\"><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#676363\">韩国半永久化妆术创始人之一</font></span></p>','<p><span style=\"color: rgb(81, 74, 74);\">美学与面相相结合</span></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">将医学纹绣技术与面相玄学相结合，设计出自然灵动、改善面相的纹绣方案，以达到修饰美化、开运转运的效果。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">进口天然颜料</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">所选用的色料全部为韩国天然进口医用色料，颜色正，符合个人气质，效果持久，自然真实，立体感强。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">一人一针无菌操作</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">手术在无菌环境操作，卫生洁净，对于直接接触皮肤的所有用具都保证使用一次性物品，做到一人一针，对顾客负责，让顾客放心接受纹绣。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">自然生动宛如天生</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">纹绣专家是经过专业训练、具有十几年临床经验的精英纹绣人才，熟练精湛的手法与独到的审美，让您拥有自然真实纹绣效果。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><br/></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><b>适合人群：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><!--StartFragment--><span style=\"float: none;background-color: rgb(255, 255, 255);\">对自身眉形不满意，想要改变眉形</span><br/></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><span style=\"float: none;background-color: rgb(255, 255, 255);\"><br/></span></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><!--StartFragment--></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\"><b>治疗次数：</b></font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\">一次</font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\"><br/></font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\"><b>治疗时长：</b></font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\">60分钟</font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\"><br/></font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\"><b>是否住院：</b></font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\">否</font></font></p><p style=\"color: rgb(85, 85, 85);background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><font color=\"#696262\"><br/></font></font></p><p style=\"background-color: rgb(255, 255, 255);\"><!--StartFragment--></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><b>常见问题：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">Q：韩国半永久化妆术多久恢复？<br/>医院运用专业认证的医疗器械精密操作，加上纹绣师娴熟的技法，可将韩国半永久化妆术的恢复速度达到比较理想的状态。定制天然弧线眉形不会出现术后肿胀，定制天然魔法眼线只需三四个小时肿胀就会消失。 </font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">Q：做完韩国半永久化妆术有哪些注意事项？<br/>做完韩国半永久化妆术后，可以照常用水来做面部清洁，但要注意3-4天内不要使用洗面奶。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\">Q：韩国永久化妆为什么能在韩国流行？<br/>韩国半永久化妆术是一种不需要每天化妆也能拥有精致妆容的方法。它具有无过敏、不会结痂、自然吸收、不留痕迹、可根据风格调整的技术优势。在注重外表又追求时尚的韩国，半永久化妆术满足了大家追求天然、清新、精致妆容的多方面美丽需求，也符合快节奏的时尚生活需要。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><br/></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#514a4a\"><b>效果展示：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><!--StartFragment--><font color=\"#514a4a\"><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nl8ttcb367e7gdp1mteka6ch1450345565647.jpg\"/></font></p>',1,'subcaticon/1450319525.61',1,'2015-12-17 10:34:29','费用包含麻醉、手术费用等','需提前一天预约'),(49,2200.00,1680.00,20,4,'o_1a6nkv850tanlh9mv5u474tobu1450345295491.png','韩式半永久美瞳线','7,1,2,8,3',0,'49',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nhkap9olu1iou1n3r1n98ui62l1450341757025.png\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">李知垠（韩国）<br/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: 