6262\">来自韩国风靡欧亚——韩式半永久定妆术</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">一种介于整形美容术与普通化妆术之间的美容技术；</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">一种可以让人的眉形、眼睛、嘴唇等呈现出自然的化妆效果的技术；</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">一种能让妆容维持2~3年或更长的时间的技术；</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">源自于德国，兴盛于韩国</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">永久妆是20多年前在德国早被开发的，也就是如今风靡全球的半永久化妆技术，这种技术在韩国叫做半永久妆。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">懒美人元气满满的秘密</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">本项目适合爱美又懒得每天化妆的懒美人或者工作繁忙没有时间化妆的现代职场女性。“半永久性化妆术”就是为您量身订造的全新美容技术。省去化妆补妆的时间，让你每天都能元气满满。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">半永纹唇的特点</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">美唇最高标准在于嘴唇与面部整体的和谐，只有适合自己的才是最美的。李医生会基于艺术美学，结合每位求美者的性格特征和面部特点设计与众不同的唇色与唇形，将纯植物提取的色素，植染于唇部，轻松打造专属&#34;唇&#34;情气质。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><br/></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><b>适合人群：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><!--StartFragment--></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">先天性唇形不理想，唇峰不明显</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">唇红线不清楚，有断裂或缺损</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">唇缘严重缺损不齐，唇薄，长短不成比例</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">因贫血，心脏及循环系统病变而造成的色泽明显暗淡无华</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><b><br/></b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><b>治疗次数：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">一次</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><br/></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><b>治疗时长：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">60分钟</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><br/></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><b>是否住院：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">否</font></p><p style=\"background-color: rgb(255, 255, 255);\"><br/></p><p style=\"background-color: rgb(255, 255, 255);\"><strong><font color=\"#696262\">常见问题：</font></strong></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">Q：韩式半永久纹唇会不会很疼？</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">半永久纹唇在开始前会敷表面麻醉剂，这样可以有效降低痛感。纹绣过程中，多少是有一点点痛的，不过一般人都是可以忍受的。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">Q：韩式半永久纹唇颜色容易掉吗？</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">质量不好的色料纹唇会有明显的掉色现象，但是本次采用的是高级天然色料，基本不会掉色，大概能维持3年左右，时间长了会有褪色现象。</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">Q：韩式半永久纹唇容易感染吗？</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\">韩式半永久纹唇所采用的医疗器械都是经过严格消毒的，纹绣过程中使用的一次性耗材采用高级灭菌包装，感染风险极低。纹绣时，针头刺进皮肤只有半毫米多一点，不会伤到真皮。因此是不容易出现感染的哦。这也需要求美者们去正规医院找经验丰富的纹绣师才可以哦！</font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><b><br/></b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><b>效果展示：</b></font></p><p style=\"background-color: rgb(255, 255, 255);\"><font color=\"#696262\"><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nkiaq61scntiu6a91svecd6bb1450345094024.png\"/></font></p>',1,'subcaticon/1450319778.88',1,'2015-12-17 10:36:48','费用包含表面麻醉','需提前一天预约'),(51,7600.00,5800.00,5,6,'o_1a6n9stn046vh8m1vk554l1n0b11450335130040.jpg','百达丽隐形全切开法 打造眼睛美丽弧线','7,1,2,8,3,5,6',0,'51',1,'<p><title></title></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6mtr81f1dfdr8k12541sn81ta6461450321370024.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p class=\"p\"><b>姓名：</b><b></b></p><p class=\"p\">王维<br/></p><p><br/></p><p class=\"p\"><b>资质：</b></p><p class=\"p\">主治医师</p><p class=\"p\"><br/></p><p class=\"p\"><b>简介：</b></p><p class=\"p\">毕业于上海交通大学医学院</p><p class=\"p\">上海九院整形外科硕士</p><p class=\"p\">师承上海九院专家林晓曦教授</p><p class=\"p\">中华医学会整形外科学会会员 </p><p class=\"p\">中国医师协会整形与美容分会会员</p>','<p><span style=\"color: rgb(85, 85, 85);float: none;background-color: rgb(255, 255, 255);\">百达丽双眼皮成形术，从美学、解剖学、生物力学、组织学四个科学角度，讲究双眼皮成形后的翘度、宽度、弧度、厚度、动度这五度效果，做到美到刚刚好，术后效果自然美观，睫毛上翘，看起来更具灵性与动感。百达丽切开法相比普通切开法，手法更精细，疤痕隐形，线条弧度更清晰自然。</span><!--EndFragment--><br/></p><p><br/></p><p><!--StartFragment--></p><p class=\"p\"><span><b>适合人群：</b></span><span></span></p><p class=\"p\"><span>眼皮脂肪多而厚；眼皮松弛下垂的；适用于各种双眼皮修复。<br/></span></p><p class=\"p\"><span><br/></span></p><p class=\"p\"></p><p class=\"p\"><span><b>治疗方法：</b></span><span></span></p><p class=\"p\">手术</p><p></p><p><br/></p><p class=\"p\"><span><b>治疗次数：</b></span><span></span></p><p class=\"p\">一次</p><p class=\"p\"><br/></p><p><b>术前准备：</b></p><p>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</p><p>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。</p><p>3、双眼皮手术与近视眼手术之间要相隔至少两个月。</p><p>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物</p><p>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症</p><p>6、做双眼皮手术女性要避开月经期。</p><p>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。</p><p class=\"p\"><span><b><br/></b></span></p><p class=\"p\"><span><b>手术时长：</b></span><span></span></p><p class=\"p\"><span>60分钟</span></p><p class=\"p\"><br/></p><p class=\"p\"><!--StartFragment--></p><p class=\"p\"><span><b>术后是否住院：</b></span></p><p>否</p><p></p><p class=\"p\"><br/></p><p class=\"p\"><span><b>注意事项：</b></span><span></span></p><p class=\"p\"><span>术后48～72小时冰块冷敷。术后1周内，用双氧水清洗切口，2次/日，并局部涂以抗生素软膏。1周后，将固定重睑线的缝线和切口处的缝线一并拆除。</span></p><p><br/></p><div><b>效果展示：</b></div><div><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6n9stn046vh8m1vk554l1n0b11450335130040.jpg\"/><!--EndFragment--><br/></b></div>',1,'subcaticon/1450320444.17',1,'2015-12-17 10:55:07','费用包含手术费和局麻','需提前一天预约'),(52,2800.00,1500.00,5,6,'o_1a6nbcqkn1u6khbl6lr1cbl130ep1450335362952.jpg','百达丽多点埋线双眼皮 成为大眼美女就是那么简单','7,1,2,8,3,5,6',0,'52',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nbcqkn1u6khbl6lr1cbl130ep1450335366603.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p>毛琪</p><p><br/></p><p><b>资质：</b></p><p>主治医师</p><p><br/></p><p><b>简介：</b></p><p>浙江大学医学硕士</p><p>浙江省美容外科A类主诊医师</p><p>中华医学会整形外科学会会员</p><p>中国医师协会整形与美容分会会员<br/></p>','<p>百达丽双眼皮成形术，从美学、解剖学、生物力学、组织学四个科学角度，讲究双眼皮成形后的翘度、宽度、弧度、厚度、动度这五度效果，做到美到刚刚好，术后效果自然美观，睫毛上翘，看起来更具灵性与动感。无痕多点埋线法是直接把手术线（或高分子缝合线）埋藏于皮肤及睑板之间，使上睑皮肤同睑板发生粘连，形成自然流畅双眼皮的手术方法，微创，恢复期短。<br/></p><p><br/></p><p><b>适合人群：</b></p><p>对切开有负担的；眼皮皮肤薄；眼睑不怎么下垂的<br/></p><p><br/></p><p><b>治疗方法：</b></p><p>手术</p><p><br/></p><p><b>治疗次数：</b></p><p>一次</p><p><br/></p><p><b>治疗时长：</b></p><p>30-40分钟<br/></p><p><br/></p><p><b>是否住院：</b></p><p>否</p><p><br/></p><p><b>注意事项：</b></p><p>1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</p><p>2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。</p><p>3、双眼皮手术与近视眼手术之间要相隔至少两个月。</p><p>4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物</p><p>5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症</p><p>6、做双眼皮手术女性要避开月经期。</p><p>7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。</p><p><br/></p><p><b>常见问题：</b></p><p>术后消肿：</p><p>1、术后48小时内冷敷，之后热敷；</p><p>2、及时清除刀口的血迹，眼药膏泡软后用棉签或纸巾沾掉；</p><p>3、防止发炎，刀口别碰水，别用手摸；</p><p>4、多眨眨眼。 </p><p> 术中疼痛：</p><p>术前麻醉只有轻微的针刺感；术中麻醉后无疼痛；术后不同程度的&#34;发胀&#34;感觉                                                        恢复时间：术后第一天开始肿胀，第二天达到高峰，第三天开始消肿。一般五天拆线后肿胀有一点但不是太明显。一个月就比较自然。1至3个月肿胀基本消退。治疗后半年到一年疤痕基本退去，后形成好看的双眼皮。</p><p> 恢复心态：</p><p>双眼皮手术，越淡定越不肿，无论术中还是术后越放松、淡定、不紧张，恢复得越自然。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nbcqkn1u6khbl6lr1cbl130ep1450335362952.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450335245.22',1,'2015-12-17 15:02:45','费用包括手术费和局麻','需提前一天预约'),(53,5600.00,3800.00,5,6,'o_1a6nc1ebb1in6m6a16ku1f2heqn1m1450335938081.jpg','百达丽微创部分切开法 打造混血范儿','7,1,2,8,3,5,6',0,'53',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nc1ebb1in6m6a16ku1f2heqn1m1450335996804.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p>韩嘉毅<br/></p><p><br/></p><p><b>资质：</b></p><p>主治医师</p><p><br/></p><p><b>简介：</b></p><p>毕业于上海交通大学医学院 </p><p>上海九院整形外科硕士</p><p>师从颅颌面外科专家穆雄铮教授</p><p>韩国KAAS学会会员<br/></p>','<p>百达丽双眼皮成形术，从美学、解剖学、生物力学、组织学四个科学角度，讲究双眼皮成形后的翘度、宽度、弧度、厚度、动度这五度效果，做到美到刚刚好，术后效果自然美观，睫毛上翘，看起来更具灵性与动感。微创部分切开法结合了传统埋线法和切开法的特点，部分切开上睑皮肤进行去皮去脂，同时上提睑板，可以根据个人要求和情况达到各种角度的睫毛上翘。术后更可靠，不易脱落，增大眼裂，眼部自然美观。<br/></p><p><b><br/></b></p><p><b>适合人群：</b></p><p>眼皮脂肪多而厚的；眼皮不松弛的。<br/></p><p><b><br/></b></p><p><b>治疗方法：</b></p><p>手术</p><p><b><br/></b></p><p><b>治疗次数：</b></p><p>一次</p><p><b><br/></b></p><p><b>治疗时长：</b></p><p>60分钟</p><p><br/></p><p><b>是否住院：</b></p><p>否</p><p><b><br/></b></p><p><b>注意事项：</b></p><p style=\"color: rgb(85, 85, 85);\">1、术前不要化妆，保持眼部清洁，不要戴隐形眼镜。</p><p style=\"color: rgb(85, 85, 85);\">2、如有结膜炎、睑缘炎、严重砂眼者必须治愈后才能接受手术。</p><p style=\"color: rgb(85, 85, 85);\">3、双眼皮手术与近视眼手术之间要相隔至少两个月。</p><p style=\"color: rgb(85, 85, 85);\">4、双眼皮手术前两周内，请勿服用含有阿斯匹林的药物</p><p style=\"color: rgb(85, 85, 85);\">5、双眼皮手术前确定身体健康，无传染性疾病或其他身体炎症</p><p style=\"color: rgb(85, 85, 85);\">6、做双眼皮手术女性要避开月经期。</p><p style=\"color: rgb(85, 85, 85);\">7、术前准备太阳镜（遮掩伤痕）、冰袋（术后冰敷伤口用）等物品。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>常见问题：</b></p><p style=\"color: rgb(85, 85, 85);\"><!--StartFragment--></p><p style=\"color: rgb(85, 85, 85);\">术后消肿：</p><p style=\"color: rgb(85, 85, 85);\">1、术后48小时内冷敷，之后热敷；</p><p style=\"color: rgb(85, 85, 85);\">2、及时清除刀口的血迹，眼药膏泡软后用棉签或纸巾沾掉；</p><p style=\"color: rgb(85, 85, 85);\">3、防止发炎，刀口别碰水，别用手摸；</p><p style=\"color: rgb(85, 85, 85);\">4、多眨眨眼。 </p><p style=\"color: rgb(85, 85, 85);\"> 术中疼痛：</p><p style=\"color: rgb(85, 85, 85);\">术前麻醉只有轻微的针刺感；术中麻醉后无疼痛；术后不同程度的&#34;发胀&#34;感觉 恢复时间：术后第一天开始肿胀，第二天达到高峰，第三天开始消肿。一般五天拆线后肿胀有一点但不是太明显。一个月就比较自然。1至3个月肿胀基本消退。治疗后半年到一年疤痕基本退去，后形成好看的双眼皮。</p><p style=\"color: rgb(85, 85, 85);\"> 恢复心态：</p><p style=\"color: rgb(85, 85, 85);\">双眼皮手术，越淡定越不肿，无论术中还是术后越放松、淡定、不紧张，恢复得越自然。</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>效果展示：</b></p><p style=\"color: rgb(85, 85, 85);\"><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nc1ebb1in6m6a16ku1f2heqn1m1450335938081.jpg\"/></b></p>',1,'subcaticon/1450335873.55',1,'2015-12-17 15:11:13','费用包括手术费和局麻','需提前一天预约'),(54,56000.00,48000.00,22,6,'o_1a6nch90k1l221dm4188bpo21up92j1450336455664.jpg','百达丽全自体软骨隆鼻 让你不再害怕揉捏','7,1,2,8,3,5,6',0,'54',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nch90k1l221dm4188bpo21up92j1450336619128.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p>王艳</p><p><br/></p><p><b>资质：</b></p><p>主治医师</p><p><b><br/></b></p><p><b>简介：</b></p><p>毕业于哈尔滨医科大学整形外科硕士</p><p>中国医师协会美容与整形分会会员</p><p>原上海交通大学附属上海第一人民医院整形医师</p><p>1999年9月从医至今，从事美容整形行业16年<br/></p>','<p>百达丽全自体软骨隆鼻整形，是将耳软骨、肋软骨、鼻中隔软骨、筋膜组织等人体自身组织综合利用，对鼻尖、鼻梁等鼻部形态实施个性化调整，从而塑造自然真实犹如天生的美鼻。具有：不会排异、吸收率低、触感真实、多重修复、重点改善鼻尖的特点。<br/></p><p><br/></p><p><b>适合人群：</b></p><p>介意假体植入，重点改善鼻尖<br/></p><p><br/></p><p><b>治疗方法：</b></p><p>手术</p><p><br/></p><p><b>治疗次数：</b></p><p>一次</p><p><b><br/></b></p><p><b>治疗时长：</b></p><p>3-4小时</p><p><br/></p><p><b>是否住院：</b></p><p>否</p><p><br/></p><p><b>注</b><b>意事项：</b></p><p>1、鼻孔整形术前的一周内一定要禁止吃所有的营养品以及药物，幸免可能会造成术中出血现象的发生。　　</p><p>2、鼻孔整形术前一定要将面部洗净，将面部的化妆物质去掉，必需是干净的脸进行手术的。　　</p><p>3、鼻孔整形术前24小时内一定要停滞饮酒，幸免因饮酒而加速血液循环导致术中出血现象的发生。<br/></p><p>4、鼻综合整形术后应有安静舒适的环境休养；手术当日伤口会有些疼痛，但随着时间的推移会逐渐减轻。</p><p>5、病人不要急于吃去痛片，因为阿斯匹林类药物会加重伤口出血；避免进食刺激性食物如辣椒等；严格遵守医生嘱咐服药及复诊。</p><p><br/></p><p><b>常见问题：</b></p><p>Q：软骨是否会被吸收？ </p><p> 软骨鼻整形在术后存在5—10%的被吸收情况。我们解决的方法，是在软骨鼻整形术前设计的时候，将可能被吸收的软骨进行具体量化（一般术前会将鼻子做得大一些），随着术后逐步恢复6月-12月后，软骨将稳定成活，效果便可持续。 </p><p>Q： 取软骨是否会留疤？</p><p>鼻中隔软骨是在鼻内采用切口，取骨和隆鼻手术一次完成，不需要辅助切口。耳窝内耳软骨会再生，外观不会改变且伤口隐藏，无需担心留疤问题。肋软骨是采用专用的肋软骨切取器，可以经2-3cm长的微创刀口取出所需要的肋软骨，切口经过非常精细的缝合后，瘢痕会很小，几乎看不出来。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nch90k1l221dm4188bpo21up92j1450336455664.jpg\"/></b></p>',1,'subcaticon/1450337005.08',1,'2015-12-17 15:23:15','费用包括手术费、麻醉费和材料费','需提前一天预约\r\n'),(55,6600.00,4800.00,8,6,'o_1a6nd7iba1jbh189aenvfv9f2p3b1450337163143.jpg','百达丽假体隆鼻 打造傲人鼻峰','7,1,2,8,3,5,6',0,'55',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nd7iba1jbh189aenvfv9f2p3b1450337235898.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p>谈宇腾<br/></p><p><b><br/></b></p><p><b>资质：</b></p><p>主治医师</p><p><br/></p><p><b>简介：</b></p><p>毕业于复旦大学医学院</p><p>从事整形美容行业近15年</p><p>中国医师协会美容与整形医师分会会员</p><p>亚洲面部整形美容外科学会会员<br/></p>','<p>选择百达丽假体隆鼻六大理由：</p><p>1.全数字3D成像系统，全方位辅助诊断、治疗及判断预后。</p><p>2.切口一般选择在鼻小柱或鼻孔内，安全无痛，术后无疤痕，形态自然逼真。</p><p>3.假体颜色与皮肤相似，不会有虚假的感觉。</p><p>4.医用硅胶形态基本成型，只要稍加修正就能使用，所以价格相对也不是很贵。</p><p>5.所有专家皆来自三甲公立医院，技术一脉相承。</p><p>6.术前签订安全质保书，进行终身质保服务。<br/></p><p><br/></p><p><b>适合人群：</b></p><p>针对拥有塌鼻、低鼻、鼻根低垂、外伤畸形等不完美鼻型者。<br/></p><p><br/></p><p><b>治疗方法：</b></p><p>手术</p><p><br/></p><p><b>治疗次数：</b></p><p>一次</p><p><br/></p><p><b>治疗时长：</b></p><p>40-60分钟</p><p><br/></p><p><b>是否住院：</b></p><p>否</p><p><b><br/></b></p><p><b>注意事项：</b></p><p>1.手术前一天洗澡，手术当天上手术台前要用肥皂洗去面部的污垢和油脂，尽量减少细菌的数量，手术前还应该剪鼻毛和清洁鼻腔；</p><p>2.手术前两周内,请勿服用含有阿斯匹林的药物,因为阿司匹林会使得血小板凝固的功能降低； </p><p>3.患有高血压和糖尿病的患者,应该在初诊时翔实向医生告知病情,以便应诊大夫确认手术方案； </p><p>4.手术前确定身体健康,无传染性疾病或其他身体炎症； </p><p>5.术前不要化妆。<br/></p><p><br/></p><p><b>常见问题：</b></p><p>Q：假体隆鼻手术切口在哪?会留下疤痕吗? </p><p>假体隆鼻手术方法的切口有鼻孔内侧缘和燕式切口两种，主要适合鼻梁塌鞍鼻和低鼻梁的人等等。这两种手术切口都不会留下疤痕，只是在手术时进行的方法不一样而已。</p><p>Q：假体隆鼻的优点？ </p><p>人工材料最大优点就是不需要额外的手术损伤，而且假体能显露理想的轮廓，远期不会吸收变形。<br/></p><p><b><br/></b></p><p><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nd7iba1jbh189aenvfv9f2p3b1450337163143.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450337097.25',1,'2015-12-17 15:32:16','费用包括手术费和材料费','需提前一天预约'),(56,12000.00,9600.00,23,6,'o_1a6ndncu01f1a1dhf17341f8n1d78481450337763374.jpg','百达丽鼻整形 重建自信美鼻','7,1,2,8,3,5,6',0,'56',1,'<p><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nd7iba1jbh189aenvfv9f2p3b1450337235898.jpg\"/></p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>姓名：</b></p><p style=\"color: rgb(85, 85, 85);\">谈宇腾<br/></p><p style=\"color: rgb(85, 85, 85);\"><b><br/></b></p><p style=\"color: rgb(85, 85, 85);\"><b>资质：</b></p><p style=\"color: rgb(85, 85, 85);\">主治医师</p><p style=\"color: rgb(85, 85, 85);\"><br/></p><p style=\"color: rgb(85, 85, 85);\"><b>简介：</b></p><p style=\"color: rgb(85, 85, 85);\">毕业于复旦大学医学院</p><p style=\"color: rgb(85, 85, 85);\">从事整形美容行业近15年</p><p style=\"color: rgb(85, 85, 85);\">中国医师协会美容与整形医师分会会员</p><p style=\"color: rgb(85, 85, 85);\">亚洲面部整形美容外科学会会员<br/></p>','<p>百达丽提供更富有经验的医生主刀进行鼻修复手术，针对鼻梁歪斜、假体移动、鼻头变形、注射失败等情况，取出假体，重新设计方案，并且对修复手术的假体或者自软骨进行充分固定。<br/></p><p><br/></p><p><b>适合人群：</b></p><p>隆鼻后出现鼻梁歪斜、假体移动、鼻头变形、注射失败等</p><p><b><br/></b></p><p><b>治疗方法：</b></p><p>手术</p><p><br/></p><p><b>治疗次数：</b></p><p>一次</p><p><b><br/></b></p><p><b>治疗时长：</b></p><p>40分钟</p><p><br/></p><p><b>是否住院：</b></p><p>否</p><p><b><br/></b></p><p><b>注意事项：</b></p><p>1、隆鼻失败后3个月内即可进行修复手术 </p><p>2、如果是有炎症发生时，则需要先取出假体，等炎症消除后才能进行修复手术。<br/></p><p>3、隆鼻修复手术前一周内，包括维生素E在内的所有维生素及阿司匹林一律停止使用;</p><p>4、隆鼻修复手术前两天，不可过多的服用酒精类饮品;</p><p>5、隆鼻修复手术当天早餐须少量进食。<br/></p><p><br/></p><p><b>常见问题：</b></p><p>Q：隆鼻失败最佳时间？</p><p>隆鼻失败后3个月内即可进行修复手术 </p><p>Q：怎样选择隆鼻医院？ </p><p>为了避免再次出现手术失败问题，避免二次、多次伤害，选择正规的医院和富有经验的医生是非常重要的。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ndncu01f1a1dhf17341f8n1d78481450337763374.jpg\"/><!--EndFragment--><br/></b></p>',1,'subcaticon/1450337646.57',1,'2015-12-17 15:41:43','费用包括手术费和材料费','需提前一天预约'),(57,56000.00,40000.00,21,6,'o_1a6ne941j1mfe3s9nmjt7g1u9l571450338274885.jpg','百达丽鼻综合整形 见证美的奇迹','7,1,2,8,3,5,6',0,'57',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ne941j1mfe3s9nmjt7g1u9l571450338319460.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p>徐晓斐<br/></p><p><br/></p><p><b>资质：</b></p><p>主治医师</p><p><br/></p><p><b>简介：</b></p><p>百达丽首席鼻整形主任</p><p>百达丽首席胸部整形主任</p><p>中国医师协会整形专科会员</p><p>上海交通大学附属上海第九人民医院 整形外科硕士<br/></p>','<p>以五官黄金比例及鼻部美学标准为基础，秉承整体设计理念，采用影像设计精确测量，术前即可预知术后效果，对鼻梁、鼻翼、鼻头、鼻孔全方位综合设计及塑形，让美鼻俏变全局。手术项目：合资硅胶假体隆鼻+鼻中隔软骨移植鼻尖成型+鼻小柱延长+鼻头整形<br/></p><p><br/></p><p><b>适合人群：</b></p><p>宽鼻、鼻翼肥大、蒜头鼻、鼻部皮肤发硬，面部咬肌明显<br/></p><p><br/></p><p><b>治疗方法：</b></p><p>手术</p><p><br/></p><p><b>治疗次数：</b></p><p>一次</p><p><b><br/></b></p><p><b>治疗时长：</b></p><p>3-5小时</p><p><br/></p><p><b>是否住院：</b></p><p>是</p><p><b><br/></b></p><p><b>注意事项：</b></p><p>1、手术前一天洗澡，手术当天上手术台前要用肥皂洗去面部的污垢和油脂，尽量减少细菌的数量，手术前还应该剪鼻毛和清洁鼻腔； </p><p>2、手术前两周内,请勿服用含有阿斯匹林的药物,因为阿司匹林会使得血小板凝固的功能降低； </p><p>3、患有高血压和糖尿病的患者,应该在初诊时翔实向医生告知病情,以便应诊大夫确认手术方案； </p><p>4、手术前确定身体健康,无传染性疾病或其他身体炎症； </p><p>5、术前不要化妆<br/></p><p><b><br/></b></p><p><b>常见问题：</b></p><p>Q：鼻综合整形包含哪些项目？ </p><p>鼻综合整形强调的是全鼻塑形改造，而不仅仅是局部的改良，终理念就是针对每个顾客的需求，为其进行系统的个性化全鼻塑形。它要改变的是整个面部轮廓，因此除了增加鼻梁高度，还要兼顾鼻尖、鼻翼等处的角度、弧度等。 </p><p>Q：鼻综合整形与单纯隆鼻术相比有哪些优势? </p><p>鼻综合整形可以理解为一个术式，相对单纯隆鼻而言，鼻综合整形同时涉及鼻梁、鼻头、鼻孔、鼻翼、鼻小柱等多个部位，其中鼻梁部位多用假体，鼻头部位用软骨，因为涉及鼻部整体美学，因而鼻综合整形术前测量非常重要，求美者现有的鼻部特点离美学标准差多少都要量化，同时还要做到个性化设计，结合求美者自身特点，根据术前线决定哪个部位该加高或降低、缩短或延长。决定鼻整形成败的关键是术前诊断、设计、细致良好的沟通过程及手术的严谨程度。<br/></p><p><b><br/></b></p><p><b>效果展示：</b></p><p><b><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ne941j1mfe3s9nmjt7g1u9l571450338274885.jpg\"/><!--EndFragment--><br/></b></p>',1,'subcaticon/1450338193.59',1,'2015-12-17 15:51:12','费用包括手术费、材料费和麻醉费','需提前一天预约'),(58,2580.00,1380.00,4,6,'o_1a6nepkma82g1s21k9vp9bk6k641450338814511.jpg','水光针 还你水润年轻','7,1,2,8',0,'58',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nepkma82g1s21k9vp9bk6k641450338890618.jpg\"/><!--EndFragment--><br/></p><p><b><br/></b></p><p><b>姓名：</b></p><p>周汝真<br/></p><p><br/></p><p><b>资质：</b></p><p>主治医师</p><p><br/></p><p><b>简介：</b></p><p>北京大学附属第一医院皮肤科硕士</p><p>原福建医科大学附属第一医院皮肤科医师</p><p>中国医师协会皮肤科专科会员<br/></p>','<p>女人是水做的，皮肤缺水症，这些你中招了吗?婴儿时期女人皮肤中的含水量高，往后则逐年减少。如果把婴儿皮肤表面的水分相对含量定为100%，则20岁、30岁、60岁时分别下降为65%、45%、25%。百达丽水光注射让肌肤喝饱水，唤醒细胞再生功能！<br/></p><p><b><br/></b></p><p><b>适合人群：</b></p><p>肌肤干燥缺水。皮肤敏感时常泛红，发炎、甚至灼痛；皮肤暗沉，光洁度低：皮肤偏黄偏黑，粗糙无光；油田泛滥，毛孔粗大：痘痘粉刺肆虐，毛孔明显，易脱妆；极度缺水，皮肤干燥脱皮：肤色不均、有脱皮症状，面部出现细纹、色斑。</p><p><b><br/></b></p><p><b>治疗方法：</b></p><p>注射</p><p><br/></p><p><b>治疗次数：</b></p><p>首次</p><p><br/></p><p><b>治疗时长：</b></p><p>30分钟</p><p><br/></p><p><b>是否住院：</b></p><p>否</p><p><b><br/></b></p><p><b>注意事项：</b></p><p>注射前不要化妆，面部清洁<br/></p><p><b><br/></b></p><p><b>常见问题：</b></p><p>Q：水光注射玻尿酸和面膜，哪个更有优势？ </p><p>1次水光注射相当于1000次日常面膜护理，可以让皮肤“一次性喝饱水”，快速呈现水润通透的光泽度。 </p><p>Q：水光注射的适用范围？ </p><p> 有效改善脸部、颈部、手部的皱纹；收缩毛孔，增加弹力，紧致皮肤；有效改善鱼尾纹、法令纹等敏感部位，使皮肤水润柔嫩、有光泽。</p><p><br/></p><p><b>治疗效果：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nepkma82g1s21k9vp9bk6k641450338814511.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450338752.77',1,'2015-12-17 15:59:41','费用包括全部费用','需提前一天预约'),(59,15700.00,12800.00,15,6,'o_1a6nf9l1s1ndr1kob1rdpevr1aa06s1450339558521.jpg','完美胸型 hold住男神','7,1,2,8,3,5,6',0,'59',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nf9l1s1ndr1kob1rdpevr1aa06s1450339593920.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p>周珍艳</p><p><b><br/></b></p><p><b>资质：</b></p><p>主治医师</p><p><br/></p><p><b>简介：</b></p><p>毕业于复旦大学临床医学系</p><p>从事整形外科、美容外科临床工作和基础研究15余年<br/></p>','<p>百达丽采用&#34;内窥镜丰胸&#34;技术，从深入研究人体结构入手，讲究内窥镜下的精细与毫厘间的，通过智能可视系统监控，在显微直视下精准定位，克服传统丰胸依靠医生经验盲视弊端，假体植入效果更加自然完美，术后胸型自然，手感逼真，丰满挺拔，不影响生育及哺乳。手术材料：合资假体<br/></p><p><b><br/></b></p><p><b>适合人群：</b></p><p>1、乳房发育不良</p><p>2、轻度乳房下垂或松弛</p><p>3、乳房的大小或位置不对称</p><p>4、身体偏消瘦，BMI指数偏低的<br/></p><p><br/></p><p><b>治疗方法：</b></p><p>手术</p><p><br/></p><p><b>治疗次数：</b></p><p>一次</p><p><br/></p><p><b>治疗时长：</b></p><p>60-90分钟</p><p><br/></p><p><b>是否住院：</b></p><p>是</p><p><br/></p><p><b>注意事项：</b></p><p>1、手术前禁烟吸烟</p><p>2、停止服用阿司匹林</p><p>3、限制服用维他命E手</p><p>4、术前6-8小时开始<font color=\"#4d4a4a\">禁食（包含水）</font><br/></p><p><font color=\"#4d4a4a\">5、避开月经期</font></p><p><br/></p><p><b>常见问题：</b></p><p>Q：丰胸会很疼吗？</p><p>丰胸一般是不会很疼的，因为手术过程中医生会进行麻醉。手术结束后，会有一定的疼痛。但这些疼痛求美者一般还可以忍受，毕竟爱美是需要付出。 </p><p>Q：丰胸是长期的吗？ </p><p>丰胸是长期的，在正常的情况下假体的使用时间至少是十年，有的可能会伴随自己到一辈子。</p><p><b><br/></b></p><p><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6nf9l1s1ndr1kob1rdpevr1aa06s1450339558521.jpg\"/><!--EndFragment--><br/></p>',1,'subcaticon/1450339398.82',1,'2015-12-17 16:11:40','费用包括手术费、材料费和麻醉费','需要提前一天预约\r\n'),(60,33000.00,20000.00,14,6,'o_1a6ng1c3i1l61102dqcu1e9f1jte7k1450340128363.jpg','自体脂肪活细胞童颜术 助你\"逆生长\"','7,1,2,8,3,5,6',0,'60',1,'<p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ng1c3i1l61102dqcu1e9f1jte7k1450340145569.jpg\"/><!--EndFragment--><br/></p><p><br/></p><p><b>姓名：</b></p><p>顾清</p><p><br/></p><p><b>资质：</b></p><p>主治医师</p><p><br/></p><p><b>简介：</b></p><p>百达丽整形外科主治医师</p><p>百达丽首席脂肪塑形主任</p><p>上海交通大学附属上海第九人民医院整形外科硕士</p>','<p>自体脂肪活细胞童颜术，运用天然的原料——自体脂肪细胞，不但为你重塑优美脸型五官，更活化与生动你的表情，让好运始终跟随你。<br/></p><p><br/></p><p><b>适合人群：</b></p><p>主要针对于自身脂肪有多余可以提取用来注射的<br/></p><p><br/></p><p><b>治疗方法：</b></p><p>手术</p><p><br/></p><p><b>治疗次数：</b></p><p>一次</p><p><br/></p><p><b>治疗时长：</b></p><p>2-3小时</p><p><b><br/></b></p><p><b>是否住院：</b></p><p>是</p><p><b><br/></b></p><p><b>注意事项：</b></p><p>1、术前半个月禁服阿司匹林</p><p>2、避开月经期<br/></p><p><b><br/></b></p><p><b>常见问题：</b></p><p>Q：面部脂肪填充后怎么护理恢复快？ </p><p>保持静止，不要做夸张表情；不要按摩、刮痧；保持卫生，预防感染；3-4天内，针眼没有闭上前不要洗头；吸烟让血管收缩，血供减少，尽量不要吸烟。 </p><p>Q：术后减肥会影响脂肪填充效果吗？ </p><p>运动健身可以，节食不可以。节食会导致营养供给不足；也不可以熬夜，不良生活习惯对脂肪的生长都不好。<br/></p><p><br/></p><p><b>效果展示：</b></p><p><!--StartFragment--><img src=\"http://7xnpdb.com2.z0.glb.qiniucdn.com/o_1a6ng1c3i1l61102dqcu1e9f1jte7k1450340128363.jpg\"/></p>',1,'subcaticon/1450340058.87',1,'2015-12-17 16:20:48','费用仅含手术费','需要提前一天预约');
