INSERT INTO `item_comment` VALUES (1,1,42,'','终于鼓起勇气把眼睛给整了，真心便宜啊！分了六期没啥压力，坐等恢复变美，开心！',5,0,'2015-12-09 11:37:18',NULL,0),(2,2,42,'','激动，额头终于能露了，额头本身很窄很瘪，一直刘海挡着，现在可有自信了，又做了双眼皮，等双眼皮好了打算开始瘦脸喽，到时候全搞定再晒图。吼吼',5,0,'2015-12-09 14:12:55',NULL,0),(3,1,43,'comment/1449641686.17','感觉整个人都变了，气质完全不一样，主要看气质。',5,0,'2015-12-09 14:15:37',NULL,1),(4,4,44,'','医院高大上，价格还是有点高，不过技术可以的，医师相当专业样子，还是要到正规医院才放心，起码有保障的。',4,0,'2015-12-09 15:21:12',NULL,0),(5,7,44,'comment/1449645823.29','绝对不是心里作用啊！效果太明显了',5,0,'2015-12-09 15:23:45',NULL,0),(6,10,47,'comment/1449713053.51,comment/1449713061.99','基本恢复了，就是我想要的鼻型，生怕做不好出问题，医院整体特别正规，从头到尾服务很到位，医生也特别专业，交代的特别认真，我要开始下一步了，继续加油变美！',5,0,'2015-12-10 10:04:24',NULL,0),(7,12,47,'comment/1449713451.98,comment/1449713452.04','以前眼皮特别薄，还是内双，医生建议比较适合埋线的，恢复好快，本身做完就没怎么肿，打算开始美美的上妆啦，推荐给大家，撒花😄第一张还是戴了美瞳的，第二张没戴都好有神，哈哈',5,0,'2015-12-10 10:12:03',NULL,0),(8,15,48,'','医生人真好，特别热情，还帮我设计整体脸型，打完感觉立马就见效了，为了美丽啊，科技真厉害，我看以后整容都不用动刀了，唯一的遗憾就是不能永久保持，希望保持的久一点久一点久一点',5,1,'2015-12-10 10:19:27',NULL,0),(9,16,48,'','过了几天了，一根都没长，我都觉得一次就够了，早知道就不天天拔了，之前几天就要拔毛，累死个人，终于可以把腋毛搞干净了',5,1,'2015-12-10 10:29:17',NULL,0),(10,17,48,'comment/1449714695.66','其实本来下巴也还行，就是左边稍微有点缺肉，每次笑看镜子就不舒服，现在心理舒服多了！医院设备给人感觉好先进的样子，中国都这样，韩国岂不是更夸张。我还问医师他为什么不整，他说他没法给自己弄，自己技术太好信不着别人，太可爱了',5,0,'2015-12-10 10:36:18',NULL,0),(11,1,49,'comment/1449799847.72','袁医生很专业，医院整体设施也不错，现在变化还是很大的，大双眼皮不好看就弄的窄一点的，特别自然根本看不出来，朋友们也看不出来因为之前一直就化妆戴双眼皮贴，现在终于不用麻烦啦，如果大家想做的很自然的一定选埋线的，医生说这个后期也好改变哟',5,0,'2015-12-11 10:17:13',NULL,1),(12,4,49,'comment/1449800532.55,comment/1449800543.92','就是我想要的效果，感谢医院，感谢医生，感谢美分分平台🙏希望大家都越变越美哦',4,1,'2015-12-11 10:24:23',NULL,1),(13,5,50,'comment/1449802300.03,comment/1449802312.68','医师特别可爱，让我帮忙个评论个，肯定是5星好评咯！最恨的嘟嘟脸终于消失了，现在晚上睡觉都能笑醒，值得！推荐推荐，钱少的美眉们还可以分期，真好真好',5,0,'2015-12-11 10:56:54',NULL,0),(14,9,50,'','速度真快，搞定了！只管等着慢慢恢复了，期待着我的眼睛。一进医院就感觉到浓浓的整容氛围，不过一点不拖拉，嗖嗖的速度就给我弄完了。',4,1,'2015-12-11 11:00:34',NULL,0),(15,10,50,'comment/1449803073.17','好想整成张予曦的样子，怎么就那么好看呢，我的鼻子特别塌，做完唯一的感觉就是胀，还不敢晒照片，好了以后还要去弄弄牙齿',5,0,'2015-12-11 11:09:54',NULL,1),(16,6,51,'','其实感觉有些贵了，但是比较正规，比较涉及到口腔，还是很怕传染病之类滴，所以值得值得，医生说我牙齿保养的非常好，我是年年洗牙，常年用电动牙刷和牙线的，希望大家也能重视口腔保护',4,1,'2015-12-14 10:32:09',NULL,0),(17,16,51,'','还不错的，护士小姐好热情也不推销什么的，还特别认真的教我护养，十分钟就好了，也不痛的，我的腋下毛比较厚重，估计要多去几次才行。',4,1,'2015-12-14 11:25:52',NULL,1),(18,20,52,'','医院高大上，医生也很专业，其实国内整容技术也不差的，微整完全可以在国内弄，性价比很高！',5,0,'2015-12-14 11:31:48',NULL,0),(19,25,52,'comment/1450064006.08','恢复的特别好，就怕失败，还好还好，达到我的预期了，非常满意，各种推荐给大家哦、',5,1,'2015-12-14 11:35:11',NULL,0),(20,2,52,'comment/1450064369.74','看得出我打了哪里么？么想到效果这么赞，同学介绍的，分期付还比较人性化，感谢这个平台，从此开始要迷恋玻尿酸啦！',5,0,'2015-12-14 11:42:15',NULL,1),(21,19,53,'','不知道是不是心理作用，感觉荣光焕发啊！绝了绝了，我这张小干脸有救了，以后要就靠这个活着了，就是不知道有没有什么副作用，希望都是慢慢的保养，不要有任何副作用才好，这样就肆无忌惮了',5,0,'2015-12-15 11:08:13',NULL,0),(22,5,54,'comment/1450229975.63','过了两天暂时看不出变化，医生说要过一段时间才有效果，等不急了',4,0,'2015-12-16 09:39:44',NULL,1),(23,48,55,'comment/1450404382.79.jpg','刚刚纹好，设计眉形设计了好久，纹的很快，但是刚纹完跟个蜡笔小新一样，朋友都笑话我捏，555，希望一个星期结痂掉了后很会自然很自然喔',5,0,'2015-12-18 10:08:46',NULL,0),(24,46,56,'','牙齿略黄，做完可能不太习惯，感觉好假啊，看了要美美白才能显得协调了',5,0,'2015-12-18 15:44:28',NULL,0),(25,52,57,'comment/1450491612.57.jpg','只想把以前的照片都删干净，立马跳了一个等级，我要脱单！',5,0,'2015-12-19 10:22:10',NULL,0),(26,18,58,'','有效果的，最早一段时间脸上全是痘痘，现在明显皮肤变光滑多了，洗脸时手搓脸都能感受到，再接再厉，一定要把痘痘弄下去',5,0,'2015-12-21 11:35:58',NULL,0),(27,49,58,'comment/1450751447.44.jpg','效果可明显了，就是以后不能素颜了，比较遗憾，还好半永久，慢慢就褪色了，不会永远长在眼睛上。',5,0,'2015-12-22 10:32:21',NULL,0);
